(16, '1970-01-01', '1970-01-01', 8, 4, 'Pochera', 'bGoxAwJEQVzXXzGMkAz', 0, 'advocate@mydestiny.net', 'mtddFSWE', 'Thanks for stopping by! You shluod read my review and tell me what you think   And stick around for more book reviews, you can subscribe to my RSS feed or by email. I don''t spam!  I actually lived in Victoria for 2 years before I moved to Edmonton and then Vancouver. I like it for a few reasons, the main being that my partner lives and work here. I have a reason not to hate this place.I think it''s important to respond to people  even when you get hundreds of comments', 85, -1, '2013-06-13 18:57:28', '', '0'),
