(18, '1970-01-01', '1970-01-01', 4, 5, 'Friest', 'FNvKfXOwqfPXy', 0, 'galeon@galeon.waw.pl', 'wtKMemWJ', 'Rebekka from Germany, August 3, 2012 at 6:11 PM                                       Agriturismo Moscatello ist der perfekte Ort, um abeists des Gardasee-tourismus Italien zu erleben und die Seele baumeln zu lassen. Alles ist liebevoll und mit viel Stil eingerichtet und ausgestattet, sauber und gepflegt. Zimmer war sehr gere4umig mit rel. grodfem Bad. Zimmer sind klimatisiert. Auf Wunsch ist morgens ffcr wenig Geld ein reichliches Frfchstfccksbuffet erhe4ltlich. Der Schinken etc. wurden erst angerichtet, als wir zum Frfchstfcck kamen, so dass alles ganz frisch war. Inhaber und Mitarbeiter sind ausnahmslos freundlich und zuvorkommend. Wer ein Appartment bucht, findet ffcr le4ngere Aufenthalte gute Einkaufmf6glichkeiten in der Ne4he. Gleich um die Ecke ist ein namhaftes Weingut (Borgo la Caccia). Das Restaurant ist wegen seiner Einrichtung und der vielen Accessoires sehenswert. Geboten wird eine sehr gute innovative Abendkfcche. Parallel dazu ist die Auswahl regionaler Weine wie anderer Regionen Italiens lobenswert. Die Anlage ist weitle4ufig mit vielen schattigen Ple4tzchen. Toller Pool! Gern wieder!', 24, -1, '2013-06-14 04:22:33', '', '0'),
