(18, 'WEEKEND BENESSERE', '3 giorni 2 notti', '', '2013-03-09', '2013-06-29', '', '125', '', 3, '', '2 giorni in pernottamento + colazione + 1 entrata SPA\n125,00 Euro a persona (minimo 2 persone)\n\n\n', '', '', '', '0', 0, 0, 0, '2013-03-11 18:00:18', '2013-03-11 19:00:18', '0', 38),
(19, 'SUPER 7', '8 giorni 7 notti', '', '2012-12-07', '2013-03-31', '', '200', '', 3, '', ' 7 notti in camera doppia a € 200.00 (per persona) oppure camera singola a € 300.00 (per persona) , Trattamento Camera e colazione.\nSPECIALE 7 NOTTI e 3 CENE INCLUSE prendi it tuo tempo\nTreviso... se la vedi ti innamori e per 3 volte ceni gratis!\nLa quota comprende\n7 notti e 3 cene\nLa quota NON comprende\nBEVANDE', '', '', '', '0', 0, 0, 0, '2013-03-12 18:13:46', '2013-03-12 19:13:46', '0', 59),
(23, 'vieni a far pasqua in tranquillita''', '4 giorni 3 notti', '', '2013-03-15', '2013-03-31', '', '45', '35', 4, '', 'OFFERTA PER LA SANTA PASQUA\n3 giorni piu'' il pranzo di pasquetta 150,00 €-venerdi'' arrivo cena possibilita di andare ad alatri ad assistere alla VIA CRUCIS dal vivo\npernotto - sabato 1/2 pensione-domenica 1/2 pensione col pranzo di PASQUA -pasquetta pranzo...\n2 giorni piu'' pranzo di pasquetta 120,00-sabato 1\\2 pensione-domenica 1\\2 pensione pasquetta pranzo...', '', '', '', '0', 0, 0, 0, '2013-03-13 21:30:49', '2013-03-13 22:30:49', '0', 69),
(17, 'FREE SKI WEEK SETTIMANA SULLA NEVE', '7 giorni 6 notti', '', '2013-03-09', '2013-03-23', '', '260', '', 1, '', '7 giorni in appartamento con skipass Adamello ski valido per 6 giorni compreso nel prezzo\n370,00 euro a persona in monolocale (minimo 2 pax)\n300,00 euro a persona in monolocale (3 pax)\n310,00 euro a persona in bilocale (4 pax)\n280,00 euro a persona in bilocale (5 pax)\n260,00 euro a persona in bilocale (6 pax)', '', '', '', '0', 0, 0, 0, '2013-03-11 17:57:15', '2013-03-11 18:57:15', '0', 38),
(35, 'Fantastica Sorpresa per Pasqua per 4 persone', '4 giorni 3 notti', '', '2013-03-28', '2013-04-06', '', '600', '', 1, '', 'La Cascina Bricchetto Langhe, situata all''apice di una collina a circa 550 m., nei vigneti che la circondano produce uva moscato di qualità. L''attività agricola è corredata da attività di accoglienza turistica nelle due case ricavate nel corpo centrale dell''antica costruzione  in pietra di Langa durante la ristrutturazione conclusa nel 2006. Nella ristrutturazione sono state salvate le strutture originali ( es. i voltini in mattoni a vista) nella misura in cui è stasto possibile conciliarle con le esigenze di efficienza, sono stati usati materiali naturali e tipici, il risultato dell''intervento conservativo sono tra l''altro due case di grande "charme" con vista straordinaria  a 360° fino alle Alpi Marittime-Cozie e Pennine.\nLa cascina si trova a circa 10 km da Alba "capitale delle Langhe" e 3 km da Barbaresco paese in cui si produce l''omonimo e famoso vino, il paese di  Barolo patria del famosissimo vino si trova a circa 20 minuti d''auto. Le case che proponiamo si sviluppano su due piani, ancorchè affiancate sono totalmente indipendenti luna dall''altra, dotate di termocamino, riscaldamento e balcone. Le case sono arredate sia con antichi mobili di famiglia sia con  modernissimi mobili, dotate di cucine attrezzatissime, bagni uno diverso dall''altro, molto confortevoli e accoglienti. La Qualità è certificata dall''Ospitalità Italiana!\nCà dra Topia (Casa della pergola dell''uva): grande soggiorno con termocamino e cucina all''americana, una stanza doppia e un bagno al piano terreno, una scala che è un opera d''arte conduce al  piano superiore costituito da due grandi camere doppie (ciascuna dotata di porta finestra e due finestre) completate da un bagno privato ciascuna, lungo balcone  per godersi il tramonto e le stelle.\nCà der Forn (Casa del forno del pane): grande soggiorno su due livelli con termocamino, cucina e un bagno sono al piano terra, una aerea e comodissima scala conduce al piano superiore, due grandi camere doppie,  un bagno con vasca e doccia e un riparato balcone completano la casa. Aperitivo  o un bicchiere di vino da "meditazione" sul balcone sono caldamente consigliati.\nIn ciascuna casa è possibile inserire due letti singoli aggiuntivi.\n', '', '', '', '0', 0, 0, 0, '2013-03-18 12:50:10', '2013-03-18 13:54:24', '0', 71),
(34, 'Prenota in anticipo', '8 giorni 7 notti', '', '2013-03-17', '2013-08-09', '', '17', '', 1, '15% discount on the list price indicated on the website on bookings made before May 31. Please remember to indicate in the request code "prenota in anticipo".', 'Sconto del 15 % sul prezzo di listino indicato nel sito sulle prenotazioni effettuate entro il 31 Maggio. Si ricorda di indicare nella richiesta il codice "prenota in anticipo".', '', '15% Rabatt auf den Listenpreis auf der Website für Buchungen vor dem 31. Mai vorgenommen wird. Bitte beachten Sie in der Abfrage-Code "prenota in anticipo" geben.', '', '0', 0, 0, 0, '2013-03-17 10:21:41', '2013-03-17 12:48:53', '0', 75),
