(16, 'Love Yourself ', '1 giorno', '', '2013-03-22', '2013-06-30', '', '85', '', 4, '', '" LOVE YOURSELF ❤ ❤ " (1 notte)\n\n•1 cena & colazione \n•1 Ingresso al nostro centro benessere per il percorso di benessere con Sauna, Bagno turco con oli essenziali, doccia emozionale, cascata di ghiaccio e angolo delle tisane. \n•1 trattamento viso personalizzato(40’) \n\nPrezzo del pacchetto:\n \ncompreso fornitura accappatoi e ciabatte monouso e internet wi-fi \n', '', '', '', '0', 0, 0, 0, '2013-03-11 17:22:20', '2013-03-11 18:22:43', '0', 36),
(20, 'SUPER 5', '6 giorni 5 notti', '', '2012-12-07', '2013-03-31', '', '150', '', 3, '', '5 notti in camera doppia a € 150.00 (per persona) oppure camera singola a € 225.00 (per persona) , Trattamento Camera e colazione.\nPrendi il tuo tempo: Speciale 5 notti con 2 cene incluse\nVisita Venezia e molto altro ... ti suggeriamo noi! E poi assapora la nostra cucina... 2 cene sono gratis!\nLa quota comprende\n5 NOTTI e 2 CENE\nLa quota NON comprende\nBEVANDE', '', '', '', '0', 0, 0, 0, '2013-03-12 18:15:36', '2013-03-12 19:15:36', '0', 59),
(21, 'Bio Agriturismo Toscana Lunigiana sconto 10% Mezza pensione 54 euro a persona a notte', '5 giorni 4 notti', '', '2013-05-01', '2013-06-30', '', '54', '', 4, 'Last, minute, 2012, discount, villas, Batesville, Fosdinovo, Fivizzano, Lunigiana, Massa, Tuscany.\n10% discount for stay of two adults for at least four nights with half-board. 54 euro per person per day instead of 60 €.', 'Last,minute,2012,sconto,agriturismo,Aulla,Fosdinovo,Fivizzano,Lunigiana,Massa,Toscana.\nSconto del 10% per permanenza di due adulti per almeno quattro notti con il trattamento di mezza pensione. 54 euro a persona al giorno invece di 60 euro.\n', '', 'Last, Minute, 2012, Rabatt, Villen, Batesville, Fosdinovo, Fivizzano, Lunigiana, Massa, Toskana.\n10% Rabatt für einen Aufenthalt von zwei Erwachsenen für mindestens vier Übernachtungen mit Halbpension. 54 € pro Person pro Tag anstelle von 60 €.', '', '0', 0, 1, 0, '2013-03-12 19:16:43', '2013-03-12 20:26:26', '0', 61),
(22, 'Pasqua 2013 Offerta Bed and breakfast Sunrise', '3 giorni 2 notti', '', '2013-03-30', '2013-04-01', '', '25', '', 3, 'Best Deal For easter 2013 in Tuscany an accomodation in a double room ensuite bathroom with, tv lcd, courtesy kit, hairdyer, minifridge fresh water free, facilities to prepare tea. Rich breakfast with cake home made, bread butter jam, nutella, toast ham and cheese, eggs, fruit of juice, tea, coffe, milk, cappuccino. Parking free entrance\n', 'Pasqua 2013 offerta è la migliore per venire in Toscana con sistemazione in camera  matrimoniale con bagno in camera con tv lcd, set cortesia, asciugacapelli, minifrigo con acqua fresca gratuita, bollitore.Vi aspetta a colazione: torta fatta in casa, pane e marmellate, nutella, toast, uova, succo d''arancia, the, caffè e latte e cappuccino. Parcheggio ed entrata libera', '', '', '', '0', 0, 1, 0, '2013-03-12 22:21:04', '2013-03-12 23:21:04', '0', 57),
(24, 'vieni a cisogna per scoprire la bella ciociaria', '7 giorni 6 notti', '', '2013-03-15', '2013-10-31', '', '40', '25', 4, '', 'Piccolo agriturismo nel verde e nel silenzio della campagna CIOCIARA, ma a soli 8 km dal casello di anagni-fiuggi a 50 da roma e 15 da valmontone col suo parco giochi “magic rainbow” e al centro della bella ciociaria con le sue maestose e mistiche abbazie-cassino fossanova subiaco trisulti casamari-e i suoi collinari paesi dai vicoli labirintici e all’improvviso le loro cattedrali-anagni fiuggi alatri veroli fumone ferentino-con le sue misteriose grotte-pastena e collepardo-le sue terme o spa-ferentino e fiuggi –con le sue cascate…in citta’-isola liri-e ai suoi confini tho’ c’e’ roma e tivoli e palestrina e i castelli romani e a 15 km il parco giochi di valmontone e il suo outlet.\nServizi: 6 camere 2 appartamenti connessione wi-fi gratuita  agriristoro piscina e giochi per grandi e piccoli\nPrezzi: 45,00 la mezza pensione- per 6 giorni mezza pensione 40,00-\n55,00 camera doppia con colazione\nAppartamenti-compresi di biancheria enel e gas-80,00 al giorno 150,00 per i week end  350,00 la settimana\nfacebook: Agriturismo Cisogna MarioColangelo\n', '', '', '', '1', 0, 0, 0, '2013-03-13 21:34:04', '2013-03-13 22:34:04', '0', 69),
(25, 'Relax e scoperta del Mondo delle Api', '3 giorni 2 notti', '', '2013-03-21', '2013-04-13', '', '119', 'GRATIS fino a 12 anni', 2, '', 'Venerdi:\nArrivo in appartamento e sistemazione per le ore 12.00\nPranzo in località Poggio Murella.\n(Sconto 10%)\nNel pomeriggio Ingresso in piscina presso Terme di Saturnia.\nCena in località Saturnia.(sconto 10%)\nSabato:\nEscursione a piedi con guida escursionistica.\nPranzo al sacco.\nNel pomeriggio visita al Mondo delle Api con degustazione del miele direttamente da alveare.\nCena In località Saturnia.(sconto 10%)\nDomenica:\nPartenza prevista per le ore 10,00.\n', '', '', '', '0', 0, 1, 0, '2013-03-14 09:08:25', '2013-04-01 10:07:50', '0', 62),
(26, 'PASQUA NEL CHIANTI ', '4 giorni 3 notti', '', '2013-03-14', '2013-03-29', '', '90', '30', 2, '', 'Ci troviamo nel cuore del Chianti in posizione ideale per visitare le belle città di Firenze, Siena e San Gimignano senza scordare i piccoli e suggestivi boghi che ci circondano dove degustare la buona cucina, gli ottimi vini e l''0lio extra vergine di oliva. Sarà piacevole trascorrere qualche giorno nella nostra splendida zona.Possiamo organizzare insieme anche piacevoli camminate nella campagna circostante, ci son percorsi di tutte le difficoltà Soggiorno minimo 3 notti disponiamo di appartamenti da un minimo di 2 ad un massimo di 10 posti letto; arredati in stile tipico toscano, confortevoli e completamente attrezzati. Il prezzo include acqua, elettricità  biancheria camera, bagno e cucina. Offertissima €30,00 a persona a notte . \nRiscaldamento  € 1,00 a mc \nTassa di soggiorno €1,50 a notte a persona maggiore di 14 anni.\nPossibilità su richiesta di prenotare il Pranzo di Pasqua presso il nostro ristorante situato ad un km dall’agriturismo al prezzo speciale di € 38,00.\n Vi aspettiamo contattateci il prima possibile! 338-7983713 oppure info@lequercioline.com\n', '', '', '', '0', 0, 0, 0, '2013-03-14 10:53:38', '2013-03-14 11:53:38', '0', 70),
(27, 'Il Paradiso delle Famiglie', '7 giorni 6 notti', '', '2013-04-26', '2013-10-18', '', '195', '(vedi dettaglio) ', 2, '', 'Prezzi: gratis fino a 8 anni; 30 Eu/giorno da 12 anni in su\n<br><br>\nLa Maremma è un mondo che appaga la curiosità dei piccoli e vizia i grandi . . . Ecco una grande varietà di attrazioni per genitori e bambini. Occupate liberamente le vostre giornate senza programmi. Col ritmo tranquillo della campagna scoprirete un territorio inimitabile. In appartamento trovate le informazioni necessarie. Oppure chiedetemi come godervi la vostra vacanza.\n<br><br>\nTERME DI SATURNIA - a pagamento, ingresso ridotto in convenzione - Una stazione termale antichissima a soli 3 km da noi, con l''acqua che sgorga dal cratere sotto i piedi.\n<br>\nLE CASCATELLE - accesso libero !!! - L''icona di Saturnia: un terrazzamento di pozze termali a cielo aperto in uno scenario unico al mondo - anche di notte al chiaro di luna.\n<br><br>\nIL MONDO DELLE API: Visita per grandi e piccini in azienda avicoltrice con degustazione del miele. Gratis per i bambini fino a 8  anni gratis.\n<br><br>\nSENTIERI GROSSETANI: perdetersi un paio d''ore con una guida ambientale nella dolcezza dei nostri saliscendi e gustarsi un pranzo al sacco nei boschi della Maremma.\n<br><br>\nTOMBE, NECROPOLI ETRUSCHE e VIE CAVE: Siti archeologici affascinanti e misteriosi, lascito di una civiltà grandiosa pervenuta fino ai giorni nostri. Da soli, o con guida.\n<br><br>\nTUTTI A CAVALLO: dietro casa nostra trovate gli amici del maneggio che vi insegnano a cavalcare o vi portano in escursione sui loro cavalli.\n<br><br>\nVINO E VIGNETI: presso prestigiose cantine e deliziosi produttori vi faranno degustare grandi vini e mostreranno ai piccoli come lo si produce.\n<br><br>\nMARE, ISOLE, SPIAGGE: Argentario e imbarco per Isola del Giglio a un''ora scarsa di strada . . . gita imperdibile verso litorali cristallini e arenili da favola !!\n<br><br>\nIN BICI: La nostra guida escursionistica vi può condurre a spasso per la Maremma pedalando in scioltezza, su itinerari di tutte le tipologie. Senza fatica e divertendosi.\n<br><br>\nI BORGHI NEL TUFO: Pitigliano coll ghetto ebraico, Sovana, Sorano, Capalbio, Montemerano . . . l''armonia e la singolarità di gemme incastonate da secoli in una natura rigogliosa. Da soli o con guida.\n<br><br>\nNEVE & SCI: c''è il comprensorio dell''Amiata a 3/4 d''ora da noi ...<br> <br>\nFORMAGGI E LATTTICINI: un vicino caseificio con ottimi prodotti vi aspetta per assaggiarli e per mostrare ai vostri figli come si ottengono\n<br><br>\nPARCHI E RISERVE NATURALI: dal Parco Nazionale dell''Arcipelago Toscano a quello dell''Uccellina, alle riserve naturali "nascoste" nell''entroterra. Flora e fauna in abbondanza per ogni stagione. Da soli o con guida\n<br><br>\nMANGIARE TIPICO: pranzo o cena a Semproniano, Poggio Murella, Saturnia . . i nostri ristoratori convenzionati vi offrono il meglio della cucina locale a costi contenuti.\n<br><br>\nGRANDI METE DIETRO L''ANGOLO: Siena, Val d''Orcia, Orvieto, Lago di Bolsena, Civita di Bagnoregio, Tarquinia . . . Da soli o con guida\n<br><br>\nSPOSTARSI: Preferite lasciare l''auto in cortilei? I nostri trasportatori privati possono accompagnarvi in qualsiasi posto e riportarvi indietro a prezzi ragionevoli. Listino in appartamento.\n<br><br>\nGIOCARE IN CORTILE: portate le bici dei bambini e lasciateli scorrazzare liberamente come se foste a casa vostra. Voi intanto vi leggete il giornale spaparazzati sulla sdraio nel sole della Maremma.<br><br>\nVi aspettiamo coi vostri figli !<br>\nRaffaella Bertini & Lollo', '', '', '', '1', 0, 1, 0, '2013-03-14 17:00:53', '2013-05-12 18:33:58', '0', 62),
(28, 'Weekend fai-da-te', '3 giorni 2 notti', '', '2013-03-31', '2013-10-19', '', '30', '(vedi descrizione) ', 2, '', '! ALTA QUALITA'' & LOW-COST !\n<br>\n- bambini fino a 8 anni = gratis<br>\n- da 8 a 18 anni = 15 Eu/persona<br>\n- solo pernottamento<br>\n- biancheria<br>\n- asciugamani<br>\n- cucina completa, attrezzata\n- stoviglie, tovaglia, posate, pentole<br>\n<br>\nEXTRA SU RICHIESTA\n<br>\n- cestino per il pranzo\n<br>\n- spesa di prodotti locali (km 0) biologici nel frigorifero per la vostra colazione\n<br><br>\nI VANTAGGI PER I NOSTRI OSPITI\n<br>\n- 10% sconto presso ristoranti tipici e pizzerie convenzionate, nelle immediate vicinanze e nelle località limitrofe<br>\n- Riduzione biglietto entrata Terme di Saturnia<br>\n- Riduzione biglietto ridotto per personale medico<br>\n- Servizio taxi privato per borghi limitrofi ed escursioni (Pitigliano, Lago di Bolsena, Orvieto, Monte Argentario / Isola del Giglio, Tombe etrusche & Vie Cave).\n<br>Listino prezzi in ciascun appartamento.<br>\n- Visita guidata con degustazione c/o prestigioso azienda vitivinicola di rinomanza mondiale (a partire 15 Eu/testa)<br><br><br>\nVi aspettiamo !<br>\nRaffaella Bertini & Lollo', '', '', '', '1', 0, 0, 0, '2013-03-14 17:10:37', '2013-05-12 18:42:55', '0', 62),
(29, 'Fly & Drive . . . and relax !', '2 giorni 1 notte', '', '2013-04-30', '2013-10-19', '', '350', '(vedi dettaglio) ', 2, '', 'Veniamo a prenderti e ti portiamo nel nostro piccolo  angolo di paradiso!\n<br><br>\nGIORNO 1<br><br>\n- Prelievo in aeroporto o in stazione (Fiumicino-RM, A. Vespucci-FI, G.Galilei-PI, FS Albinia, FS Orvieto)<br>\n- transfer a Saturnia<br>\n- check in, assegnazione appartamento, brindisi di benvenuto in corte<br>\n- visita guidata con degustazione a prestigiosa azienda vitivinicola<br>\n- agri-shopping: miele, ricotta, formaggi, carne di Chianina direttamente dal produttore<br>\n- cena in ristorante con cucina tipica<br>\n- dopocena: bagno al chiaro di luna alle Cascatelle del Molino<br>\n<br>\n\nGIORNO 2\n<br><br>\n- Colazione con prodotti tipici<br>\n- transfer e giornata alle Terme di Saturnia<br>\n- trattamento benessere a scelta<br>\n- pranzo presso le Terme<br>\n- transfer di ritorno alla stazione o all''aeroporto<br><br>', '', '', '', '1', 0, 0, 0, '2013-03-14 17:21:30', '2013-05-12 18:37:37', '0', 62),
