(32, 'Speciale Pasqua in Sardegna', '3 giorni 2 notti', '', '2013-03-30', '2013-04-01', '', '129.00', '', 4, 'Your Easter weekend in Sardinia comfort and good food.\nLet groped by our delicious suggestions!\n\nThe package for 2 people includes:\n\n2 nights in a standard double room or superior half board (drinks not included) + lunch on Easter Monday\nUpon arrival to the taste of chocolate tastings\nChoco-present in the room\nFriday, 29.03 and Saturday 30.03 - Dinner with a menu of the day at the Bacchus Restaurant\nSunday, 31.03 - Easter Dinner at Bacchus Restaurant\nMonday, 01.04 - Lunch on Easter Monday at the Bacchus Restaurant\nFree access to fitness and relaxation: turkish bath, emotional showers, solarium and fitness room.\nfree parking\nHigh-Speed ​​Internet: wi-fi and wired high-speed\n', 'Il tuo weekend di Pasqua in Sardegna all''insegna del comfort e della buona cucina. \nLasciati tentare dalle nostre deliziose proposte!\n\nIl pacchetto per 2 persone include:\n\n2 notti in camera doppia standard o superior in mezza pensione (bevande escluse) + pranzo di Pasquetta\nAll''arrivo degustazioni al sapor di cioccolato\nChoco-omaggio in camera\nVenerdì 29.03 e Sabato 30.03 - Cena con menù del giorno presso il Bacchus Ristorante\nDomenica 31.03 – Cena di Pasqua presso il Bacchus Ristorante\nLunedì 01.04 – Pranzo di Pasquetta presso il Bacchus Ristorante\nAccesso libero all''area relax e fitness: bagno turco, docce emozionali, solarium e sala fitness.\nParcheggio gratuito\nConnessione internet gratuita: wi-fi e via cavo ad alta velocità\n\n', '', '', '', '0', 0, 0, 0, '2013-03-15 11:20:25', '2013-03-15 12:23:40', '0', 74),
(33, 'Happy Saturday - dormi gratis!', '1 giorno', '', '2013-03-16', '2013-03-23', '', '34.50', '', 4, '', 'Un''idea originale per un weekend a Olbia diverso dal solito... cena a soli € 34,50 per persona, e dormi gratis al Jazz Hotel!\n\nL''offerta è valida per minimo 2 persone, su prenotazione e comprende:\n\nMENU'' a scelta tra BACCHUS MARE O BACCHUS TERRA (composto da antipasto, scelta tra primo e secondo con contorno, dessert, acqua e 1 bicchiere di vino), il tutto a soli € 34,50 per persona.\n\nCAMERA STANDARD con accesso libero all''area relax (bagno turco, docce emozionali, solarium e zona fitness), GRATUITA\n\n\nPrenota ora la tua cena con la camera inclusa!\n\nConsegna camera dalle ore 14.00 di Sabato.\n\nCena dalle 19.30 alle 21.30 (in fase di prenotazione segnalare nel campo NOTE il menù scelto)\n\nOfferta valida solo per la notte di Sabato 16 e 23 Marzo 2013 \n', '', '', '', '0', 0, 0, 0, '2013-03-15 11:23:33', '2013-03-15 12:23:33', '0', 74),
(36, 'Modica (RG.) – Pacchetti - Offerte per una Pasqua nei siti Unesco del Val di Noto.', '4 giorni 3 notti', '', '2013-03-29', '2013-04-01', '', '98', '', 4, '', '- € 57,00 una notte con prima colazione e Pranzo di Pasqua;\n- € 80,00 due notti con prima colazione e Pranzo di Pasqua;\n- € 98,00 tre notti con prima colazione e Pranzo di Pasqua.\nI prezzi sopra esposti si intendono a persona. Le varie opzioni sono modificali in base alle richieste degli ospiti ed è anche possibile richiedere il pranzo di Pasquetta.\nTariffe in B&B (solo pernottamento e prima colazione) : camera doppia € 60,00 – camera tripla € 75,00; sconto 10% per due pernottamenti, sconto 15% per tre pernottamenti.\nPer informazioni (anche sui menù) e prenotazioni scrivere a info@giogaia.it o chiamare i numeri  0932/751769  oppure  339/7693623 .\nGiusy e Piero Vi aspettano alla Giogaia.', '', '', '', '0', 0, 0, 0, '2013-03-18 18:26:04', '2013-03-18 19:26:04', '0', 78),
