(38, 'Pasqua 2013', '3 giorni 2 notti', '', '2013-03-30', '2013-04-01', '', '110', 'gratis', 1, '', 'Due notti in agriturismo con possibilità di sistemazione in monolocale (fino a 3 persone) e in bilocale (fino a 4 persone). \nSabato 30 marzo saremo lieti di offrire a ogni coppia una Degustazione di vini marchigiani per una persona all’Osteria Alimentare di Cagli.\nSu richiesta Colazione di Pasqua.', '', '', '', '0', 0, 0, 0, '2013-03-19 09:36:46', '2013-03-19 10:36:46', '0', 86),
(39, 'Pasqua e tradizione', '5 giorni 4 notti', '', '2013-03-28', '2013-04-01', '', '340', '', 1, '', 'Giovedì 28 marzo: arrivo e sistemazione in Agriturismo;\nVenerdì 29 marzo: Visita alla città di Cagli e Processione del Venerdì Santo;\nSabato 30 marzo: passeggiata di 3 ore con cercatore di tartufi e cena al tartufo (marzuolo) per 2 persone;\nDomenica 31 marzo: colazione di Pasqua per 2 persone;\nLunedì 1 aprile: visita al monastero di Fonte Avellana e pic-nic per 2 persone.\n', '', '', '', '0', 0, 0, 0, '2013-03-19 09:42:17', '2013-03-19 10:42:17', '0', 86),
