(41, '''Antica Masseria'' didattica', '2 giorni 1 notte', '', '2013-04-04', '2013-05-31', '', '60 ', '30 ', 4, '', 'Cena presso la nostra Sala Ricevimenti Dimora Mazzaro, pernotto e colazione preparata dai nostri chef presso Hotel Relais Antica Masseria. \nVisita guidata presso la Masseria Madonna delle Grazie, nei pressi del nostro hotel svolgendo le seguenti attività didattiche ideali per grandi e piccoli:\n  -  cicli delle produzioni delle colture: cereali, foraggi, olive, ortaggi, e frutta (ciliegie, mandorle ecc.);\n  -  allevamento di pecore, capre e suini;\n  -  ciclo di trasformazione dal grano al pane, alla focaccia, ecc.;\n  -  ciclo di trasformazione dalle olive all’olio con imbottigliamento;\n  -  percorso dell''orto;\n  -  osservazione degli animali di bassa corte, cavalli murgesi e asini;\n  -  percorso di conoscenza del sistema ecocompatibile;\n  -  percorso naturalistico in un vasto bosco con identificazione e classificazione di flora e fauna selvatica;\n  -  visita alla Chiesetta rupestre della Madonna delle Grazie del 400, all''interno di una grotta dove si svolge, ogni anno, nell''ultima domenica del mese di maggio, la Festa della Madonna delle Grazie;\n  -  percorso di coppatura del legno (attraverso la potatura degli alberi del bosco) per la produzione di energia elettrica;\n  -  visita alla voliera con falchi e uccelli minori;\n  -  visita ai laghetti con anatre e oche.\n', '', '', '', '0', 0, 0, 0, '2013-03-19 10:50:54', '2013-03-19 11:50:54', '0', 87),
(42, 'Gusto e benessere in un''Antica Masseria', '2 giorni 1 notte', '', '2013-04-04', '2013-05-31', '', '100', '50 ', 5, '', 'Arrivo e sistemazione in Hotel, cena (antipasti, primo, secondo, frutta, dolce, bevande incluse), pernotto, colazione, percorso benessere presso vicino centro convenzionato e pranzo. \nI bambini non usufruiscono del percorso benessere!', '', '', '', '0', 0, 0, 0, '2013-03-19 13:30:54', '2013-03-19 14:42:58', '0', 87),
