(71, 'SCOPRI LE VILLE E LE VALLI', '3 giorni 2 notti', '', '2013-04-15', '2013-11-30', '', '85', '', 3, '', 'Un suggestivo viaggio alla scoperta di due meravigliose Ville Venete del territorio, Villa Arvedi in Valpantena e Villa Mosconi Bertani in Valpolicella.\n \nVenerdì:\n\n- Wellcome bollicine in Suite\n- Visita a Villa Arvedi e al suo Giardino all’Italiana\n                \nSabato:\n\n- Visita a Villa Mosconi Bertani e al suo Giardino Romantico.\n\n\nCosto complessivo per due persone Euro 170\nIl pacchetto si struttura nel fine settimana con arrivo il venerdì e partenza la domenica.\n', '', '', '', '1', 0, 0, 0, '2013-04-07 13:37:50', '2013-04-07 15:37:50', '0', 120),
(72, 'DEGUSTAZIONE IN VILLA', '3 giorni 2 notti', '', '2013-04-14', '2013-11-30', '', '110', '', 3, '', 'Con questo pacchetto il viaggio alla scoperta di Villa Arvedi e di Villa Mosconi Bertani, si completa con i sapori e le produzioni di entrambe le Tenute.\n \nVenerdì:\n\n- Wellcome bollicine in Suite\n- Visita a Villa Arvedi e al suo Giardino all’Italiana con degustazione Olio\nExtravergine spremuto a freddo dell’Oleificio di Villa Arvedi.\n \nSabato:\n\n- Visita a Villa Mosconi Bertani e al suo Giardino Romantico con degustazione di vini autoctoni Doc e IGT della Tenuta\n \nCosto complessivo per due persone Euro 220\n\n\nIl pacchetto si struttura nel fine settimana con arrivo il venerdì e partenza la domenica.\n', '', '', '', '1', 0, 0, 0, '2013-04-07 13:41:05', '2013-04-07 15:41:05', '0', 120),
(73, 'RISPARMIA CON NOI PER IL PONTE DEL 25 APRILE E DEL 1° MAGGIO!', '1 giorno', '', '2013-04-19', '2013-05-05', '', '20', '', 3, '', 'C''è crisi, è vero, ma abbiamo comunque diritto di riposarci e distrarci un po'' con paesaggi, suoni e pensieri positivi senza svenarsi! Con 20, 00€ camera/notte vivrai il tuo soggiorno all''insegna del risparmio con noi alla Casa Rosa. E se prenoti entro il 15 aprile o vieni con almeno altre due persone, per te uno sconto extra! \nL''offerta è valida dal 19 Aprile al 5 Maggio.\nNel prezzo sono compresi: pernottamento, bagno privato, ricca e genuina prima colazione, biancheria (letto e bagno), utilizzo del frigobar in camera e dei servizi esterni, parcheggio, visita all’azienda agricola.', '', '', '', '0', 0, 0, 0, '2013-04-07 14:45:11', '2013-04-07 16:45:11', '0', 126),
