(78, 'AGRITURISMO ACQUAFREDDA', '1 giorno', '', '2013-04-08', '2013-07-15', '', '18', '5', 1, 'The Farm Acquafredda is inserted into the beautiful, unspoiled scenery of the National Park of Cilento and Vallo di Diano. Has a variety of accommodation created from the renovation of a typical stone house and uses a warm family welcome and comfortable hospitality. But in addition to the tranquility of the place and the unique characteristics of the structure, a place leading up to the kitchen that offers even as the main pivot of the activity: purely traditional, genuine and full of forgotten flavors. Is it truly the ideal place to spend a relaxing holiday, quiet and close contact with nature. What are you waiting, come and visit us! Tel 0975395532 Cell 3386875364\nGPS (40.41616, 15.46203)\nhttp://www.agriturismoacquafredda.it\ninfo@agriturismoacquafredda.it', 'L''Agriturismo Acquafredda è inserito nel splendido scenario incontaminato del Parco Nazionale del Cilento e Vallo di Diano. Dispone di particolari alloggi ricavati dalla ristrutturazione di un tipico casale in pietra e si avvale di una calda accoglienza familiare e una confortevole ospitalità. Ma oltre alla suggestività del posto e alle caratteristiche singolari della struttura, una collocazione di primo piano spetta alla cucina che si offre addirittura come il perno principale dell''attività: prettamente tradizionale, genuina e ricca di sapori dimenticati. Rappresenta davvero il luogo ideale dove trascorrere una vacanza all''insegna del relax, della tranquillità e del contatto stretto con la natura. Che aspetti, vieni a trovarci! Tel 0975395532 Cell. 3386875364\nGPS (40.41616, 15.46203)\nhttp://www.agriturismoacquafredda.it\ninfo@agriturismoacquafredda.it\n', '', 'Die Farm Acquafredda in die schöne, unberührte Landschaft des Nationalpark Cilento und Vallo di Diano eingefügt. Hat eine Vielzahl an Unterkünften, von der Renovierung eines typischen Steinhaus erstellt und verwendet eine warme familiäre Atmosphäre und komfortable Gastlichkeit. Aber neben der Ruhe des Ortes und den einzigartigen Eigenschaften der Struktur, einen Platz im Vorfeld der Küche, die auch als wichtigster Pivot der Tätigkeit bietet: rein traditionellen, echten und voller vergessenen Aromen. Ist es wirklich der ideale Ort für einen erholsamen Urlaub, ruhig und engen Kontakt mit der Natur zu verbringen. Worauf wartest du noch, kommen Sie und besuchen Sie uns! Tel 0975395532 Handy 3386875364\nGPS (40,41616, 15,46203)\nhttp://www.agriturismoacquafredda.it\ninfo@agriturismoacquafredda.it', '', '0', 0, 0, 0, '2013-04-08 10:20:03', '2013-04-08 12:20:03', '0', 129),
(79, '25 Aprile al Borgo Santa Giulia', '1 giorno', '', '2013-04-25', '2013-04-25', '', '30', '', 6, '', 'Menù del 25 Aprile\n\nRavioli al parmigiano reggiano con maggiorana e riduzione di fondo di vitello\n***\nLombetto di coniglio disossato alle erbe aromatiche e polentina croccante\n***\nTortino di mele con salsa vaniglia\nAcqua, vino Curtefranca e caffè\n\nPossibilità di pranzare in giardino o sotto al porticato\n\n€ 30', '', '', '', '0', 0, 0, 0, '2013-04-19 10:29:31', '2013-04-19 12:29:31', '0', 102),
