(81, 'Offerta di primavera', '1 giorno', '', '2013-04-25', '2013-05-01', '', '125', '', 4, '', 'Per i week end del 25 Aprile e 1 Maggio:\n\n1 notte\n€ 125 per coppia con:\ncena con menù 3 portate, bevande escluse + camera + colazione\n\n2 notti\n€ 19O per coppia con:\n1 cena con menù 3 portate, bevande escluse + camera + colazione', '', '', '', '0', 0, 0, 0, '2013-04-19 11:23:51', '2013-04-19 13:23:51', '0', 102),
(82, 'Terme Vino Storia Natura', '3 giorni 2 notti', '', '2013-04-01', '2013-10-19', '', '215', '(vedi dettaglio) ', 2, '', 'Bambini fino a 8  anni = 110 Eu\n<br><br>\nVENERDI''<br>\n- arrivo entro h 14, check in<br>\n- transfer alle Terme di Saturnia<br>\n- visita al borgo di Saturnia<br>\n- cena in ristorante con cucina tipica<br>\n- transfer in appartamento<br>\n<br>\nSABATO <br>\n- visita guidata ai Borghi del Tufo e alle Tombe Etrusche<br>\n- pranzo al sacco con cestino, nel verde del parco archeologico<br>\n- visita alla lavorazione artigianale del tufo<br>\n- cena in ristorante con cucina tipica<br>\n- terme "by night": bagno al chiaro di luna alle Cascatelle<br>\n<br>\nDOMENICA<br>\n- passeggiata rilassante con guida alla scoperta della Maremma autentica<br>\n- visita guidata con degustazione a prestigiosa azienda vitivinicola<br>\n- pranzo al sacco con cestino<br>\n- pomeriggio di relax alle Terme di Saturnia<br>\n- rientro in appartamento e partenza<br>\n<br>\nINCLUSO NEL COSTO:<br>\n- il biglietto di entrata alle Terme di Saturnia<br>\n- i trasferimenti (lasciate l''auto qui in cortile!)<br>\n- i pasti in ristorante<br>\n- la guida turistico-ambientale<br>\n- la visita con degustazione alla cantina/vigneto<br>\n- il soggiorno a L''Alba Casa Vacanze (pernottamento in appartamento, biancheria, asciugamani, cucina completa & attrezzata - stoviglie, tovaglia, posate, pentole)<br>\n- il cestino per il pranzo (2 panini, 1 frutto, 1 snack, 1 bottiglietta acqua)<br>\n<br>\nCOSTI EXTRA o SU RICHIESTA:<br>\n- acquisto di spesa di prodotti locali biologici a km 0 per la vostra colazione<br>\n- bevande', '', '', '', '1', 0, 0, 0, '2013-04-24 09:30:42', '2013-05-12 18:42:02', '0', 62),
(83, 'Escursioni di Primavera', '4 giorni 3 notti', '', '2013-04-25', '2013-05-01', '', '99', '60', 3, '', 'Escursioni nei viottoli profumati di primule e viole respirando aria pura e incontaminata lontano da caos e smog delle città in genere, insomma un modo pur se per pochi giorni per disintossicarsi dall''inquinamento e vivere tra il verde primaverile della natura godendo viste panoramiche indimenticabili.', '', '', '', '0', 0, 0, 0, '2013-04-24 16:33:03', '2013-04-24 18:46:02', '0', 134);
INSERT INTO `trv_offers` (`offer_id`, `offer_title`, `offer_duration`, `offer_availability`, `offer_start_date`, `offer_finish_date`, `offer_end_price`, `offer_price_adult`, `offer_price_children`, `offer_included`, `offer_package_description_en`, `offer_package_description_it`, `offer_package_description_fr`, `offer_package_description_de`, `offer_package_description_es`, `offer_status`, `total_view`, `total_like`, `total_comment`, `offer_created_on`, `offer_updated_on`, `is_featured`, `user_id`) VALUES
(84, 'A piedi, in bici, a cavallo', '4 giorni 3 notti', '', '2013-04-25', '2013-10-19', '', '170', '', 1, '', 'Hai un ponte da passare nel silenzio, lontano dal caos? Vuoi scordarti di auto, semafori, e motori?\n<br>\nMa soprattutto . . . hai del fiato da sprecare per tuffarti a pié pari nella grandiosa natura della Maremma?<br>\n<br>\nGIORNO 1<br>\n- Arrivo > check-in > brindisi di benvenuto in corte<br>\n- Cena a Poggio Murella presso ristorante convenzionato<br>\n- Dopocena: bagno al chiaro di luna nelle Cascatelle del Mulino \n<br><br>\nGIORNO 2<br>\n- Trekking ad anello con guida turistico-ambientale professionista. Visitate i borghi del tufo attraversando boschi, siti etruschi, prestigiosi vigneti. Sono ca. 20 km, per 5-6 h di percorrenza camminando con calma, facendo diverse soste, gustandosi il paesaggio e . . . mangiando direttamente dal contadino<br>\n- cena presso ristorante convenzionato a Poggio Murella o altra località limitrofa.<br><br>\nGIORNO 3<br>\n- Mattino: Escursione a cavallo lungo sentieri e mulattiere nel verde delle colline<br>\n- Pranzo al sacco con cestino della casa<br>\n- Pomeriggio: relax alle Terme di Saturnia<br><br>\nGIORNO 4<br>\n- Mattino: Vi noleggiamo una MTB e una guida esperta vi porta a spasso per i su e giù della campagna, visitando aziende agricole, assaggiando prodotti tipici (latte, formaggi, yogurth, miele, vino, carne di Chianina macellata su ordinazione), attraversando frazioni solitarie. Il percorso è breve ma i nostri saliscendi – che farete in tutta tranquillità – richiedono un po'' di fiato.<br>\n- Pranzo al sacco con cestino della casa<br>\n- Pomeriggio: un''ultimo, gratuito e distensivo ''tuffo'' nelle Cascatelle del Mulino!\n- Partenza.<br><br><br>\n\nVi aspettiamo per questa "rilassante sfaticata"!<br>\nRaffaella Bertini & Lollo', '', '', '', '1', 0, 0, 0, '2013-04-25 07:22:03', '2013-05-12 18:39:27', '0', 62),
(85, 'Offerta prima prenota', '8 giorni 7 notti', '', '2013-05-24', '2013-06-21', '', '311', '', 5, '', 'Offerta prima prenota. Offerta soggetta a disponibilità limitata. Su richiesta. Quote scontate per soggiorni di minimo 7gg in pensione completa da sabato a sabato.', '', '', '', '0', 0, 0, 0, '2013-05-10 15:15:16', '2013-05-10 17:15:16', '0', 135),
(86, 'Corso di Cucina Maremmana', '3 giorni 2 notti', '', '2013-05-10', '2013-06-10', '', '155', '', 4, '', 'GIORNO 1: <br>- Check-in appartamento, sistemazione bagagli.<br>\n- bagno alle Cascatelle;<br>- cena presso locale di Poggio Murella<br><br>\nGIORNO 2: <br>-ore 9, inizio corso con chef<br>\n- lezione e preparazione piatti tipici<br>\n- ore 12, degustazione dei piatti<br>\n- pomeriggio relax alle terme (ingresso pomeridiano ridotto)<br>\n- cena con piatti maremmani presso locale tipico<br><br>\nGIORNO 3: <br>- colazione con degustazione di prodotti locali ("km 0")<br>\n- visita a prestigiosa cantina e degustazione vini<br>\n- pomeriggio alle terme<br><br>\n(N.B. : le bevande non sono incluse nel prezzo).', '', '', '', '0', 0, 0, 0, '2013-05-12 16:52:21', '2013-05-12 22:58:40', '0', 62),
(87, ' Rinomatissima Sagra della Lumaca a Poggio Murella', '2 giorni 1 notte', '', '2013-05-31', '2013-06-01', '', '85', '', 1, '', 'Arrivo e check-in appartamento.<br>\nBagno alle Cascatelle del Molino a Saturnia (ingresso libero).<br>Cena presso la Sagra, rinomato evento del piccolo borgo, con intrattenimento musicale.<br><br>Giornata seguente presso il centro termale (ingresso ridotto).<br>Partenza.', '', '', '', '0', 0, 0, 0, '2013-05-12 17:01:02', '2013-05-12 22:43:13', '0', 62);
