(32, 5, 3, 'ALPES d''OC MORINESIO', 'FRAZIONE MORINESIO ', '12020', 'VALLE MAIRA- STROPPO', 3647, 1156, 80, '+39011597602', '+39011501623', 'http://www.www.alpesdoc.com', 'ALPES d’OC MORINESIO\nTHE LEGENDARY MAIRA VALLEY\n\nAlpes d’OC Morinesio is  Holiday Home, Apartments, Bebrooms, B & B and Agriturismo situated in Morinesio di Stroppo in the Maira valley.At around 1,500 metres above sea level this mountain home is set in a lovely,sunny position on the southern slope  of Mount Nebin with spectacular views of the Cozie Alps.\n\nFrom summer 2011 another house called ’Casa Garibaldi’ situated in front of Alpes d’OC Morinesio another house has been opened. Please see our website www.alpesdoc.com  for further information. This includes three en-suite bedrooms each with panoramic balcony exposed south.   .On the first floor there is also a small, 30 square metre apartment with a kitchenette and fabulous terrace. In Casa Garibaldi operates an  called Alpes d’OC Green..\n\nAll togheter both buildings allow for plenty of flexibility being ideal for families, couples and groups.\n\nWe practice eco-tourism. Nature lives here!', 'ALPES d´OC MORINESIO è CASE con  APPARTAMENTI e CAMERE per VACANZE, AGRITURISMO e BED&BREAKFAST situate in Morinesio di Stroppo - Valle Maira - in montagna a circa 1500 m, in fantastica e soleggiata posizione sud sulle pendici del monte Nebin; un balcone naturale con vista spettacolare sulle Alpi Cozie.\n\nALPES d´OC MORINESIO è un tipico ed autentico esempio dell´architettura occitana-provenzale alpina; le case  risalgono al 1700; sono costruite esclusivamente con materiali nobili - pietra e legno di larice - ed ecocompatibili (derivati del legno, oli, calce, rame).\n\nALPES d´OC MORINESIO è composta da più appartamenti autonomi ed indipendenti, ciascuno di 30, 50 e 60 metri quadrati, completamente attrezzati e finemente arredati, composti da cucina-living, camera da letto matrimoniale, antibagno e bagno, ampi balconi a sud, locale per servizi comuni e deposito, area verde, giardinetto attrezzato.\nALPES d''OC MORINESIO è altresì Agriturismo e Bed & Breakfast. E'' dotato di camere da letto con rispettivo bagno e balcone panoramico con esposizione sud ( Rododendro, Bucaneve, Anemone). Ciascuna camera, con il rrispettivo bagno e balcone, sono autonomi ed indipendenti. \nVengono forniti la prima colazione, il pranzo e la cena composti da piatti semplici e genuini, preparati nella cucina della famiglia, in un ambiente familiare, accogliente ed un clima amichevole.  \n\nIdeale per ospitare famiglie, coppie, gruppi da 2 fino a 4 persone per appartamento.\nPratichiamo flessibilità nell´accoglienza e nella sistemazione; costantemente alla ricerca del massimo soddisfacimento degli ospiti.\n\nPratichiamo un turismo ecologico. Nature lives here.', '', 'Das Ferienhaus \n\nAlpes d´OC Morinesio in Morinesio di Stroppo im Mairatal liegt auf ungefähr 1500m Seehöhe am sonnigen Südhang des Monte Nebin, einem „Naturbalkon” mit atemberaubender Aussicht auf die Cottischen Alpen.\n\nDas Alpes d´OC Morinesio ist ein typisches und authentisches Beispiel okzitanisch-provenzalischer Gebirgsarchitektur und geht auf das Jahr 1700 zurück. Das Gebäude wurde ausschließlich mit typischen und umweltverträglichen Materialien wie Steinen, Lärchenholz, Holznebenprodukten, Ölen und Kalkstein errichtet.\n\nDas Alpes d´OC Morinesio besteht aus drei unabhängigen Appartements, deren jeweils 60 m2 große Wohnfläche stilvoll möbliert und vollständig eingerichtet ist.\n\nIdeal für Familien, Paare oder Gruppen von 2 bis 4 Personen pro Appartement. Flexible Buchungs- und Unterbringungsbedingungen. \n\nÖkotourismusbetrieb.', '', 'Activities\n\nThe surrounding natural countryside is a very relaxing place and ideal for mountain sports both in summer and in winter.There is a something for everyone including trekking, climbing, skiing, mountain biking, cycling, bowls etc. But there is also reading, meditation, board games and plenty of social opportunities provided by a variety of summer events.\n\nIn winter the area is particulary appreciated for:\n\n•	Skiig\n•	Cross-country skiing\n•	Trekking in snow shoes\n•	Bob sledging for children and teenagers\n\nIn spring and in summer the pure,natural environment offers fantastic views and breath-taking scenary for:\n•	Climbing\n•	A range of routes for mountain biking in the ‘Iron Bike’ territory\n•	Cycling tours on quiet country roads and in the surrounding hills following routes taken by Giro d’Italia and Tour de France.\n•	Practise wall climbing, the opportunity to follow routes with fixed ropes and a Tibetan bridge\n•	Horse riding\n•	Volleyball court\n•	Bowling\n•	Trekking along a network of a sign-posted parths that unwind along the Maira valley for houndreds of kilometres.Itineraries include travelling times which can vary widely-from 30 minutes to week or more.\n\nPlaces of interest\n\nThe Maira valley is an area of great cultural interest with both natural and ethnic charm\n\nIt includes:	:\n•	Medieval Alpine villages\n•	Fresco adorned churches by distinguished artists in the service of Marquess of Saluzzo\n•	Language and Provencal music of the troubadours\n•	Mounth-watering local cousine to try\n•	The natural beaty and simplicity of the mountain ambience\n', 'Attività\n\n    Terra: Bicicletta - MTB,  Scalata,  Sci,  Alpinismo,  Passeggiate a cavallo,  Escursioni - trekking. \n\nIl luogo è rilassante e selvaggio; induce agli sport di montagna estivi ed invernali; tranquilli ed audaci; al trekking, all´alpinismo, allo sci, Mountainbike, bicicletta, ma anche alle letture ed alla meditazione, ai gioche di società, agli incontri conviviali e festosi, all´animazione, agli eventi particolarmente numerosi in estate.\n\nD´inverno il territorio è molto apprezzato per:\n\n- Lo sci alpinismo e lo sci di fondo- trekking con le racchette da neve\n- Bob per bambini e ragazzi\n\nIn primavera e in estate la natura incontaminata e selvaggia offre panorami e scenari mozzafiato:\n\n- Arrampicate e scalate in parete.\n- svariati percorsi per mountain bike e territorio di "lotta" della Iron Bike.\n- Tours per biciclette da strada su colli alpini poco trafficati; luoghi dove transita il Giro d´Italia ed il Tour de France.\n- Palestra di roccia, ferrata, ponte tibetano.\n- Passeggiate a cavallo.\n- Campo volley.\n- Bocce.\n- Campo scuola per l´agricoltura di montagna.\n- Percorsi di trekking lungo una rete di sentieri seganalati, che si snoda per tutta la valle Maira per migliaia di chilometri, con itinerari da 30 minfino ad una settimana e più.\n\nLuoghi di interesse\n\n    Valle Maira \n\nTutta la Valle Maira è una area di grande valenza culturale, naturalistica ed etnica. \n\nÈ presente:\n\n- L´architettura delle medioevali borgate alpine\n- Le chiese affrescate da insigni pittori al servizio del marchese di Saluzzo\n- La lingua e la musica occitana e provenzale dei trovatori\n- La genuinità ed i sapori della cucina locale\n- L´ambiente montano naturale ed integro di suggestiva bellezza e semplicità', '', '    Zu Land: Mountainbiken,  Klettern,  Ski fahren,  Bergsteigen,  Reiten,  Wandern - Trekking. \n\nDer Ort ist beruhigend und wildromantisch zugleich. Er lädt ein zu sommer- und wintersportlicher Betätigung am Berg und eignet sich hervorragend für Trekking-Touren, Bergwanderungen oder Schi-, Mountainbike- und Radausflüge. Daneben regt er zum Lesen, zur Meditation, zu Gesellschaftsspielen, zu gemütlichen und ausgelassenen Treffen und unzähligen Sommerveranstaltungen an.\n\nIm Winter ist er ein Anziehungsort für Liebhaber von:\n\n- Alpinschi- und Langlaufsport- Schneeschuh-Trekking\n- Bobfahrten für Kinder und Jugendliche\n\nFrühjahrs wie sommers bietet die intakte und unberührte Flora und Fauna atemberaubende Panoramen und Naturschauspiele:\n\n- Bergwanderungen und Klettertouren.\n- Verschiedenste Mountainbike-Strecken und eine Iron Bike-Arena.\n- Rennrad-Ausflüge auf wenig befahrenen Bergstraßen, die bereits im Tourkalender des Giro d’Italia bzw. der Tour de France zu finden waren.\n- Felsenarena, Klettersteige, Hängebrücken.\n- Reitausflüge.\n- Volleyball-Platz.\n- Boccia-Platz.\n- Übungsgelände für Alpinfeldbau.\n- Trekkingrouten entlang eines ausgeschilderten Wegenetzes, das auf tausenden Kilometern das gesamte Mairatal durchzieht und mit Weglängen zwischen 30min und einer Woche und mehr aufwarten kann.\n\nSehenswürdigkeiten\n\n    Valle Maira  ', '', 0, 0, 0, 0, 'Strada Provinciale 335, 12020 Elva CN, Italia', 44.5177, 7.13224, 17, '    The apartments are made up of living / kitchen, bedroom, bathroom, shared services area, green excluded, it is shared.\n    Residence “ Panorama” consists of a bedsit with cooking corner, bathroom.\n    Price from € 400,00 to € 480,00 per week up to 2 guests.\n    The final cleaning price is 20 euros.\n    For each extra person, max 2 people from € 60,00 to € 70,00 per week per person.\n    For periods that exceed one week, discounted tariffs, excluded gas.\n    Weekend tariff from Friday to Sunday, up to 2 guests, , € 180,00 all inclusive, except gas.\n    Bedroom sheets, linen and bath and kitchen towels are at disposal.\n    It is possible to use the washing machine, ironing board and iron.\n    No smoking in all areas of the residence.\n\n', '    Gli appartamenti sono costituiti da cucina/living, camera da lettomatrimoniale, antibagno e bagno, locale per servizi comuni (depisito scarponi, sci, bicicletta ecc..) verde esclusivo e in comunione, area pic-nic.\n    Il residence “Panorama” è costituito da un monolocale con angolo cucina, antibagno e bagno.\n    I prezzi variano da € 400,00 a € 480,00 alla settimana fino a due persone, a seconda del periodo dell''anno.\n    Pulizie finali euro 20.\n    Per ogni persona in più, massimo due, supplemento da € 60,00 a € 70,00 alla settimana per persona.\n    Per periodi maggiori alla settimana, tariffe scontate.\n    Gas calcolato a parte.\n    Tariffa week-end dal venerdì alla domenica, per due persone, € 180,00 tutto compreso, gas escluso.\n    Sono a disposizione la biancheria da camera e gli asciugamani da bagno e da cucina.\n    E’ possibile utilizzare la lavatrice l''asse ed il ferro da stiro.\n    In tutti i residence vige il divieto di fumo.\n\n', '', '    Die Appartments bestehen aus Küche/Wohnraum, Schlafzimmer, Badezimmer-Vorraum und Badezimmer, außerdem stehen ein Gemeinschaftsraum und eine eigene oder gemeinsam genutzte Grünfläche zur Verfügung.\n    Das Appartment “Panorama” besteht aus einem Wohnraum mit Kochecke, Badezimmervorraum und Badezimmer.\n    Die Preise liegen zwischen € 400,00 und € 480,00 pro Woche und zwei Personen.\n    Der Preis für die Endreinigung beträgt 20 €.\n    Für jede weitere Person, maximal zwei, ab € 60,00 bis € 70,00 Zuschlag, pro Woche und Person.\n    Bei Anmietung für längere Zeiträume gibt es Rabatte.\n    Gas extra.\n    Wochenendtarif von Freitag bis Sonntag, bis zu zwei Personen, € 180,00 alles inbegriffen, gas nicht im Lieferumfang enthalten.\n    Es stehen Ihnen Bettwäsche, Handtücher für das Badezimmer und eine Küche zur Verfügung.\n    Sie können die Waschmaschine benutzen.\n    In allen Appartments herrscht Rauchverbot.\n\n ', '', 'Levaldigi, 50KM', 'Caselle, 150KM', '', 'Cuneo, 40KM', '', '', '', '1', 0, 32),
