(34, 1, 3, 'Hotel Villa Belfiori', 'Torre dei Corsari - Via Vespucci 51', '09031', 'Arbus', 3660, 1172, 80, '070977272', '0707731001', 'http://www.www.hotelvillabelfiori.it', 'Tucked away in the green hills of the Costa Verde, one of the few areas still untouched of Sardinia, in the small village Tower of Corsairs, you will find our Hotel Villa Belfiori.\nOur family for over a decade, has decided to transfer his passion for tourism in Sardinia and its traditions, which in welcoming host has its own strength. Turn into hoteliers, for those born in Sardinia, is almost a logical evolution. Sardinia and the Sardes, politeness is in their blood for centuries. But, with a constant and accurate, we are committed to improving our natural attitude in professionalism, improving year after year, the various aspects of hospitality, cuisine, offering comfort and technology.\nOur strong point, besides the wonderful landscape in which the Hotel Villa Belfiori is inserted, it is certainly the kitchen, which, while following the tradition in the typical flavors and aromas, we have adapted to the demands of the guests, enriching our offer with vegetarian menus on request with specific menus for allergies. With the desire to offer delicious food and a variety to our guests, continues a steady and continuous research of traditional recipes to present to tourists staying at the Hotel Villa Belfiori. Ancient tastes to savor immersed in one of the most beautiful of Sardinia.\nWith a nice job of restoration and modernization, we have transformed a beautiful manor house of the 70''s, in a nice hotel by the familiar flavor. The care and originality of the interior and exterior has been designed to offer a sense of freedom in the seaside holiday, the thrill of experiencing the ancient Sardinia, and the comfort that meets the needs of tourists who seeks authentic tastes , silence, relaxation and pleasant conversations to discover the beauty that cleverly hides the territory.\nWe feel great satisfaction in telling our guests Sardinia, and this is evident in everything we do. The pleasure to taste different dishes every day, the decision to offer only local wines, to the pleasure of being ourselves tour guides for our guests. Every day we become available a few hours to take tourists to know the peculiarities of our territory, between various identities, the agricultural and pastoral, the fishermen of the lagoon and the soul mining. Sardinia is a continent to be discovered. The sea is beautiful, but our pride in Sardinia, lies in the variety of our landscapes.\nOur motto is "to live in Sardinia." For this we help our guests to discover the true soul of an island that embraces many treasures. The pleasant climate, the warm sun, the blue sky, the smells and the sea are just some of the experiences that you do with a holiday at the Hotel Villa Belfiori, we like to introduce our sardines, our philosophy of life. Our choice stems from personal desire not to lose our essence, in our anchored in our granite and basalt, which has survived centuries of invasions and raids, but he wants to share with those who want to know the real Sardinia.\nYou are all invited to come to know Sardinia, in our Hotel Villa Belfiori we offer you a holiday spoiled by the "Taste of Sardinia." After a Holiday Tower of Corsairs in Marina di Arbus, conquered by the delicate scents of the effusions Costa Verde pours into the air, you too will be infected by the virus of "Mal di Sardegna", you will understand the melancholic nostalgia that we have inside us Sardinia when we move away from our beautiful island.', 'Nascosto tra le verdi colline della Costa Verde, tra le poche aree ancora incontaminate della Sardegna, nel piccolo villaggio Torre dei Corsari, si trova il nostro Hotel Villa Belfiori.\nLa nostra famiglia da oltre un decennio, ha deciso di trasferire nel turismo la propria passione per la Sardegna e le sue Tradizioni, che proprio nell’accoglienza dell’ospite ha un suo punto di forza. Trasformarsi in albergatori, per chi è nato in Sardegna, è quasi un logico divenire. La Sardegna e i Sardi, il culto dell’accoglienza ce l’hanno nel sangue da millenni. Ma, con un impegno costante e preciso, ci siamo impegnati a perfezionare la nostra attitudine naturale in professionalità, migliorando, anno dopo anno, i vari aspetti dell’accoglienza, della cucina, dell’offerta di comfort e di tecnologia.\nNostro punto di forza, oltre al meraviglioso paesaggio in cui l’Hotel Villa Belfiori è inserito, è certamente la cucina, che, pur seguendo la tradizione nella tipicità dei sapori e degli aromi, abbiamo adattato alle richieste degli ospiti, arricchendo la nostra offerta  con menù vegetariani e su richiesta con menù specifici per allergie. Con il desiderio di offrire pietanze deliziose e varie ai nostri ospiti, prosegue una ricerca costante e continua delle antiche ricette tradizionali da presentare ai turisti che soggiornano nell’Hotel Villa Belfiori. Gusti antichi da assaporare immersi in uno dei panorami più suggestivi della Sardegna. \nCon un bel lavoro di restauro e ammodernamento, abbiamo trasformato una bella villa padronale degli anni 70, in un grazioso Hotel dal sapore familiare. La cura e l’originalità degli ambienti interni ed esterni, è stata studiata per offrire una percezione di libertà nella vacanza al mare, la grande emozione di vivere la Sardegna antica, e con il confort che soddisfa le esigenze del turista, che ricerca gusti autentici, silenzi, relax e piacevoli chiacchierate alla scoperta delle bellezze, che il territorio sapientemente nasconde.\nProviamo molta soddisfazione nel raccontare la nostra Sardegna agli ospiti, e questo è evidente in tutto quello che facciamo. Dal piacere di far gustare ogni giorno pietanze diverse, alla decisione di proporre solo i vini del territorio, fino al piacere di essere noi stessi le guide turistiche dei nostri ospiti. Ogni giorno ci rendiamo disponibili qualche ora, per accompagnare i turisti a conoscere le peculiarità del nostro territorio, a cavallo tra varie identità, quella agricolo-pastorale, quella dei pescatori di laguna e l’anima mineraria. La Sardegna è un continente da scoprire. Il mare è bellissimo, ma il nostro orgoglio di sardi, sta nella varietà dei nostri paesaggi.\nIl nostro motto è “ far vivere la Sardegna”. Per questo aiutiamo i nostri ospiti a scoprire la vera anima di un’isola che racchiude in se tanti tesori. Il clima piacevole, il caldo sole, il cielo azzurro, i profumi e il mare sono solo alcune delle esperienze che farete con una vacanza nell’Hotel Villa Belfiori, a noi piace presentarvi la nostra sardità, la nostra filosofia di vita.  La nostra scelta nasce dal desiderio personale di non perdere la nostra essenza, ancorata nei nostri basalti e nei nostri  graniti, e che è sopravvissuta a millenni di invasioni e incursioni, ma di volerla condividere con chi desidera conoscere la Sardegna autentica.\nSiete tutti invitati a venire per conoscere la Sardegna, nel nostro Hotel Villa Belfiori vi offriamo una vacanza coccolati dal “Sapore di Sardegna”. Dopo una Vacanza a Torre dei Corsari, nella Marina di Arbus, conquistati dalle delicate effusioni dei profumi che la Costa Verde effonde nell’aria, anche voi sarete contagiati dal virus del “Mal di Sardegna”,  comprenderete la malinconica nostalgia che noi sardi abbiamo dentro quando ci allontaniamo dalla nostra bella isola. \n', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Amerigo Vespucci, 51, 09031 Torre di Flumentorgiu VS, Italia', 39.6769, 8.44976, 16, '', '', '', '', '', 'Cagliari 96 Km', '', '', 'Marrubiu 25 Km', '', 'Caletta 100 mt - Dune 900 mt', 'in Hotel - Ristorante Belvedere', '1', 0, 34),
