(36, 3, 0, 'La Siègià resort spa', 'loc cura nuova', '58024', 'massa marittima', 3680, 1168, 80, '+390566871030', '', 'http://www.www.lasiegia.it', 'La Siégià Relais Wellness & Spa it is the ideal place whether to spend your vacations in Relax. It is located In the green and suggestive landscape, among the marvellous hills of the Maremma Toscana, few minutes far from the splendid beaches of Castiglion Di the Pescaia, Follonica and Punt''Ala, where the sea is crystalline, La Siègià is a perfect point of departure to reach marvellous touristic destinations of grat interest.\nLa Siégià offers an ideal environment to spend some moments of pure Relax. \nOur cordial personnel will welcome you to your arrival and will help you to make your stay an unforgettable moment. \n', 'La Siégià Relais Wellness & Spa è il luogo ideale dove trascorrere le proprie vacanze all’insegna di un ritrovato benessere Psico fisico. \nImmersa nel verde di un suggestivo paesaggio, tra le meravigliose colline della Maremma Toscana e a pochi minuti dalle splendide spiagge di Castiglion Della Pescaia, Follonica e Punt’Ala, dove il mare è cristallino, La Siègià è un ottimo punto di partenza per raggiungere meravigliose mete turistiche di notevole interesse. \nLa Siégià offre ai suoi ospiti un ambiente ideale per chiunque sogna di trascorrere dei momenti di puro Relax. \nVi accoglierà al vostro arrivo il nostro personale cordiale che vi aiuterà a rendere il vostro soggiorno di indimenticabile piacevolezza.\n', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Massetana Sud, 12, 58024 Cura Nuova GR, Italia', 42.9751, 10.8159, 17, '', '', '', '', '', 'pisa', '', '', 'follonica', '', '', '', '1', 0, 36),
(37, 1, 3, 'Hotel Dolly', 'via leonardo da vinci 19', '55049', 'viareggio', 3682, 1168, 80, '058444507', '058444507', 'http://www.www.hoteldolly.it', '', 'L''hotel Dolly è situato in una posizione centrale e tranquilla, a 30 m dal mare e 100 m dalla pineta. E'' dotato di bar, ristorante, sala TV, sala lettura, connessione internet Wi-Fi, ascensore ed è privo di barriere architettoniche. Tutte le camere dispongono di servizi privati, TV 32" LED, telefono, cassaforte, aria condizionata e balcone con terrazzo. Offre ottima cucina con piatti a base di pesce. Aperto tutto l''anno. ', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Leonardo Da Vinci, 23, 55045 Pietrasanta LU, Italia', 43.9245, 10.2029, 17, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 0, 37),
