(43, 1, 2, 'bbintrabartolo', 'via passo enea 70', '91100', 'trapani', 3676, 1170, 80, '3293131972', '0923872630', 'http://www.bbintrabartolo.4000.it', 'In the maritime city of Trapani, in the commercial center, is the BBINTRABARTOLO.\nThe hotel offers single and double rooms all spacious and air conditioned.\nIt is found near the historic center and the railway station and the beaches.\nPleasant and relaxing stay', 'Nella marinara città di Trapani , in pieno centro commerciale, sorge il BBINTRABARTOLO.\nLa struttura dispone di camere doppie e singole tutte molto ampie e climatizzate.\nTrovasi vicino al centro storico e alla stazione e ai lidi balneari.\nSoggiorno gradevole e rilassante.', '', 'In der Seestadt Trapani, im kommerziellen Zentrum, ist die BBINTRABARTOLO.\nDas Hotel bietet Einzel-und Doppelzimmer, alle geräumig und klimatisiert.\nEs liegt nahe dem historischen Zentrum und dem Bahnhof und den Stränden gefunden.\nAngenehmen und erholsamen Aufenthalt.', '', 'you can visit Erice (ancient city of ancient history), Segesta with its theater and temple,\nchurches and historical sites throughout the country.\nShopping for city streets and walking in the countryside and surrounding hills.', 'si può visitare Erice (città di antica storia millenaria), Segesta con il suo teatro e tempio,\nle chiese e i luoghi storici di tutto il territorio.\nShopping per le vie cittadine  e trekking per le campagne e colline circostante. ', '', 'Sie können Erice (antike Stadt der antiken Geschichte), Segesta mit seinem Theater und Tempel zu besuchen,\nKirchen und historischen Stätten im ganzen Land.\nShopping für Straßen der Stadt und zu Fuß in die Landschaft und die umliegenden Hügel.', '', 0, 0, 0, 0, 'Via Passo Enea, 68, 91100 Trapani TP, Italia', 38.0196, 12.5203, 17, '', '', '', '', '', 'trapani birgi Km 18', '', '', 'm.200', 'm.50', 'm.100', 'm.200', '1', 0, 43),
(44, 5, 0, 'Agriturismo La Fonte', 'Loc. Fiaggia 34 Torre del Colle', '06031', 'Bevagna', 3690, 1163, 80, '+393402560402', '+390757823481', 'http://www.www.lafontedibevagna.it', 'In Bevagna, which is located in the heart of Umbria and on the road leading to the famous Sagrantino wine region, you will find the Agriturismo “La Fonte”.\nThe Agriturismo offers the ideal holiday for those who want peace and quiet and to enjoy the priceless historic and artistic treasures that the surrounding area has to offer.\nThe farmhouse, which overlooks the Mount Subasio valley, from whose slopes rise the cities of Assisi and Spello, consists of four apartments; each thoughtfully restored, comfortably furnished and equipped with every convenience.\nThe Agriturismo has a private swimming pool, barbecue, covered parking and each apartment has its own veranda with pergola. Free wi-fi.\nInside the fenced private property, about 25 hectares, there are olive groves, vineyards and woods where guests can take walks, go mountain biking, see the animals reared on the farm and even see such small wild animals as squirrels, porcupines, hares and buzzards.\n', 'A Bevagna, nel cuore dell’Umbria, sulla strada del sagrantino si trova l’Azienda Agricola “La Fonte”.\nL’azienda, offre agli ospiti una vacanza ideale per chi desidera pace e tranquillità e vuol godere delle storiche e inestimabili ricchezze artistiche che il territorio limitrofo propone.\nLa casa colonica, con vista panoramica sulla vallata del Monte Subasio, alle cui pendici sorgono Assisi e Spello, è costituita da quattro appartamenti, ristrutturati con l’amore e il gusto di chi conosce questa terra, arredati in modo accogliente e dotati di ogni comfort.\nLa struttura dispone di piscina privata, barbecue, posto auto ombreggiato e veranda esterna con pergola per ogni appartamento, oltre alla connessione Wi-Fi gratuita.\nAll’interno della proprietà privata recintata, di circa 25 ettari, costituita da oliveti, vigneti e boschi è possibile effettuare passeggiate ed escursioni in mountain bike, vedere gli animali allevati in azienda e se siete fortunati incontrare piccoli selvatici come scoiattoli, istrici, lepri e poiane.', '', 'In Bevagna im Herzen von Umbrien auf der Straße des Sagrantino befindet sich die Azienda Agricola „La Fonte“ (der Brunnen) .\nDas Bauernunternehmen bietet den Gästen, die sich Ruhe und Gemütlichkeit wünschen und möchten die historischen und unschätzbaren Kunstreichtümer, die das Land bietet, genießen, einen idealen Urlaub.\nDas Bauernhaus mit Panoramasicht auf den Tal vom Monte Subasio, wo Assisi und Spello liegen, bestehet aus vier Wohnungen, renoviert mit der Liebe und Geschmack der Kenner dieses Landes, gemütlich eingerichtet und mit jedem Komfort.\nDie Anlage verfügt über ein privates Schwimmbad, Barbecue, Parkplatz im Schatten und einer externen Terrasse mit Pergola. Frei wi-fi.\nIn dem gesamten Gebiet des Agriturismo, 25 Hektar von Olivenhainen, Weinbergen, Wäldern und Feldern die mit Zaun begrenzt sind, ist es möglich Spaziergänge und Ausflüge mit Mountain Bike zu organisieren, die in dem Agriturismo gezüchteten Tiere anzuschauen und mit ein bisschen Glück auch kleine Eichhörnchen, Igeln, Hasen, Bussarde zu treffen.', '', '', 'Siamo collocati in un punto strategico per raggiungere in brevissimo tempo le città d''arte più belle dell''umbria come: Montefalco, Assisi, Spello, Perugia, Città di Castello, Montone, Norcia, Urbino, Foligno, Todi, Orvieto e mete naturalistche come: Cascata delle Marmore, Grotte di Frasassi, Monte Cucco, Monte Nerone e il Lago Trasimeno. \n', '', '', '', 0, 0, 0, 0, 'Via Fiaggia, 4, 06031 Torre del Colle PG, Italia', 42.9447, 12.5763, 17, '', 'Caparra del 15% alla prenotazione, saldo all''arrivo.\nCancellazione 30 giorni prima dell''arrivo nessuna penale. Successivamente non verrà restituita la caparra che comunque potrà essere recuperata in una successiva prenotazione.', '', '', '', 'Perugia-San Francesco, 30 km', 'Roma Ciampino, 140 km', 'Roma Fiumicino, Km 170', 'Foligno km 12', 'Torre del Colle Km 1,5', 'Senigallia Km 90', 'Bevagna Km 4', '1', 0, 44),
