(48, 4, 3, 'Tarchon Luxury B&B', 'Via Giampietri Leoni, 18 ', '01016', 'Tarquinia', 3619, 1169, 80, '3298775520', '', 'http://www.tarchonclub.com', '', 'Nella città di Tarquinia in prossimità del centro storico ed a tre km dalle splendide rive del Mare Tirreno, Tarchon Luxury B&B è sicuramente il luogo perfetto per trascorrere attimi di relax a contatto con la natura immersi nel verde della campagna maremmana.\nQuesto stupendo bed and breakfast dispone di camere rifinite ed attrezzate dove è possibile trovare: ambienti climatizzati, tv color, wifi internet gratis, microonde, frigo con bevande, bagni interni alle camere, balconi prendisole, reception 24h, parcheggio libero per auto e/o moto, soggiorno con angolo cottura,degustazione prodotti locali, giardino, doccie con idromassaggio. \nNon perdete l''occasione di soggiornare in un bed and breakfast di charme dall''atmosfera amichevole, la cui essenza consiste proprio nell''amore per tradizioni e culture diverse.\n\n\n\n\n', '', '', '', '', 'Museo Etrusco, Necropoli Etrusca. Lido di Tarquinia Riserva Naturale di Tarquinia', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 44, 01016 Tarquinia VT, Italia', 42.2464, 11.7498, 16, '', 'L''offerta comprende:\n-   Pernottamento;\n-   Colazione in camera;\n-   Pulizia giornaliera della camera;\n-   Pulizia giornaliera del bagno privato interno alla camera con doccia, phon e set di cortesia;\n-   Servizio biancheria (asciugamani e lenzuola);\n-   Ambiente climatizzato e/o riscaldato indipendente;\n-   Wifi e/o connessione power-line adsl internet gratis.\n-   La ristorazione verrà effettuata presso ristoranti locali convenzionati.\n-   Energia Elettrica ed Acqua;\n-   Microonde, Tv color con decoder digitale e frigo con bevande ad uso gratuito in camera;\n-   Materiale illustrativo della Città di Tarquinia;\n-   Parcheggio libero per: autovetture, motocicli e veicoli commerciali.\n-   Sconti e Convenzioni fino al 20% con: stabilimenti balneari, solarium, palestre, guide turistiche, scuole di vela, windsurf, kitesurf, maneggi, tennis, golf.\n', '', '', '', 'roma fiumicino', 'roma ciampino', '', 'FF:SS: Tarquinia ', 'comune di taruqinia', 'lido di tarquinia', 'le due orfanelle', '1', 0, 48),
