(50, 1, 5, 'Le Fate Corbezzole', 'Via Marze,18/a', '36060', 'Bassano del Grappa,Romano d''Ezzelino, Fellette', 3699, 1157, 80, '+393486940158', '', 'http://www.WWW.CORBEZZOLE.IT', 'BED & BREAKFAST - The Fate Corbezzole\nMAGIC HOME AND FAMILY\nCOMFORTABLE ROOMS WITH BREAKFAST\n\nLocated in a place ''in the foothills just in Romano d''Ezzelino (VI)\nlocation ''Fellette the Bed & Breakfast "Le Fate Corbezzole" intends to people looking for a different place for a holiday or for a quick pass.\nThe poor art lends itself nicely to furnish the three double rooms available, one with a private bath on the ground floor and two upstairs with shared bathroom furnished with care and taste.\nUpon arrival, guests will find the reception and comfort during the summer and available\nthe same there will be a comfortable terrace and a nice garden so the ideal setting for\nmake them feel at home.\nvisit us in person or visit our website: www.corbezzole.it\nWe are close to several villages and towns of great importance such as:\nBassano del Grappa, Marostica, Asolo, Castelfranco Veneto etc. and distant only 50 km from Venice,\nand about 40 km from Vicenza-Padua-Treviso-Asiago Plateau.\nThroughout the year, each of these cities'' offers something special for tourists who are interested in various genres.\nWe are open all year round and we have our typical restaurant Osteria Emporio Museum ROBEVECIE\nSimple dishes especially authentic, made with fresh, quality and recipes fascinating balance between tradition and innovation, here are the "good food" to cut down prices.\nBED & BREAKFAST - The Fate Corbezzole\nVia Marze 18 / a\n36060 Loc Fellette of Roman Ezzelino\nTEL. 3486940158\nE-mail: info@corbezzole.it', 'BED & BREAKFAST – Le Fate Corbezzole\nACCOGLIENZA MAGICA E FAMILIARE\nCAMERE CONFORTEVOLI CON PRIMA COLAZIONE\n\nSituato in una localita’ della pedemontana esattamente a Romano d’Ezzelino (VI)\nlocalita’ Fellette il Bed & Breakfast “Le Fate Corbezzole”si propone alle persone che cercano un posto diverso per una vacanza o per un passaggio veloce.\nL’arte povera si presta ad arredare piacevolmente le tre camere  doppie a disposizione di cui una con bagno privato al piano terra e due al piano superiore con bagno in comune arredate con cura e gusto .\nAll’arrivo gli ospiti troveranno accoglienza e confort e durante la bella stagione a disposizione \ndegli stessi ci saranno un comodo terrazzo ed un grazioso  giardino dunque la cornice ideale per \nfarli sentire come a casa.\nvisitateci personalmente o visitate il nostro sito : www.corbezzole.it\nCi troviamo vicino a diversi paesi e citta di notevole importanza quali:\nBassano del Grappa,Marostica,Asolo,Castelfranco Veneto etc. e distanti solo 50 Km.  da Venezia,\ne circa 40 Km. da Vicenza -Padova-Treviso-Altopiano di Asiago.\nDurante tutto l’anno ognuno di queste citta’ offre qualcosa di particolare ai turisti che sono interessati a vari generi.\nSiamo sempre aperti tutto l’anno e abbiamo il nostro locale tipico 	Osteria Emporio Museo ROBEVECIE\nPiatti semplici e soprattutto autentici, realizzati con prodotti freschi e di qualità e con ricette in affascinante equilibrio tra tradizione e innovazione, fanno qui del ”buon mangiare” a prezzi di assoluta convenienza .\nBED & BREAKFAST – Le Fate Corbezzole \nVia Marze 18/a\n36060 Loc. Fellette di Romano d’Ezzelino \nTEL. 3486940158  \nE-mail : info@corbezzole.it\n', '', '\nBED & BREAKFAST - Das Schicksal Corbezzole\nMAGIC Heim und Familie\nKomfortable Zimmer mit Frühstück\n\nDas Hotel liegt in einem Ort "in den Ausläufern nur in Romano d''Ezzelino (VI)\nlocation ''Fellette das Bed & Breakfast "Le Fate Corbezzole" beabsichtigt, um Menschen auf der Suche nach einem anderen Ort für einen Urlaub oder für eine schnelle Pass.\nDie arme Kunst eignet sich gut, um die drei Doppelzimmer zur Verfügung, eines mit eigenem Bad im Erdgeschoss und zwei im Obergeschoss mit Bad mit Sorgfalt und Geschmack eingerichtet liefern.\nBei der Ankunft werden die Gäste die Rezeption und Komfort im Sommer und zur Verfügung\ndas gleiche wird es eine gemütliche Terrasse und ein schöner Garten so den idealen Rahmen für\nsie fühlen sich zu Hause.\nbesuchen Sie uns persönlich oder besuchen Sie unsere Website: www.corbezzole.it\nWir sind in der Nähe mehrerer Dörfer und Städte von großer Bedeutung, wie:\nBassano del Grappa, Marostica, Asolo, Castelfranco Veneto, etc. und entfernte nur 50 km von Venedig entfernt,\nund etwa 40 km von Vicenza-Padua-Treviso-Hochebene von Asiago.\nWährend des ganzen Jahres bietet jede dieser Städte etwas Besonderes für Touristen, die interessiert in verschiedenen Genres sind.\nWir sind ganzjährig geöffnet und wir haben unsere typischen Restaurant Osteria Emporio Museum ROBEVECIE\nEinfache Gerichte besonders authentisch, mit frischen, hochwertigen und Rezepte faszinierende Balance zwischen Tradition und Innovation, hier gemacht sind die "good food" zu reduzieren Preisen.\nBED & BREAKFAST - Das Schicksal Corbezzole\nVia Marze 18 / a\n36060 Loc Fellette der römischen Ezzelino\nTEL. 3486940158\nE-mail: info@corbezzole.it\n\n\n\n\n', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Marze, 18, 36060 Romano D''ezzelino VI, Italia', 45.7698, 11.7782, 17, '', '', '', '', '', 'TREVISO', 'VENEZIA', 'VERONA', 'BASSANO DEL GRAPPA', 'A SOLI 200 METRI', '', 'A 100 METRI RISTORANTE TIPICO ROBEVECIE', '1', 0, 50),
(51, 1, 3, 'Residence Hotel Terme di Palestrina', 'Via delle piagge 74/A', '00036', 'Palestrina', 3618, 1169, 80, '+390695271595', '06/95271443', 'http://www.www.residencetermedipalestrina.it', '', ' Questa moderna struttura, ultimata a maggio 2012, grazie alla sua ottima location nella suggestiva cornice dei Monti Prenestini, offre una comoda sistemazione in un ambiente arredato con gusto e in grado di soddisfare le esigenze della clientela più esigente (collegamento wi-fi e parcheggio gratuito, palestra a disposizione esclusiva della nostra clientela, particolare attenzione all''abbattimento delle barriere architettoniche).\nLa struttura è composta da 12 camere moderne ed accoglienti fornite di ogni comfort, e 21 appartamenti con ingresso indipendente in modo da garantire libertà e privacy ai nostri clienti e una sistemazione su misura per le loro esigenze. In particolare gli appartamenti sono completamente arredati e attrezzati per ospitare fino a sei persone, la cucina è munita di forno, lavastoviglie, frigo, congelatore, piano cottura e tutti gli utensili per sei persone. La particolare cura nella scelta del personale a servizio della struttura vi farà sentire sempre coccolati ed assistiti. La struttura è dotata anche di una sala conferenza e di particolari soluzioni e servizi per l''organizzazione di congressi e incontri di lavoro che la rende un valido alleato di coloro che hanno questo genere di necessità. Gli ampi spazi, il giardino fanno si che anche il Vostro animale domestico possa accompagnarvi. Una palestra ben attrezzata è a disposizione dei clienti tutti i giorni dalle 08.00 alle 20.00. Tra le attrezzature: cyclette, tapis-roulant, cross-training machine e da ogni punto dell''albergo è possibile accedere ad internet grazie alla rete WiFi. \nUna sala colazioni spaziosa e luminosa vi occoglierà ogni mattina dalle 08:00 alle 10:00 per gustare la colazione, nella quale su richiesta può essere organizzato un baby parking. Per quanto riguarda gli appartamenti la colazione viene servita in camera e si può scegliere sia cosa gustare e sia l''orario. ', '', '', '', '', 'Il residence terme di Palestrina si trova vicino a: Santuario della Fortuna, Castelli Romani,Palazzo Rospigliosi. Distante dal Rainbow MagicLand e Valmontone Outlet Fashion District solo 8km.\n E’ inoltre ben collegato con Roma (vedi la sezione dove siamo) pertanto costituisce una valida alternativa alle tradizionali sistemazioni offerte per le visite alla capitale per una vacanza originale in grado si soddisfare i gusti e le necessità di tutta la famiglia', '', '', '', 0, 0, 0, 0, 'Via Piagge, 00138 Roma, Italia', 41.9813, 12.5171, 17, '', 'Per eventuali ospiti aggiuntivi possono essere previsti supplementi, variabili in base alla politica dell''hotel. \nAll''arrivo, oltre a un documento di identità comprensivo di foto, vengono richiesti una carta di credito o un deposito in contanti per eventuali spese accessorie. \nTutte le richieste speciali sono soggette a disponibilità al momento dell''arrivo e possono comportare spese aggiuntive. Le richieste speciali non sono garantite. \nSupplemento per animali domestici: EUR 10 ad animale, al giorno \nCucina/angolo cottura: EUR 15 a soggiorno \nLetto aggiuntivo: EUR 15 al giorno \nIn caso di cancellazione o modifiche effettuate fino a 3 giorni prima della data prevista di arrivo non viene addebitato alcun costo.\nIn caso di cancellazione o modifiche effettuate oltre tale termine o di mancata presentazione viene addebitato il 100% del costo della prima notte.\n', '', '', '', 'Roma Ciampino', 'Roma Fiumicino', '', 'Stazione di Zagarolo', 'Cotral ', '', 'Il Nostro', '1', 0, 51),
(52, 4, 0, 'B&B La Ca''di Sala', 'via vittorio veneto 41', '23832', 'margno', 3628, 1165, 80, '0341840549', '', 'http://www.www.lacadisala.it', '', 'Abbiamo adibito a beb un piano del palazzetto cinquecentesco interamente ristrutturato .\nAbbiamo messo a disposizione degli ospiti tre camere: 1 camera letto matrimoniale,1 camera letto matrimoniale o 2 singoli con balconcino, 1 camera letto matrimoniale con salottino e caminetto.Tutte le camere hanno un bagno proprio con doccia .Sono a disposizione degli ospiti un salotto con balcone ,una sala da pranzo e un giardino ', '', '', '', '', 'Per chi ama le passeggiate in montagna, lo sci e il parapendio trova nel nostro beb un accogliente punto di partenza. Siamo a Margno (mt.713) a pochi passi dalla funivia per Pian delle Betulle, una delle stazioni sciitiche della Valsassina.Il lago di Como è raggiungibile in 20'', Lecco in 30,Milano in 1h20''''. La Valsassina non offre solo sport e passeggiate ma anche spunti culturali e gastronomici tutto l''anno.', '', '', '', 0, 0, 0, 0, 'Via XI Febbraio, 5, 23900 Lecco LC, Italia', 45.8566, 9.39767, 12, '', 'Bonifico bancario, postepay o contanti\ncaparra del 30 % alla conferma della prenotazione non rimborsabile in caso di disdetta ', '', '', '', 'Bergamo – Orio al Serio distanza km 76', 'Milano – Linate distanza Km100', 'Milano – Malpensa distanza Km 127', 'bellano tartavalle terme distanza km 12', 'Margno distanza 100 m', 'bellano distanza km 12', 'margno distanza 20 m', '1', 0, 52),
(53, 7, 3, 'residence saplaya', 'pedra e cupa', '08020', 'Budoni', 3664, 1172, 80, '3337938503', '', 'http://www.www.residencesaplaya.com', '', 'Il Residence Sa Playa è un moderno complesso residenziale che sorge a Budoni, splendida località balneare a soli trenta chilometri da Olbia. Non lontano dal centro del paese e nei pressi di un’ampia spiaggia di sabbia bianca, il residence è costituito da appartamenti di diverse tipologie, create per soddisfare le più diverse esigenze degli ospiti.', '', '', '', '', 'Dove siamo\n\nIl Residence sorge in posizione molto tranquilla ai confini della bella spiaggia di Budoni su un terreno recintato pedonale, circondato dal verde. A pochi minuti a piedi dal centro abitato di Budoni, dista 100/150 mt. ca. dalla bella spiaggia di sabbia raggiungibile attraversando la pineta. Il residence dista 35km dall''aeroporto di Olbia, 40km dal porto di Olbia e 50km dal porto di Golfo Aranci.', '', '', '', 0, 0, 0, 0, 'Via Molise, 40, 08020 Budoni OT, Italia', 40.7032, 9.71664, 17, '', '', '', '', '', '30 km', '', '', '', '800mt', '100mt', '100mt', '1', 0, 53),
