(55, 4, 3, 'B&B IL GIARDINO DEI SOSPIRI', 'via dei Sospiri 24', '97100', 'RAGUSA IBLA', 3674, 1170, 80, '0932651418', '0932651418', 'http://www.www.ilgiardinodeisospiri.it', '', 'Il B&B “Il Giardino dei Sospiri”  - www.ilgiardinodeisospiri.it  -  tel. 0932651418  -  cell. 3332174485 – 3381079402   -   e-mail: ilgiardinodeisospiri@virgilio.it  -  si trova nel cuore del centro storico di Ragusa Ibla a lato di piazza Chiaramonte dove è ubicata la chiesa di S.Francesco all’Immacolata, uno dei 18 Monumenti UNESCO del Barocco Ibleo. Le camere sono molto grandi e sono l’ideale per ospitare sia una sola coppia che una intera famiglia. Sono dei veri e propi monolocali autonomi e indipendenti. All’interno troverete il bagno e l’angolo cucina ad uso esclusivo degli ospiti. I colori delle pareti sono vivaci e l’arredo richiama lo stile tradizionale del barocco siciliano. Ogni camera ha un letto matrimoniale, in più è possibile avere i letti per i bambini (che hanno a disposizione anche  libri per loro e colori) o per altri ospiti aggiunti. Le camere sono altresì attrezzate di comode poltroncine divanetto e tavolino in vimini. Il bagno e all’ interno con doccia e bidè,  è completo di fornitura asciugamani, teli bagno, fono asciugacapelli, e servizi cortesia. Il grazioso angolo cucina e totalmente attrezzato con stoviglie e piatti ed il loro uso è compreso nel prezzo.  Le camere si affacciano nel giardino attrezzato con tavolini per fare la colazione anche all’esterno quando il tempo lo permette. In giardino vi sono i gatti, le tartarughe, il riccio e naturalmente i limoni, i cedri, etc…I locali sono tutti forniti di climatizzatore e pompa di calore, la tv e la possibilità di collegarsi a internet con la linea ADSL. Il tutto è compreso nel prezzo della stagione.', '', '', '', '', 'The B & B "The Garden of Sighs" is located in the heart of the historic center of Ragusa Ibla.\n\nA few meters you can admire one of 18 UNESCO Monuments of the Baroque Ibleo: the church of St. Francis Immaculate (square Chiaramonte).\n\nThe rooms are very large and can accommodate a whole family.\n\nAre real rooms independent.\n\nThe bathroom is inside the room.\n\nInside is also the kitchen for your exclusive use.\n\nThe walls are bright and the decor recalls the traditional style of Sicilian Baroque.\n\nEach room has a double bed. It is pobbible also add beds for the kids (which is also available to book for them and colors) or for other guests added.\n\nThe rooms are also equipped with comfortable armchairs, sofa and coffee table wicker.\n\nIn the bathroom shower and bidet, complete supply towels, bath towels, hairdryer and courtesy service.\n\nThe nice kitchen, fully equipped with crockery and dishes and their use is included in the price.\n\nThe rooms overlook the garden equipped with tables to eat breakfast even outside when the weather permits.\n\nIn the garden there are cats, turtles, hedgehogs, and of course lemons, limes, etc ...\n\nThe rooms are all equipped with air conditioning and heating, TV and wireless connection to connect to the Internet with the ADSL line.\n\nEverything is included in the price of the season.\n', '', '', '', 0, 0, 0, 0, 'Via dei Sospiri, 97100 Ragusa RG, Italia', 36.9271, 14.7458, 17, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 0, 55),
