(57, 1, 2, 'Sunrise', 'via Bicchio 95/c', '55054', 'Massarosa Quiesa', 3682, 1168, 80, '+390584975297', '+390584975297', 'http://www.www.sunrisebeb.com', 'If you want to come in Tuscany you can accomodate at bed and breakfast Sunrise. Surrounded by an olive grove and wine yard in a relaxing and strategic location.', 'Scegli il Bed and breakfast Sunrise se volete venire in Toscana. La casa è circondata da un uliveto ed un vigneto nella zona resdienziale di Quiesa nel Comune di Massarosa ', '', 'Das Bed & Breakfast Sunrise liegt ruhig an einem Weinberg, direkt neben einem Olivenhain im Ortsteil Bicchio in Qiesa in den Bergen von Massarosa in der Toskana. ', '', 'I will you give some reasons to come at B&B Sunrise:\nWalking by foot or by bike on the Path - Bike Giacomo Puccini in Massaciuccoli (5 minutes by car).\nRent a bike in Massaciuccoli.\nTorre del lago with the beaches (20 minutes by car) and Torre del lago Puccini on the lake with the Puccini''s House.\nRoman Massaciuccoli, (5 minutes drive) with the Pavillion Armando Lera and archaeological xcavations.\nPieve a Elici (20 minutes) where you can visit Romanesque Church and enjoy a breathtaking panoramic view.\nCity-sightseeing of Lucca,Pisa, Viareggio, Pietrasanta.\nVisite Lake Massaciuccoli, oasi LIPU, visite Antro del Corchia Cavern\n', 'I motivi per venire al Sunrise bed and breakfast sono:\nvisita delle città di Lucca, Pisa, Viareggio, Pietrasanta a soli 20 minuti d''auto.\nVisita al lago di Massaciuccoli, canoa e kayak sul lago, visita area archeologica di Massaciuccoli, passeggiate in bici sulla pista ciclabile Puccini che collega Massaciuccoli a Lucca.Visita all''oasi LIPU, Raggiungere le spiagge di Marina di Vecchiano, Viareggio, Torre del lago, visita a Torre del lago Puccini, visita Grotta Antro del Corchia.\n', '', 'Spaziergänge durch den Park am Massaciuccoli-See\nAusflüge mit dem Boot oder Kanu auf der anderen Seite des Sees beim LIPU\nRadtouren mit Leihrädern sowie entsprechendem Kartenmaterial\nBesichtigung von Pisa mit Einkaufsbummel\nDie Strände von Viareggio und Forte dei Marmi sowie deren Nachtleben kennenlernen \nBesichtigung von Lucca und dem Palazzo Cenami, wo eine ständige Ausstellung von Erfindungen des Leonardo da Vinci gezeigt wird\nKunstgalerien von Pietrasanta  besichtigen\nDie Grotten Grotta dell’Antro del Corchia und Grotta del Vento besuchen\nMöglichkeit von Reitstunden auf nahegelegener Ranch nach Vereinbarung\nReitausflüge mit Begleitung', '', 0, 0, 0, 0, 'Via Bicchio, 95, 55054 Massarosa LU, Italia', 43.8507, 10.3632, 15, 'An advance 30 % stay by swift bank. The booking is confimed when  I receive the advance, I will send you a confirmation by mail.\n Cash on arrival, no accept credit card.\n', 'Viene richiesto un acconto pari al 30% del soggiorno tramite bonifico\nLa prenotazione è confermata al momento della ricevuta del bonifico.\n', '', 'Die Anzahlung beträgt 30% der gesamten Übernachtungskosten. Wenn die Anzahlung überwiesen wurde, schicke ich Ihnen eine Buchungsbestätigung per E-Mail. Bei Ihrer Ankunft zahlen Sie den Restbetrag in bar. Bitte beachten Sie, dass ich keine Kreditkarten akzeptiere.\n', '', 'Galileo Galilei Pisa', '', '', 'Massarosa Bozzano', 'a 300 mt Sulla SP sarzanese', '12 km Viareggio, Torre del Lago, Marina di Vecchiano', 'Donatella a piedi 5 minuti nel centro di Quiesa', '1', 0, 57),
(58, 1, 0, '', NULL, NULL, NULL, NULL, NULL, 80, NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL, 0, 0, 7, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 0, 58),
(59, 1, 3, 'Hotel Ristorante Al Gabbiano', 'via della vittoria 45', '31047', 'levada di ponte di piave', 3696, 1157, 80, '0422853725', '0422853540', 'http://www.www.algabbiano.it', '', 'Ubicato in posizione tranquilla, l''albergo dispone di 30 camere tra singole, doppie e suite, tutte con bagno dotato di vasca, doccia o idromassaggio, con una capacità massima ricettiva di 65 ospiti circa.\n\nRicordiamo che l''Hotel, così come il ristorante, sono aperti tutto l''anno e si accettano sia clienti individuali che gruppi.\n\nAl Vostro arrivo riceverete una calorosa accoglienza e Vi forniremo tutte le informazioni ed i servizi necessari per soddisfare le Vostre esigenze e desideri.\n\n''Hotel dispone di vari tipi di camere con servizi differenziati sì da soddisfare le disponibilità economiche e le richieste di tutti i nostri ospiti garantendo, in ogni caso, ottime camere, un ambiente molto pulito e confortevole e un servizio sempre accurato, cordiale e premuroso.\nIl nostro albergo è frequentato da molte famiglie ed i bambini si trovano perfettamente a loro agio e vengono accuratamente serviti come gli adulti.\nA disposizione il servizio di baby-sitting 24h24, assicurato da una brava e professionale baby-sitter.\nL''albergo mette gratuitamente a disposizione dei propri ospiti delle biciclette per visitare tranquillamente il nostro comprensorio.\nSe amate gli animali e non volete lasciarli soli durante i vostri viaggi non preoccupatevi: da noi gli animali sono bene accetti. Il costo totale per il loro alloggio è di Euro 15,00 e, a pagamento, è possibile affidarli al nostro dog-sitter di fiducia.\nSu semplice richiesta mettiamo a disposizione dei nostri ospiti computer e fax.\nIl nostro albergo è stato ristrutturato evitando barriere architettoniche ed è adeguatamente organizzato per accogliere disabili.\nAscensore, spazi comuni ed alcune camere hanno saputo tenere in giusta considerazione tali necessità.', '', '', '', '', 'MARCA DI TREVISO\n\nLa provincia di Treviso è piena di sorprese: se la vedi ti innamori!\nIn un viaggio attraverso la marca rimarrete incantati dall’alternarsi dei paesaggi e dalle attraenti opere d’arte.\nL’intera provincia è attraversata da fiumi e canali come una piccola Venezia e grazie a ciò, i suoi terreni risultano fertili e rigogliosi.\nGrazie alle vie di comunicazione Venezia è raggiungibile in ca 30 minuti.\nUna vacanza in questo territorio offre un’esperienza indimenticabile e non solo durante il periodo estivo; in autunno, stagione delle vendemmie, è possibile organizzare visite alle campagne ed alle cantine con assaggi di vini e prodotti tipici insomma dei veri e propri itinerari eno-gastronomici.\nDa non dimenticare la rinomata cucina della marca ed i suoi prodotti:\nil radicchio rosso di Treviso\ngli asparagi bianchi di Cimadolmo\ni funghi del Montello e le erbette spontanee\ni formaggi delle malghe\ni maroni di Combai\ne natruralmente i vini tra cui spicca il prosecco di Conegliano e Valdobbiadene (DOC).\nSia che trascorriate con noi un week-end o un soggiorno più lungo non avrete il tempo di annoiarvi e non ve ne andrete delusi.\nSe non siete pigri e desiderate una vacanza attiva potrete approfittare dei percorsi ciclabili e delle gite a cavallo.', '', '', '', 0, 0, 0, 0, 'Via della Vittoria, 45, 31043 Fontanelle TV, Italia', 45.8243, 12.451, 17, '', '', '', '', '', 'Treviso (20km)', 'Venezia (40km)', '', 'San donà di Piave', 'Levada', 'Jesolo (35km) - Caorle', '', '1', 0, 59),
(61, 1, 3, 'Agriturismo Casalina Lunigiana', 'Via Casalina 1, Gorasco', '54011', 'Aulla', 3683, 1168, 80, '3487924334', '0585982024', 'http://www.agriturismocasalina.it', 'Bio Agriturismo Casalina Lunigiana, Aulla, Massa Carrara, Tuscany, near Fosdinovo and Fivizzano. The farm organizes themed tours History, Art and Relax at the castle of Malaspina Fosdinovo, the caves of Equi Terme and Terme and the marble quarries of Carrara. Or hike to the theme "sea" in the Cinque Terre departing by ferry from the pier in La Spezia and Portovenere car and Fiascherino, Lerici.', 'Bio Agriturismo Casalina Lunigiana,Aulla,Massa Carrara,Toscana, vicino a Fosdinovo e Fivizzano. L''Agriturismo organizza escursioni a tema Storia, Arte e Relax al castello Malaspina di Fosdinovo, alle Grotte e Terme di Equi Terme e alle cave di marmo di Carrara. Oppure escursione a tema "mare" alle Cinque Terre con partenza in traghetto dal molo di La Spezia e in auto a Portovenere e Fiascherino,Lerici.', '', 'Bio Agriturismo Casalina Lunigiana, Aulla, Massa Carrara, Toskana, in der Nähe Fosdinovo und Fivizzano. Der Hof veranstaltet Themenführungen Geschichte, Kunst und Relax auf der Burg Malaspina Fosdinovo, die Höhlen von Equi Terme und Terme und die Marmor-Steinbrüche von Carrara. Oder zum Thema "Meer" in der Cinque Terre Abfahrt mit der Fähre von der Anlegestelle in La Spezia und Portovenere Auto und Fiascherino, Lerici wandern.', '', 'Malaspina Castle Fosdinovo, Caves and Thermal Equi Terme, marble quarries of Carrara, Cinque Terre, La Spezia, Portovenere, Fiascherino, Lerici, Pietrasanta (LU).', 'Castello Malaspina di Fosdinovo, Grotte e Terme di Equi Terme, Cave di marmo di Carrara,Cinque Terre, La Spezia, Portovenere, Fiascherino,Lerici,Pietrasanta (LU).', '', 'Malaspina Castle Fosdinovo, Höhlen und Thermal Equi Terme, Marmor-Steinbrüche von Carrara, Cinque Terre, La Spezia, Portovenere, Fiascherino, Lerici, Pietrasanta (LU).', '', 0, 0, 0, 0, 'Via G. Verdi, 27, 54011 Gorasco MS, Italia', 44.1808, 10.0336, 16, 'Booking by telephone at the numbers and 0585.982024 348.7924334\nThe reservation payment of 10% of the total by postal order to: Agriturismo Casalina, Via N. Casalina 1 fraction Gorasco Aulla 54011 (MS)', 'Prenotazione telefonica ai numeri 0585.982024 e 348.7924334\nAlla prenotazione pagamento del 10% del totale mediante vaglia postale indirizzato a: Agriturismo Casalina, Via Casalina N. 1 frazione Gorasco di Aulla 54011 (MS)  ', '', 'Buchung per Telefon an den Zahlen und 0585.982024 348.7924334\nDie Reservierung in Höhe von 10% des gesamten per Postanweisung an: Agriturismo Casalina, Via N. Casalina 1-Fraktion Gorasco Aulla 54.011 (MS)', '', 'Pisa 100 Km', 'Genova 100Km', '', 'Aulla 9Km', 'Gorasco 2Km', 'Marinella,Bocca di Magra 35Km', 'Bio Agriturismo Casalina Lunigiana 0Km', '1', 0, 61),
(62, 7, 3, 'L''Alba Casa Vacanze', 'via Greppetto,29', '58014', 'Saturnia', 3680, 1168, 80, '3471510779', '', 'http://www.saturniavacanze.it', '', '<br>Mini-appartamenti per gruppi o famiglie:\n<br><br>\nMONOLOCALE<br>\npiano terra, ca. 35 mq; letto matrimoniale; TV su richiesta; soggiorno con angolo cucina completo; ampio bagno con doccia; dotazioni vedi sotto; piccola veranda con vista.<br><br>\nBILOCALE<br>\npiano primo, vista mare; ca. 35 mq; letto matrimoniale + letto aggiunto in soggiorno; TV su richiesta; soggiorno con  angolo cucina completo; bagno con doccia; lavatrice; dotazioni vedi sotto.\n<br><br>\nTRILOCALE<br>\npiano terra; ca. 50 mq; camera matrimoniale; camera 1 letto (francese); TV su richiesta; soggiorno con angolo cucina completo; ampio bagno con doccia; dotazioni vedi sotto.\n<br><br>\nCOLAZIONE: su richiesta acquistiamo per voi i prodotti locali direttamente dal produttore e ve li lasciamo nel vostro frigorifero\n<br><br>\nAmpio GIARDINO per grigliate all''aperto (massima sicurezza per bambini in libertà).\n<br><br>\nPOSTO AUTO all''aperto all''interno della corte.\n<br><br>\nPRODOTTI TIPICI A KM-0: dal vino al formaggio, dal miele alla carne di Chianina macellata su ordinazione. I nostri amici & partner maremmani vi forniscono i loro prodotti con una semplice telefonata. Listini su richiesta e in appartamento.<br>', '', '', '', '', 'L''Alba organizza pacchetti turistici per ogni esigenza.\nAbbiamo riservato ai nostri ospiti escursioni a piedi con Guida Esperta per adulti e bambini.\nVisite Guidate nel Mondo delle Api con possibilità di corsi ancheper avviare attività redditizia.\nEscursioni alle oasi della Maremma,e trasporti con N.C.C(a pagamento)', '', '', '', 0, 1, 1, 0, 'Piazza Vittorio Veneto, 21B, 58014 Saturnia GR, Italia', 42.6632, 11.5043, 17, '', '<br>\nRIDUZIONE sul biglietto di ingresso alle Terme di Saturnia.\n<br>\nRISTORANTI tipici CONVENZIONATI nelle immediate vicinanze (- 10% per i nostri ospiti).<br>\n.....................................................<br>\n<br>CHECK IN: entro h 18 (orario arrivo concordabile)<br>\nCHECK OUT: entro h 10.\n<br><br>\nDOTAZIONE DEGLI APPARTAMENTI:<br>\nbiancheria - asciugamani - stoviglie - tovaglia - detersivo piatti e panni - stendi biancheria - asse da stiro -phon <br>\n<br>\nBIANCHERIA<br>\nCambio 1 volta/settimana.<br>\nCambio extra 5 Euro/persona.<br>\n<br>\nSERVIZIO LAVANDERIA<br>\n5 Eu/bucato\n<br><br>\nANIMALI<br>\nAmmessi previo accordo. Tariffa extra in base alla taglia (costo pulizia).', '', '', '', 'FIUMICINO Roma - 180 Km', 'FIRENZE - 200 Km', 'PISA - 210 km', 'ALBINIA - 45 km', '50 mt (Poggio Murella)', '45 km (Orbetello - Argentario)', '250 mt (Poggio Murella)', '1', 0, 62),
