(75, 5, 0, 'Il Casale degli Ulivi', 'Via Colle dei Ronchi 1', '55051', 'Garfagnana', 3682, 1168, 80, '+393283439860', '', 'http://www.www.ilcasaledegliulivi.net', 'The property is spread over 6 hectares of land amidst lush forests of chestnut trees, green fields and olive groves interspersed with wooden tables and benches for a total relaxation in touch with nature. The area also includes structures that once served as barns, stables and two small metati where chestnuts were dried. The farmhouse is situated in an exclusive place of quiet, secluded but close to the center of Barga only 2.5 km (one of the 100 most beautiful villages in Italy at the gates of the Garfagnana). The location overlooks a beautiful view overlooking the Apuan Alps.\nThe structure is composed of two apartments, the furniture is in perfect Tuscan style.\nThe terracotta floors, exposed beams and the bricks cleaned by sandblasting, recovered and restored some of the furniture and wrought iron give the idea of being in a rural home country flavor.\nThe apartment "ANGLE OF THE SUN" is a kitchen with fireplace, double bedroom, sitting area with sofa bed and bathroom.\nThe apartment "ANGLE OF THE MOON" is a kitchen, double bedroom + single bed, sitting area with sofa bed, living room and bathroom. The apartments can be connected internally on request. \nOutdoors ample space for dining.\nIt offers sun beds, umbrellas, bicycles and barbecue.\nIn autumn you can pick up the chestnuts, you will have free equipment for roasting them.\nThe area surrounding the house is great for collecting mushrooms.\n', 'La proprietà si sviluppa su oltre 6 ettari di terreno tra lussureggianti boschi di castagni, verdi prati e uliveti intervallati da panchine e tavolini di legno per un totale relax a contatto con la natura. L''area comprende anche strutture che un tempo fungevano da fienili, stalle e due piccoli metati dove venivano essiccate le castagne. Il Casale è situato in un luogo di esclusiva quiete, isolato ma vicinissimo  al centro di Barga solo 2.5 km (uno dei 100 borghi più belli d''Italia alle porte della Garfagnana). La posizione domina uno splendido panorama che si affaccia sulle Alpi Apuane.\nLa struttura é formata da due appartamenti, l’arredamento è in perfetto stile toscano.\nI pavimenti  in cotto, le mezzane e i travicelli a vista  ripuliti con la tecnica della sabbiatura,  alcuni mobili  recuperati e restaurati e il ferro battuto danno l''idea di trovarsi in una casa country dal sapore agreste.\nL''appartamento "ANGOLO DEL SOLE" é composto da cucina con camino, camera matrimoniale, salottino con divano letto matrimoniale  e bagno.\nL''appartamento "ANGOLO DELLA LUNA" è composto da cucina, camera matrimoniale + letto singolo, salottino con divano letto matrimoniale, soggiorno e bagno. Gli appartamenti possono essere a richiesta collegati internamente.\nAmpio spazio per mangiare all''aperto.\nA disposizione lettini, ombrelloni, biciclette e barbecue\nNel periodo autunnale potrete raccogliere le castagne; avrete a disposizione gratuitamente il materiale per poterle arrostire.\nLa zona limitrofa del casale è ottima per la raccolta funghi.\n\n', '', 'Das Grundstück ist über 6 Hektar Land inmitten üppiger Wälder von Kastanienbäumen, grüne Felder und Olivenhaine mit Holztischen und Bänken für eine totale Entspannung in Kontakt mit der Natur durchsetzt verbreiten. Das Gebiet umfasst auch Strukturen, die einst als Scheunen, Ställe und zwei kleine metati wo Kastanien getrocknet wurden serviert. Das Bauernhaus liegt in einem exklusiven Ort der ruhigen, abgelegenen, aber nahe dem Zentrum von Barga nur 2,5 km (eine der 100 schönsten Dörfer in Italien vor den Toren der Garfagnana) gelegen. Die Lage mit Blick auf einen wunderschönen Blick auf die Apuanischen Alpen.\nDie Struktur der zwei Wohnungen besteht, die Einrichtung ist in perfektem toskanischem Stil.\nDie Terrakotta-Böden, Holzbalken und die Ziegel durch Sandstrahlen gereinigt, wieder und wieder einige der Möbel-und Schmiedeeisen geben die Idee, in einer ländlichen Heimat Geschmack.\nDie Wohnung "Winkel der Sonne" ist eine Küche mit Kamin, Schlafzimmer mit Doppelbett, eine Sitzecke mit Schlafcouch und ein Bad.\nDie Wohnung "Winkel des mondes" ist eine Küche, Schlafzimmer mit Doppelbett und Einzelbett, Sitzecke mit Sofa-Bett, Wohnzimmer und Bad. Die Wohnungen können intern auf Anfrage angeschlossen werden. \nIm freien viel Platz zum Essen.\nEs bietet Sonnenliegen, Sonnenschirme, Fahrräder und Grill\nIm Herbst abholen können die Kastanien, wird euch frei Ausrüstung zum Braten zu haben.\nDie Umgebung des Hauses ist für das Sammeln Pilze großen\n', '', 'The Casale degli Ulivi is very close to the old town of Barga which can be reached by car in only five minutes (2,5 Km). The ‘castle’ of Longobard origins and goes back to the XIV century, is situated on a hill closed off by walls with three gates and surrounded by the Appuan Alps and the Apennine. You will be enchanted by the Renaissance architecture of the buildings in the historic centre and the imposing churchyard of the Duomo which rises from the summit of the town offering an exceptional view of the Media Valle Del Serchio. To better enjoy the artistic charm of the town we suggest a visit to the Teatro Dei Differenti, the Chiesa di S. Francesco, the Civic Museum, the Praetorian Palace. For further information and documentation, our guests can visit the public library in the old town, a service that Barga offers its visitors for reading, research and study, with free and easy access. As well as culture and art we suggest a relaxing dip in the open-air public swimming pool (convention with us) at only 5 minutes from il Casale Degli Ulivi, which is open every day during the summer months. There is also a covered pool in nearby Gallicano that is open all year ‘round. Possibilities of walks to horse (two handlings are distant little Km, one to Barga, one to Gallicano), fields from tennis.\nFrom Barga you can easily reach many famous historic and naturals centres, such as:\n- Castelvecchio Pascoli  (3,5 Km) you can visit the museum-house of Giovanni Pascoli, to capture a sense of his poetry.\n- Castelnuovo di Garfagnana (15 min by car) you can chose whether to continue towards the Versilia Riviera or to get a flavour of the views on offer around the characteristic villages of the Garfagnana, and we can suggest a dip into nature with visits to:\n- the Parco dell’Orecchiella (1 hour by car) for animal lovers and botanists;\n- San Romano and the Fortezza delle Verrucole (40 minutes by car) through the villages of Caprignana and Orzaglia you will reach Verrucole and a short walk will bring you to the ancient Fortezza, a perfect setting for a relaxing picnic on the soft green meadows);\n- the Parco delle Alpi Apuane;\n- the Lago di Vagli (40 minutes by car), a special artificial lake, for its waters hide an ancient ghost town, Fabbriche, which emerges only once in every ten years when the lake is emptied in order to allow maintenance of the dam;\n- Campocatino (25 km), climb to Vagli di Sopra to reach a basin modelled by an ancient glacier and dotted with characteristic shepherd’s huts used for the summer pasture;\n- Gorfigliano and Gramolazzo (40 km), here you will be enchanted by the reflection of the Pisanino mountain in the clear waters of the artificial lake.\n- Castiglione Garfagnana (16 km), a typical fortified town surrounded by walls going back to the XII century. From Castiglione and proceeding further, you will reach the hamlet of S. Pellegrino in Alpe (less than an hour), and we suggest visiting the sanctuary of the same name.\n- Vergemoli and the Grotta del Vento (15 km) which offers underground to discover a wonderful world of stalactites and stalagmites.\n- Orrido di Botri (23 Km): nature reserve;\n- Lucca (36 Km),not to be missed: Duomo di San Martino, where the tomb of Ilaria Del Carretto and the wooden sculpture of the Volto Santo are conserved, Piazza Napoleone in the heart of the city, the churches of San Michele in Foro, of San Paolino and of San Frediano, Palazzo Mansi and the Guinigi tower;\n- Florence (95)to visit: Piazza della Signoria, the Duomo, the Uffizi, Santa Croce;\n- Pisa (56) we advise: the Leaning Tower, the Baptistery and the Duomo, which are all in the famous Piazza dei Miracoli;\n- Viareggio (55 Km) famous sea side resort with long promenade where you’ll find shops and restaurants and a few minutes from Viareggio you can also visit Forte Dei Marmi.\n\n', 'L’appartamento si trova a pochi passi dal centro storico di Barga, raggiungibile in auto in soli cinque minuti. L’antico castello di origine longobarda, risalente al XIV, è situato in zona collinare, cinto da mura con tre porte d’accesso, circondato dall’ Appennino Tosco-Emiliano e dalle Alpi Apuane. Rimarrete incantati dall’architettura rinascimentale degli edifici del centro storico e dall’imponente Sagrato del Duomo che erge dalla sommità del paese offrendovi un eccezionale panorama della Media Valle Del Serchio. Per gustare il fascino artistico del borgo suggeriamo di visitare il Teatro Dei Differenti, la Chiesa di S. Francesco, il Museo Civico, il palazzo Pretorio e per cogliere la poesia, poco distante da Barga, a Castelvecchio Pascoli, le porte della casa- museo di Giovanni Pascoli si spalancheranno al vostro arrivo.\nProseguendo in direzione Castelnuovo di Garfagnana (15 min in macchina) potrete scegliere se proseguire verso la riviera Versiliese o assaporare i panorami suggestivi offerti dai caratteristici paesi della Garfagnana, consigliamo un immersione nella natura visitando:\n- il Parco dell’Orecchiella (1 ora di macchina per gli amanti degli animali e della botanica);\n- San Romano e la Fortezza delle Verrucole (30 minuti di macchina attraversando i paesi di Caprignana e Orzaglia arriverete a Verrucole e dopo una breve passeggiata troverete l’antica Fortezza, ambiente ideale per rilassanti picnic sui morbidi verdi prati);\n- il Parco delle Alpi Apuane;\n-il Lago di Vagli (40 min in macchina), lago artificiale e speciale, le sue acque nascondono un antico borgo fantasma, il paese di Fabbriche, accessibile ai visitatori solo ogni 10 anni quando viene svuotato per lavori di manutenzione alla diga;\n- Campocatino, salite a Vagli di Sopra per raggiungere una conca modellata da un antico ghiacciaio caratterizzato dalle costruzioni dei pastori utilizzate come alpeggio estivo;\n- Gorfigliano e a Gramolazzo, qui rimarrete incantati dal riflesso del monte Pisanino riflesso nelle acque del lago artificiale.\nRaggiunto Castelnuovo e Pieve Fosciana arriverete a Castiglione Garfagnana, caratteristico paese fortificato da cinta muraria, risalente al XII secolo, raggiungibile in mezz’ora. Da Castiglione procedendo oltre, sopraggiungerete al borgo di S. Pellegrino in Alpe (in meno di un’ora), consigliamo di visitare il santuario dal omonimo nome.\n \n 	\n \n 	\nIn Direzione Gallicano:\n- Vergemoli e La Grotta del Vento che offre percorsi sotterranei alla scoperta di stalattiti e stalagmiti.\nA Barga per soddisfare la sete di sapere, i nostri ospiti potranno recarsi presso la biblioteca pubblica del borgo antico, un servizio di informazione che Barga porge ai turisti per letture, ricerche e studio, con accesso libero e gratuito. Dopo un allettante contatto con cultura e arte, vi proponiamo un piacevole e rilassante tuffo nella piscina comunale (convenzionata con la struttura) a soli 5 minuti dal Casale Degli Ulivi, aperta tutti i giorni con orario continuato.\nDa Barga sono facilmente raggiungibili, famosi centri storici come:\n- Lucca( da non perdere: Duomo di San Martino, dove vengono conservati la tomba di Ilaria Del Carretto e la scultura lignea del Volto Santo, Piazza Napoleone nel cuore della città, chiesa di San Michele in Foro, di San Paolino e di San Frediano, Pazzo mansi e torre Guinigi)\n- Firenze (da visitare: Piazza della Signoria, il Duomo, gli Uffizi, Santa Croce)\n- Pisa (vi suggeriamo: la Torre di Pisa, il Battistero ed il Duomo, queste opere sono concentrate nella famosa Piazza dei Miracoli);\n- Viareggio (nota città di mare offre passeggiata lungomare dove potrete incontrare negozi e ristoranti, a pochi minuti da Viareggio sarà possibile visitare l''illustre Forte dei Marmi).\n', '', '', '', 0, 0, 0, 0, 'Località Ronchi, 12, 55022 Bagni di Lucca LU, Italia', 44.0039, 10.5939, 17, '- Pet allowed, (small dog for free, medium and large dogs 5 euros per day) ;\n- Check-in and out: the rooms must be left free by 10:00 and are available from 15:00. For late arrivals prior warning is welcome. \n- Cradles and baby beds (5 euro per day);\n- No credit cards accepted;\n- Washing machine, dishwascher, dryer machine, located in an adjacent room, (5 euros to use)\n', '- animali ammessi (cani di grossa taglia supplemento 5 euro al giorno);\n- check-in: 15:00, check-out 10:00;\n- possibilità di aggiungere culle e lettini (supplemento 5 euro al giorno);\n- carte di credito: non accettate;\n- possibilità di utilizzare  lavatrice, lavastoviglie e asciugabiancheria, situate in un locale adiacente gli appartamenti (5 euro ad utilizzo)\n', '', '', '', 'Pisa, 60 km', 'Firenze, 90 Km', '', 'Barga/Mologno, 4 Km', 'Ponte di Catagnana, 1,3 Km', 'Viareggio, 45 Km', 'Ponte di Catagnana, 1,5 km', '1', 0, 75),
