(67, 7, 0, 'Il Poggio delle Ginestre', 'Via della Cittadella 13', '06089', 'Torgiano', 3690, 1163, 80, '+39075985248', '+390759880800', 'http://www.www.ilpoggiodelleginestre.it', 'Surrounded by olive groves and situated in the countryside of Torgiano, 18 km from Perugia, Poggio Delle Ginestre is a restored farmhouse offering a large garden with free facilities for barbecue, a bicycle rental service and rustic apartments.\n\nIl Poggio Delle Ginestre offers rooms located in a renovated farmhouse. Most of these rooms have en suite bathrooms and ceilings with exposed wood beams, and all include a TV and a kitchenette.\n\nDuring the summer, you can swim in the outdoor pool and enjoy the view of the valley of Torgiano, famous for the production of red and white wines protected.\n\nThe hotel is 6 km from the center of Torgiano and 15 minutes drive from the hill town of Assisi.', 'Circondato da uliveti e situato nella campagna di Torgiano, a 18 km da Perugia, il Poggio Delle Ginestre è un casale ristrutturato che offre un ampio giardino con attrezzature gratuite per barbecue, un servizio di noleggio biciclette e appartamenti rustici.\n\nIl Poggio Delle Ginestre vanta alloggi ubicati all''interno di un casale ristrutturato. La maggior parte di queste sistemazioni dispone di bagno interno e soffitti con travi in legno a vista, e tutte includono una TV e un angolo cottura.\n\nDurante l''estate, potrete nuotare nella piscina all''aperto e ammirare il panorama della valle di Torgiano, famosa per la produzione di vini rossi e bianchi protetti.\n\nLa struttura dista 6 km dal centro di Torgiano e 15 minuti di auto dalla città collinare di Assisi.\n', '', 'Umgeben von Olivenhainen und liegt in der Natur der Torgiano, 18 km von Perugia, Delle Poggio Ginestre ist ein restauriertes Bauernhaus mit einem großen Garten mit kostenfreien Einrichtungen zum Grillen, einen Fahrradverleih und rustikalen Wohnungen.\n\nIl Poggio Delle Ginestre bietet Zimmer in einem renovierten Bauernhaus. Die meisten dieser Zimmer haben ein eigenes Bad und Decken mit Holzbalken und verfügen alle über einen TV und eine Küchenzeile.\n\nIm Sommer können Sie im Außenpool schwimmen und genießen Sie den Blick auf das Tal von Torgiano, berühmt für die Herstellung von Rot-und Weißweinen geschützt.\n\nDas Hotel liegt 6 km vom Zentrum von Torgiano und 15 Minuten Fahrt von der Bergstadt Assisi.', '', 'Visit Assisi, Perugia, Todi, Gubbio, Torgiano among the most beautiful villages in Italy, with its museums Wine and Oil and discover the serenity of the Umbrian countryside.', 'Visitare Assisi,Perugia,Todi,Gubbio,Torgiano tra i Borghi più Belli d''Italia,con i suoi musei del Vino e dell''Olio e scoprire la serenità delle campagne umbre.', '', 'Besuchen Assisi, Perugia, Todi, Gubbio, Torgiano zählt zu den schönsten Dörfern in Italien, mit seinen Museen Wein und Öl und entdecken Sie die Ruhe der Landschaft Umbriens.', '', 0, 0, 0, 0, 'Galleria Kennedy, 06121 Perugia, Italia', 43.1107, 12.3908, 17, 'Payment required upon reservation 30% refundable for cancellations within 20 days of arrival.', 'Caparra alla prenotazione del 30 % ,rimborsabile per disdette entro 20 giorni dall''arrivo.', '', 'Anzahlung bei der Reservierung 30% Erstattung für Stornierungen innerhalb von 20 Tagen nach der Ankunft erforderlich.', '', 'Perugia 15 km', 'Fiumicino 190 km', 'Pisa 246 km', 'Perugia-Ponte San Giovanni 10 km', 'Torgiano 6 km', 'Passignano sul Trasimeno 39 km', 'Torgiano 6 km', '1', 0, 67),
(68, 1, 0, '''E Tarantelle', 'Via Formisano,16', '80125', 'Napoli', 3599, 1155, 80, '39817627682', '', 'http://www.www.etarantelle.it', '', 'Casa vacanze  “ ‘e Tarantelle”  è situato in posizione ottimale nel quartiere\ndi Fuorigrotta, in prossimità dello Stadio S .Paolo,  Mostra d’Oltremare e la\nCittà della Scienza.\nLa vicinanza delle stazioni metropolitana di Campi Flegrei e di Cavalleggeri d’\nAosta, la ferrovia Cumana consentono  di raggiungere con facilità i principali\nitinerari turistici della zona flegrea e del centro storico della città.\nGli appartamenti sono arredati in modo semplice e funzionale,  provvisti di\nangolo cottura attrezzato, aria condizionata e riscaldamento autonomo.\nTra i servizi inclusi sono compresi prenotazioni per ristoranti, teatri e\norganizzazione  di visite guidate.', '', '', '', 'Holiday home "''and Tarantella" is ideally located in the district\nFuorigrotta, near the Stadium S. Paolo, Overseas Exhibition and\nCity of Science.\nThe proximity of the subway stations of Campi Flegrei and Cavalleggeri d ''\nAosta, the Cumana railway allow you to easily reach the main\ntourist routes in the Phlegraean area and the historic center of the city.\nThe apartments are furnished in a simple and functional, equipped with\nkitchenette, air conditioning and heating.\nAmong the services included are including reservations for restaurants, theaters and\nguided tours.', '', '', '', '', 0, 0, 0, 0, 'Viale Bernabò, 14, 80046 San Giorgio A Cremano NA, Italia', 40.8375, 14.3492, 17, '', '', '', '', '', '12 km', '', '', '0,50 km', '100 m', '1 km', '50 m', '1', 0, 68),
(69, 5, 3, 'agriturismo cisogna', 'strada comunale cisogna snc', '03012', 'anagni', 3618, 1169, 80, '0775743017', '0775743017', 'http://www.www.agriturismocisogna.it', 'Small farmhouse in the green and quiet of the countryside CIOCIARA, but only 8 km from the Anagni-Fiuggi to 50 from Rome and 15 from valmontone playground with his "magic rainbow" and the center of the beautiful ciociaria with its majestic and mystical abbeys-cassino Fossanova Subiaco Trisulti Casamari-and its hilly countries labyrinthine alleys and suddenly their cathedrals-anagni fiuggi Alatri veroli Fumone ferentino-with its mysterious caves and Collepardo-batter-its spa or spa-ferentino and fiuggi -with its waterfalls ... in city-island-and lyrical at its borders tho ''there'' rome tivoli and gym and the Castelli Romani and 15 km the playground of valmontone and its outlet.\nServices: 6 rooms 2 apartments Agriristoro pool and games for young and old\nPrice: 45.00 half-board for 6 days half board 40,00 -\n55.00 double room with breakfast\nApartments-including linen and enel-80 gas, 00 per day for weekend 350.00 150.00 a week\nfacebook: Agriturismo Cisogna MarioColangelo\n', 'Piccolo agriturismo nel verde e nel silenzio della campagna CIOCIARA, ma a soli 8 km dal casello di anagni-fiuggi a 50 da roma e 15 da valmontone col suo parco giochi “magic rainbow” e al centro della bella ciociaria con le sue maestose e mistiche abbazie-cassino fossanova subiaco trisulti casamari-e i suoi collinari paesi dai vicoli labirintici e all’improvviso le loro cattedrali-anagni fiuggi alatri veroli fumone ferentino-con le sue misteriose grotte-pastena e collepardo-le sue terme o spa-ferentino e fiuggi –con le sue cascate…in citta’-isola liri-e ai suoi confini tho’ c’e’ roma e tivoli e palestrina e i castelli romani e a 15 km il parco giochi di valmontone e il suo outlet.\nServizi: 6 camere 2 appartamenti connessione wi-fi gratuita  agriristoro piscina e giochi per grandi e piccoli\nPrezzi: 45,00 la mezza pensione- per 6 giorni mezza pensione 40,00-\n55,00 camera doppia con colazione\nAppartamenti-compresi di biancheria enel e gas-80,00 al giorno 150,00 per i week end  350,00 la settimana\nfacebook: Agriturismo Cisogna MarioColangelo\n', '', '', '', '', 'la bella ciociaria', '', '', '', 0, 0, 0, 0, 'Com. le Osteria della Fontana Villa Magna Gorga, 51, 03012 Anagni FR, Italia', 41.7204, 13.1333, 9, '', 'pagamento in contanti o carte di credito cancellazioni 7 giorni prima acconto 20 %', '', '', '', 'roma ciampino 50 km/ roma fiumicino 80 km', '', '', 'anagni-fiuggi 10 km', 'via anticolana 4 km', 'terracina 60 km', 'noi 0 km /lo schiaffo 4 km', '1', 0, 69),
(70, 1, 0, 'Le Quercioline', 'strada di Marcialla 4F', '50028', 'Tavarnelle val di Pesa', 3679, 1168, 80, '+393387983713', '+390558065011', 'http://www.www.lequercioline.com', '"Le Quercioline" in the heart of the Chianti countryside with its gentle hills where vineyards alternate with olive groves in an area rich in artistic, historical and cultural interest. \nHere you may spend pleasant moments relaxing in our large garden or at the side of the pool having a splendid view of the valley below. \nImmerge yourselves in the enchanted atmosphere of the nerby medieval village by tasting the traditional local food and enjoying the finest wines.\nOnly a few kilometers away you may play tennis, rent bicycles and go on horse ', '\n     "Le Quercioline"\n\nVi attendono nel cuore del Chianti, a metà strada tra Firenze e Siena, in un ambiente caratterizzato da dolci colline, dove le vigne si sposano agli olivi ed al centro di una zona ricca di interessi artistici, storici e culturali.\nPotrete trascorrere piacevoli momenti di relax nel nostro parco ed ai bordi della piscina che si affaccia su di una splendida vallata, oppure immergervi nell''atmosfera incantata dei vicini borghi medioevali, degustando ottimi vini e tipici prodotti locali.\nNelle vicinanze si trovano San Gimignano, Monteriggioni, Certaldo e Volterra. Con escursioni giornaliere è possibile visitare le altre belle città toscane quali Pisa, Lucca e Arezzo. Possibilità di prenotare: voli in mongolfiera, campi da tennis, noleggio di biciclette e scuole di equitazione! ', '', 'Le Quercioline" erwartet Sie in Zentrum des Chiantigebietes, einer Landschaft aus malerischen Hügeln, bewachesen mit Weinreben und Olivenbï¿½umen.\nDieses Gegend ist reich an Kï¿½nstlerichen, historischen un kulturellen Interessen. \nSie kï¿½nnen sich im Park oder am Schwimmbad, von dem man auf eine herrliche Taleben blickt, entspannen oder bei einer Weinprobe und dem Genuss von typischen Produkten die bezaubernde Stimmung de nahen, mittelalterliche Orte eleben. In der Nï¿½he gibt es San Gimignano, Monteriggiorni, Certaldo, Volterra. \nIn der Nï¿½he gibt es Tennisplï¿½tze, Fahrradverleih un Reitschulen. ', '', 'Beautifull city of Florence, Siena San Gimignano, Certaldo.\nTour in mountain bike\nTreakking\nCooking Class\nCake design\nTasting wine\n', 'Città d''arte quali Firenze, Siena, San Gimignano, Certaldo.\nEscursioni in mountain bike\nPercorsi Treakking\nScuola di Cucina\nScuola di pasta fresca\nCake design\nCorsi di ceramica\nDegustazioni vino e olio\nCucina toscana', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 49, 50028 Certaldo FI, Italia', 43.5617, 11.1592, 17, '', '', '', '', '', 'firenze 30 km', 'pisa 80 km', 'bologna 110 km', 'Poggibonsi 10km', 'Tavarnelle val di Pesa 1 km', 'Costa tirrenica 100 km', 'Tavarnelle val di Pesa 1 km', '1', 0, 70),
(71, 1, 0, 'Cascina Bricchetto Langhe', 'Via Naranzana 22', '12050', 'Trezzo Tinella', 3647, 1156, 80, '+390173630395', '+390173630395', 'http://www.cascinabricchetto.it', 'Cascina Bricchetto Langhe, a hamlet of traditional Le Langhe stone farmhouses, can be found at Trezzo Tinella (Cn) about 10 Km from Alba and 3 km Barbaresco. The farmhouse, possibily the oldest in the area, is situated at an altitude of 550m at the top of a peaceful remote hill surrounded by vineyards and hazelnut groves as far as the eye can see.  Two of the houses have recently been renovated to a very high luxury standard maintaining many original features and using natural and local materials. They are furnished with both antique and modern furniture and have the advantage that being built in stone which are warm in the winter and cool in the summer. They are completely independent of one another.\n Since 2008 the accommodation has held a prestigious certificate of quality given by Ospitalita Italiana.\nThe views are extraordinary; a sequence of hills overlooked by Monviso and the Monte Rosa massif. \n Cà dra Topia (House of the "pergola"):\n entrance, a living room with kitchenette, three large bedrooms, three shower rooms, balcony. \n Cà der Forn (House of the bread oven): entrance, a large living room, very well equipped kitchen ,  two large bedrooms , one bathroom and one shower room, balcony,   garden.\nIn the grounds of Cascina Bricchetto you will find a covered area for eating outside, a covered parking area and various toys for the children e.g. swings, sandpit, rocking horse, skittles.  From the house you can take many quiet country walks along the small country lanes.\n', 'La Cascina Bricchetto Langhe, situata all''apice di una collina a circa 550 m., nei vigneti che la circondano produce uva moscato di qualità. L''attività agricola è corredata da attività di accoglienza turistica nelle due case ricavate nel corpo centrale dell''antica costruzione  in pietra di Langa durante la ristrutturazione conclusa nel 2006. Nella ristrutturazione sono state salvate le strutture originali ( es. i voltini in mattoni a vista) nella misura in cui è stasto possibile conciliarle con le esigenze di efficienza, sono stati usati materiali naturali e tipici, il risultato dell''intervento conservativo sono tra l''altro due case di grande "charme" con vista straordinaria  a 360° fino alle Alpi Marittime-Cozie e Pennine.', '', '', '', 'Only a few kilometers away you can discover the historical towns of Asti (renowned for the September Palio), Alba ( a medieval town full of towers and arcades, famous for the truffle fairs in October), Bra ( home to the Slow Food movement) and Cherasco;  not forgetting the various wine castles of Barolo, Grinzane Cavour, Magliano Alfieri, Govone etc.\nThe beautiful city of Turin, which is full of museums, ancient buildings and historic cafes, is located about 70 km away and can be reached by train from the railway station of Asti.\nThe sea and the coast of Liguria are about 100 km.\n', '', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 265, 12050 Trezzo Tinella, Province of Cuneo, Italy', 44.6772, 8.12024, 15, 'Our breakfast is rich, offers local products made according to old recipes, appreciated also by Slow Food that we put into the Guide "Inns of Italy".\nIt ''easy to reach the House Bricchetto Langhe:\nAsti-Cuneo motorway A33 exit Castagnitto, follow signs for Neive then for Trezzo Tinella, past the sign-off of the town of Trezzo Tinella the four following signs "Cascina Bricchetto" you get the height of the hill in our yard.\nAirports: Levaldigi Cuneo, Turin-Caselle.\n', '', '', '', '', 'Torino Caselle, 70 km', 'Cuneo Levaldigi, 60 km', 'Milano Malpensa, 185 km', 'Castagnole delle Lanze, 7 km', 'Neive, 5 km', 'Savona-Albissola, 110 km', 'S.Donato, 2,5 km', '1', 0, 71),
(72, 5, 3, 'Agri-Bio podere Santa Palmira', 'podere Santa Palmira', '56045', 'Pomarance', 3684, 1168, 80, '+39058861198', '', 'http://www.www.santapalmira.eu', '', 'Unico appartamento indipendente per 6-9 persone in splendido casolare del 1860, azienda agricola biologica. Pace e tranquillita'', meravigliosa vista sulla campagna, equidistante dalle principali citta'' d''arte della Toscana, al confine della riserva di Monterufoli. Ideale per famiglie e gruppi di amici. Relax assoluto, escursioni, visite della regione, possibilita'' di corsi di ceramica  nell''attrezzato laboratorio.    \n\nGrande appartamento con 3 camere da letto, 2 bagni, cucina abitabile e meraviglioso spazio all''aperto completo di piccola piscina da godersi in esclusiva. Grande cura nella ristrutturazione e nell''arredamento, per una vacanza dove sentirsi a casa propria.\n\n', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 47, 56045 Pomarance PI, Italia', 43.2997, 10.8396, 15, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 0, 72);
