(73, 5, 4, 'Agriturismo I MORI GELSI - Fattoria Spinola', 'via Entrata, 37', '06089', 'Torgiano', 3690, 1163, 80, '+39075982815', '+39075982815', 'http://www.spinolaonline.it', 'Charming Farmhouse with pool in the heart of the historic wine Estate, a short drive from Assisi and Perugia, in the very heart of Umbria Region.\nSimple but refined welcome, friendly and attentive, family-centered guest comfort and careless to the needs of a carefree and relaxing holiday, immersed in the vineyards and the peace of the land of St. Francis.\nPool, panoramic view, private garden with a private furnished pergola and a barbecue for each unit. \nIn the heart of an historic DOC wine Estate, near Perugia, Assisi and towns of art. Accessible to wheelchairs, pets allowed. \nLarge organic vegetable garden available for free, welcome basket with breakfast and two bottles of our wine as arrival gift.', 'Agriturismo di charme con piscina nel cuore di storica azienda vinicola, a due passi da Assisi e Perugia, al centro della Regione Umbria.\nUn''accoglienza semplice ma curata, amichevole ed attenta, molto cordiale e familiare, incentrata sul comfort dell''ospite e della sua esigenza di una vacanza spensierata e rilassante, immersa nei vigneti e nella pace della terra di San Francesco.\nGrande orto biologico a disposizione gratuita, cesto del benvenuto con prima colazione e vino DOC in omaggio.\nPiscina, vista panoramica, giardino privato attrezzato con a servizio di ciascun appartamento una pergola arredata ed un barbecue. Accessibile alle sedie a rotelle, animali domestici ammessi. ', '', 'Charmantes Bauernhaus mit Pool im Herzen des historischen Weingut, nur einen Steinwurf von Assisi und Perugia, in der Mitte von Umbrien.\nWillkommen einfache, aber raffiniert, freundlich und aufmerksam, sehr freundlich und Familie auf den Komfort der Gäste und deren Notwendigkeit für einen unbeschwerten und erholsamen Urlaub in den Weinbergen und in der Ruhe des Landes St. Francis eingetaucht konzentriert.\nGroße Bio-Gemüsegarten kostenlos zur Verfügung, Willkommenskorb mit Frühstück und kostenlosen Wein.\nSchwimmbad, Panoramablick, privater Garten mit einem Service jeweils möblierte Pergola und Grill. Zugänglich für Rollstühle, Haustiere erlaubt.', '', 'April to October is the best time to visit this green region, which has large lakes, beautiful mountains, chateaux, impressive monasteries and cathedrals. This region has an atmosphere of medieval mystery because many of the great saints come from here.\nLuckily there are lots of exciting towns in Umbria. Many of these towns are rich in architectural treasures especially from the Middle Ages plus there are a great many art collections. \nThe town of Torgiano still preserves its typical medieval appearance and the remains of its ancient walls.The Museum of Wine is of great interest, containing a precious collection of storical documents regarding various sectors: the art of wine-growing and wine-making, and artistic, folkloristic and bibliografic documentation on the subject.\n\n You may also admire a very precious collection of maiolica dating back to th 17th and 18th centuries. The fortified part of the town is siuated between the middle of the Tiber valley and that of the Umbrian valley. \nHere, the cultivation of the vine is an ancient art as is evidenced by the testimonial of archeologicals finds, and by a sketch dating back to the 14th century. \n\nThe zone is characterized by agriculture, consisting in the coltivation of various food-stuffs, and by craftsmanship, above all, the pottery trade. \n\nThe Museum of Wine is the most qualified in all of Italy, with its collections of tecnical instruments, prints dating back to various times, specialized craftsmanship and folkloristic documents.', 'Aprile ad ottobre è il periodo migliore per visitare questa regione verde, che dispone di grandi laghi, belle montagne, castelli, monasteri e cattedrali imponenti. Questa regione ha un clima di mistero medievale, perché molti dei grandi santi vengono da qui.\nPer fortuna ci sono un sacco di città interessanti in Umbria. Molte di queste città sono ricchi di tesori architettonici soprattutto dal Medioevo in più ci sono grandi collezioni d''arte.\nLa città di Torgiano conserva ancora il suo tipico aspetto medievale e resti di suo Museo del Vino antico walls.The è di grande interesse, che contiene una preziosa raccolta di documentazioni storiografiche riguardanti vari settori: l''arte della viticoltura e la vinificazione, e artistico, la documentazione folkloristica e bibliografica sul tema.\n\n  Si può anche ammirare una collezione molto preziosa maiolica risalente al secolo 17 e 18. La parte fortificata della città nasce tra la media valle del Tevere e quella della valle umbra.\nQui, la coltivazione della vite è un''arte antica, come è dimostrato dalla testimonianza di reperti archeologici e da un disegno risalente al 14 ° secolo.\n\nLa zona è caratterizzata da agricoltura, con colture di vari prodotti alimentari, artigianato e, soprattutto, il commercio di ceramica.\n\nIl Museo del vino è il più qualificato in tutta Italia, con le sue raccolte di strumenti tecnici, stampe di epoca diversi, artigianato specializzato, documenti del folclore.', '', 'April bis Oktober ist die beste Zeit, um diese grüne Region, die großen Seen, schöne Berge, Schlösser, beeindruckende Klöster und Kathedralen hat Besuch. Diese Region hat eine Atmosphäre der mittelalterlichen Mysterienspiel, weil viele der großen Heiligen von hier.\nGlücklicherweise gibt es viele spannende Orte in Umbrien. Viele dieser Städte sind reich an architektonischen Schätzen vor allem aus dem Mittelalter plus gibt es sehr viele Kunstsammlungen.\nDie Stadt Torgiano bewahrt noch seine typischen mittelalterlichen Aussehen und die Überreste der antiken walls.The Museum of Wine ist von großem Interesse, die eine wertvolle Sammlung von storical Dokumente über verschiedene Sektoren: die Kunst des Weinbaus und der Weinherstellung und künstlerische, volkskundliche und Bibliografische Dokumentation zu diesem Thema.\n\n  Sie können auch bewundern eine sehr wertvolle Sammlung von Majolika aus dem th 17. und 18. Jahrhundert. Die befestigte Teil der Stadt liegt zwischen der Mitte des Tiber-Tal und dem der umbrischen Tal siuated.\nHier ist der Anbau von Reben eine alte Kunst, wie es durch die Zeugnis archeologicals Funde belegt, und eine Skizze aus dem 14. Jahrhundert.\n\nDie Zone ist von der Landwirtschaft geprägt, bestehend in der coltivation von verschiedenen Lebensmitteln, und Handwerkskunst, vor allem der Töpferei Handel.\n\nDas Museum of Wine ist die am besten qualifizierten in ganz Italien mit seinen Sammlungen von Technische Instrumente, druckt aus verschiedenen Zeiten, spezialisierte handwerkliche und volkskundliche Dokumente.', '', 0, 0, 0, 0, 'Via Entrata, 36, 06089 Torgiano PG, Italia', 43.0356, 12.4389, 17, 'RESERVATION DEPOSIT – Reservations are not considered “guaranteed” until a reservation deposit is payed. An advance payment equal to 50% of the rental rate is required to confirm you booking to be sent within 4 (four) working days after your email of booking confirmation. The advance payment will be applied toward the apartment rent. Please make payments in the form of bank money orders or Paypal (Paypal requires an extra charge of 4% of the sum due to be refunded with the balance). The advance payment is not a damage deposit. The BALANCE OF RENT + UTILITIES is due the day of your arrival date. \n\nConfirmation of reservation(s) – Confirmation of the reservation will be emailed to Guest(s) upon receipt of the reservation advance payment.', 'Deposito di prenotazione: Al momento della prenotazione verrà richiesta una caparra confirmatoria, pari al 50% della tariffa di soggiorno, da inviare tramite  bonifico bancario o Paypal (con una aggiunta del 4% di commissione del servizio Paypla stesso). \nTale caparra garantirà la prenotazione e viene richiesta entro 3/4 giorni lavorativi dopo il ricevimento da parte dell''ospite delle coordinate per il versamento. In questi 3/4 giorni viene garantita l''opzione sulla locazione.\nAl ricevimento della caparra verrà inviato un voucher di conferma. Per le prenotazioni settimanali la caparra riguarderà solamente la tariffa del soggiorno; per le prenotazioni minimo tre notti  la caparra sarà versata sul totale della locazione. \nIl saldo ed eventuali consumi come il deposito danni vanno pagati all''arrivo.\n\nDeposito di danni: Alla partenza verrà restituita la cauzione, salvo eventuali danni arrecati all''interno o all''esterno della struttura e suoi arredi. Qualora gli alloggi siano lasciati molto sporchi o con immondizia o cocmunque in una situazione oltremodo indecorosa, ci riserviamo di trattenere una penale di Euro 40,00 quale rimborso di aggravio ore per ripristino appartamenti alla condizione ottimale.\nNon è consentito di spostare mobilio ed arredi se non preventivamente autorizzati. \n\nIl numero delle persone non può variare in eccesso rispetto a quelle dichiarate al momento della prenotazione ed al momento del check-in. Qualsiasi presenza o visita durante il periodo di soggiorno va autorizzata preventivamente. Non siamo responsabili per incidenti o danni subiti da ospiti che non rientrano tra quelli comunicati all''arrivo.', '', 'Anzahlung - Reservierungen gelten nicht als "garantiert", bis eine Anzahlung wird bezahlt. Eine Vorauszahlung in Höhe von 50% des Mietpreises ist erforderlich, um Ihre Buchung bestätigen innerhalb von 4 (vier) Werktagen nach Ihrer E-Mail der Buchungsbestätigung zugesandt. Die Vorauszahlung wird in Richtung der Wohnung mieten angewendet werden. Bitte stellen Sie Zahlungen in Form von Bank-Überweisungen oder Paypal (Paypal erfordert einen Aufpreis von 4% des Betrages zu erstatten mit der Balance). Der Vorschuss ist nicht eine Kaution. Der Saldo aus RENT + UTILITIES ist aufgrund der Tag Ihrer Ankunft.\n\nBestätigung der Reservierung (en) - Bestätigung der Reservierung wird Gast (s) nach Erhalt der Reservierung Vorkasse zugesendet.', '', 'San Francesco - Perugia, 5KM', 'Rome - Fiumicino, 150KM', 'Pisa, 100KM', 'Ponte San Giovanni, 4KM', 'Torgiano, 1KM', '', 'SIRO, 1KM', '1', 0, 73),
(74, 1, 4, 'Jazz Hotel', 'Via degli Astronauti, 2', '07026', 'Olbia - Sardegna', 3664, 1172, 80, '+390789651000', '+390789651001', 'http://www.www.jazzhotel.it', 'An innovative design hotel, situated in a strategic position in the north-east of Sardinia, 500m on foot from the airport, only 2km from the centre of Olbia and a few km from the most beautiful beaches of North Sardinia. An ideal point of departure for a leisure vacation, and also the perfect location for the modern business traveller. Contemporary design, where comfort meet functionality. High-level services that blend with the art of hospitality. 75 rooms fully soundproofed, bright, spacious (from 25 to 45 m2), with special Simmons mattresses to enhance the quality of your sleep. Free parking and monitored garage. And to stay always connected: internet free.', 'Hotel di nuova concezione, situato in posizione strategica nel nord-est della Sardegna, a 500mt dall''aeroporto, a soli 2 km dal centro di Olbia e a pochi chilometri dalle più belle spiagge del Nord Sardegna. Ideale punto di partenza per una vacanza relax, ma anche meta perfetta per i moderni business traveller. \nDesign contemporaneo e all’avanguardia, dove il comfort incontra la funzionalità. Servizi di alto livello che si fondono con l’arte dell’ospitalità. 75 camere completamente insonorizzate, luminose e di ampia metratura (25 ai 45 mq), con materassi speciali Simmons, per dormire bene e svegliarti ancora meglio. Parcheggio scoperto e garage a disposizione degli ospiti. E per rimanere sempre connessi: internet gratuito.\n', '', '', '', '', 'Castello di Pedres\nCabu Abbas\nSpiaggia di Porto Istana\nParco Padrongiauns', '', '', '', 0, 0, 0, 0, 'Via Montello, 33, 07026 Olbia OT, Italia', 40.9244, 9.49506, 12, 'For cancellation receives until 48 hours before the arrival, any penalty will be applied.\nIn case of late cancellation and no show, one night will be charged.', 'Per cancellazioni pervenute fino a 48 ore dall''arrivo non verrà applicata alcuna penale. In caso di cancellazioni successive e mancato arrivo, verrà addebitata la penale di 1 notte.', '', '', '', 'Olbia Costa Smeralda, 500mt', '', '', 'Olbia, 2km', '50 m', 'Porto Istana 6 km', 'Bacchus Ristorante - All''interno dell''hotel', '1', 0, 74),
