(77, 1, 3, 'hotel savio', 'viale 4 novembre 21', '47522', 'cesena', 3602, 1173, 80, '+39054721406', '+390547610050', 'http://www.info@hotelsavio.it', '', 'La combinazione di atmosfera confidenziale e servizi di qualità, l''hotel fa dell'' ospitalità il proprio tratto  distintivo.Un mix di calore che lo rende la scelta ideale sia per soggiorni di lavoro sia per il tempo libero e piacere.Le camere moderne e funzionali, l''attenzione particolare per le esigenze di ogni cliente ne fanno il proprio tratto distintivo', '', '', '', '', 'The combination of confidential atmosphere and quality services. A mix of warmth that makes it the ideal choice for business and leisure .The modern and functional rooms the particular focus on the needs of each client make their own distinctive', '', '', '', 0, 0, 0, 0, 'Via Cesare Battisti, 183, 47522 Cesena FC, Italia', 44.1394, 12.236, 17, 'We accept cash and all credit cards .The cancellation without penalty by contacting the property within 24 hours of arrival.', 'Si accettano pagamenti in contanti e con tutte le carte di credito.La cancellazione può avvenire senza penale contattando direttamente la struttura entro le 24 ore dalla data di arrivo.', '', '', '', 'Forlì ,20km', 'Rimini ,35km', '', 'Cesena 1,2km', '100m', 'Cesenatico 18km', '10m', '1', 0, 77),
(78, 1, 3, 'Giogaia', 'Via Modica Giarratana, 83/a', '97015', 'Modica', 3674, 1170, 80, '+393397693623', '+39932751769', 'http://www.www.giogaia.it', '', 'Giogaia è un accogliente bed & breakfast situato nelle colline degli Iblei in una zona residenziale tranquilla e fresca d''estate. Le camere a disposizione degli ospiti sono confortevoli ed ognuna dotata di bagno in camera, climatizzazione, tv e wi-fi. A disposizione dei nostri ospiti l''ampio cortile con il parcheggio interno gratuito, il giardino con un angolo giochi per i più piccoli ed un ampio terrazzo con vista sulla campagna modicana ed ombreggiato da un fantastico pergolato dove, tra l''altro, serviamo la colazione. La colazione è una composizione di sapori locali come le marmellate, i biscotti, il profumato pane, il famoso cioccolato modicano, le mpanatigghie o le cassatine di ricotta : alla Giogaia sono banditi le brioche confezionate o i buoni bar! Poi ci sono Giusy e Piero che con la loro spontanea e semplice cordialità ed accoglienza : loro sapranno consigliarvi nei vari tours nel Val di Noto. ', '', '', '', '', 'In pochi minuti di macchina si raggiungono i vari siti Unesco del Val di Noto come Modica, Scicli, Ragusa Ibla, Noto, Palazzolo Acreide e Siracusa, così come il litorale Ibleo con le fantastiche spiagge di Sampieri e Marina di Modica o come i vari siti archeo-naturalistici di Cava d''Ispica, Cava Grande del Cassibile e Vendicari od anche i famosi "Luoghi del Commissario Montalbano".', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 59, 97015 Modica RG, Italia', 36.8888, 14.7767, 17, '', '', '', '', '', 'Catania Fontanarossa, Km. 100', 'Comiso V. Magliocco, Km.25', '', 'Modica, Km. 7', 'Stazione bus Modica, Km. 5', 'Marina di Modica, Km. 18', 'Osteria delle 5 Vie, Km. 3,800', '1', 0, 78),
(79, 4, 0, 'B&B Trieste Plus', 'Via Udine 12', '34132', 'Trieste', 3613, 1171, 80, '+393402360894', '', 'http://www.triesteplus.com', '', 'Il B&B Trieste Plus è situato a pochi passi dalla stazione ferroviaria e nel centro nevralgico di Trieste. La sua posizione privilegiata vi permettere di raggiungere qualsiasi posto a piedi in poco tempo.\n\nIl B&B presenta servizi esclusivi come se fosse un hotel ad un prezzo smart. Tutte le camere presentano TV LED 32'' con canali satellitari, bagno privato, materasso comfort, wifi gratuito, asciugacapelli e molto altro.\n\nLa colazione verrà fatta trovare direttamente nel momento dell''arrivo ed è quindi consumabile in ogni momento. La pulizia delle camere avviene di norma ogni 3 giorni e naturalmente ad ogni cambio di cliente. Avrete la massima liberà di movimento in quanto è possibile effettuare anche il checkin in automatico e le chiavi sono sempre a vostra disposizione...\n\nIl quartiere è molto centrale ed è possibile trovare nelle vicinanze diversi supermercati, tabaccherie, edicole e via dicendo. Essendo una zona di passaggio è possibile per via della stazione è possibile trovare tantissimi negozi.', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Udine, 12, 34132 Trieste, Italia', 45.6572, 13.774, 17, '', '', '', '', '', 'Trieste-Ronchi dei legionari, 38KM.', '', '', 'Stazione centrale, 200M.', 'Stazione autobus, 300M.', 'Barcola, 4KM.', 'Pepenero Pepebianco, 150M.', '1', 0, 79),
(80, 4, 3, 'Leccesalento bed and breakfast', 'via dei Mocenigo, 2', '73100', 'lecce, centro storico', 3657, 1174, 80, '+390832307349', '+390832307349', 'http://www.www.beb-leccesalento.com', 'Half of our rooms face directly over the Piazza; a fantastic and unique sight!\nAll rooms have a private bathroom with shower. The bathrooms are accessorised with towels, soap, and a hairdryer. Every room has heating during the winter months, air conditioning during summer, television, DVD player, a small refrigerator and free high speed WI-FI Internet access. We can provide you with a mini bar for those who request it.\n\nYou will find the family care and greetings that are proper for a family run Bed & Breakfast. You will also find the privacy and the tranquility needed during a business or tourist stay.\n\nIn our main office, you will find all the information you may need during your stay in Lecce and the Salento region. This information includes up-to-date flyers, maps and special event brochures for attractions in Lecce and surroundings.\n\nOur costumers are helped and advised on excursions not only in Lecce but all over the beautiful Salento; from the Adriatic side with the beautiful Torre dell’Orso and city of Otranto, to the Ionian side with Gallipoli and Porto Cesareo. And if you want you can reserve a boat in the Ionian side making it a memorable journey.', 'Metà delle nostre camere affacciano direttamente sulla piazza: un panorama unico ed esclusivo!\n\nle nostre camere sono tutte fornite di bagno privato interno con doccia, gli asciugamani e l''asciugacapelli sono forniti da noi.  Ogni camera ha riscaldamento e aria condizionata nella stagione estiva,tv-color e lettore dvd,nei soggiorni superiori alle 2 notti troverete in camera un piccolo frigo bar.\n\nTroverete l''accoglienza familiare tipica dei bed and breakfast salentini ma anche massima privacy,  la tranquillità che ricercate in un soggiorno turistico o di lavoro.\n\nNell’ ufficio del gestore tutte le informazioni utili a visitare e a vivere lecce e il salento, insieme a materiale informativo ed a una mappa di lecce.”', '', 'Die Hälfte der Zimmer blicken auf den Platz: eine einzigartige und exklusiv!\n\nUnsere Zimmer sind alle mit eigenem Bad mit Dusche, Handtücher und ein Fön von uns gestellt. Jedes Zimmer verfügt über Klimaanlage und Heizung im Sommer, bleibt Farb-TV und DVD-Player, länger als 2 Nächte im Zimmer finden Sie einen kleinen Kühlschrank zu finden.\n\nHier finden Sie die Familie Gefühl von Salento Bett und Frühstück sowie ein Maximum an Privatsphäre, Ruhe, dass Sie sich für einen touristischen oder geschäftlichen suchen.\n\nIn ''Office Manager alle relevanten Informationen zu besuchen und zu leben Lecce und Salento, zusammen mit Informationsmaterial und einer Karte von Lecce. "', '', 'Being in the heart of the city has its advantages. From here, you can reach every place you want in Lecce in a short amount of time. There will always be someone to help you pick the best attractions and suggest the best way to reach them in the least amount of time. Thanks to our experienced staff, we can suggest additional services that can help you enjoy your stay in Lecce\n\n ', 'La posizione del nostro bed and breakfast nel centro storico della città di Lecce, permette di raggiungere facilmente tutti i posti più belli da visitare. La nostra esperienza e la nostra professionalità ci hanno permesso di selezionare una serie di servizi aggiuntivi adatti ad ogni esigenza. Chi sceglierà il nostro beb, avrà sempre un punto di riferimento a Lecce, una guida negli itinerari da scegliere, nei posti da visitare, nei locali da frequentare.\n', '', 'Die Lage unseres Bed and Breakfast in der historischen Altstadt von Lecce, in der Nähe von den schönsten Orte zu besuchen. Unsere Erfahrung und unsere Professionalität erlaubt es uns, eine Reihe von zusätzlichen Dienstleistungen auswählen, um jeden Wunsch zu erfüllen. Diejenigen, die unser Baby wählen, wird immer einen Bezugspunkt in Lecce, ein führendes Unternehmen in den Routen zur Auswahl, Orte, die Räumlichkeiten zu besuchen, um zu besuchen.', '', 0, 0, 0, 0, 'Via dei Mocenigo, 2-4, 73100 Lecce LE, Italia', 40.353, 18.1736, 17, 'The location of our bed and breakfast in the historic city of Lecce, within easy reach of all the most beautiful places to visit. Our experience and our professionalism allowed us to select a range of additional services to meet every need. Those who choose our baby will always have a point of reference in Lecce, a leader in the itineraries to choose from, places to visit the premises to attend.', 'Termini di cancellazione:\n\nSoggiorni di una notte\nPer cancellazioni pervenute:\n- fino a 2 giorni prima dell''arrivo entro le ore 12.00 nessuna penale, successivamente si applicherà la penale di una notte.\n\nSoggiorni di due notti e oltre\nPer cancellazioni pervenute:\n- fino a 4 giorni prima dell''arrivo entro le ore 12.00 nessuna penale, successivamente si applicherà la penale di una notte.\n\nGruppi\nPer cancellazioni pervenute: \n- fino a 15 giorni prima dell''arrivo, entro le ore 12.00, nessuna penale, successivamente si applicherà la penale del 30% dell''importo totale.\n\nNB: In caso di partenza anticipata, sarà addebitato il 50%\n\n ', '', 'Die Lage unseres Bed and Breakfast in der historischen Altstadt von Lecce, in der Nähe von den schönsten Orte zu besuchen. Unsere Erfahrung und unsere Professionalität erlaubt es uns, eine Reihe von zusätzlichen Dienstleistungen auswählen, um jeden Wunsch zu erfüllen. Diejenigen, die unser Baby wählen, wird immer einen Bezugspunkt in Lecce, ein führendes Unternehmen in den Routen zur Auswahl, Orte, die Räumlichkeiten zu besuchen, um zu besuchen.', '', 'brindisi-40km', 'bari-160km', '', 'lecce-0,5km', 'via XXV luglio-0,1km', 'S.Cataldo 10km, Torre dell''Orso 25km', '0,1km', '1', 0, 80),
(81, 1, 4, 'Agriturismo Casalicchio', 'c/da casalicchio', '92022', 'Cammarata', 3668, 1170, 80, '+390922908144', '+390922908144', 'http://www.www.casalicchio.info', '', 'Benvenuti all’agriturismo Casalicchio \n L’azienda prende il nome dall''omonimo Feudo appartenente alla famiglia degli attuali proprietari sin dal 1816. L’agriturismo è stato recentemente ristrutturato nel rispetto della sua originaria architettura, integrata con la normativa di sicurezza e attrezzata con strutture per diversamente abili. Le stanze e gli appartamenti indipendenti sono situati in una cornice incantevole. Il menù dell’Agriturismo Casalicchio con piatti tipici e creativi è adatto ai palati più raffinati, è tipico della regione e interamente biologico. E'' stato riconosciuto Agriturismo di Qualità della Regione Sicilia \n', '', '', '', '', 'SVAGHI, GIOCHI... \nI SERVIZI:\nAria climatizzata - piscina - tennis - sauna - campi bocce - giochi per bambini - parking - cucce per cani - biliardo - sala lettura - sala ristorazione - saletta convegni - sentieristica - mountain bike.\nEscursioni con guida a cavallo, mountain bike e fuoristrada.\nCorsi su richiesta: cucina - archeologia - agricoltura biologica.\nA circa 2,5 km Acqua Park con piscina ad onde, laguna - baby ed acquascivoli.\n\n \n \n', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 25, 92022 Cammarata AG, Italia', 37.6073, 13.7399, 12, '', 'Previa richiesta disponibilità, la Prenotazione deve pervenire tramite bonifico bancario entro e non oltre 7 giorni dall’arrivo del cliente.\nA seguito bonifico è necessario inviare ricevuta a mezzo fax al n. 0922 908144 per conferma.\n\n \nCoordinate bancarie:\nBonifico intestato a Francesca Borsellino\nBanco di Sicilia – Agrigento - Agenzia 20100\nIBAN IT 33 V 02008 16600 000102362211\nBIC/SWIFT UNCRITM1K63\n \n \n \n', '', '', '', 'palermo -puntarais, falcone borsellino ,  95 km', 'Catania , fontana rossa , 130 km ', '', 'Cammarata- (agrigento -palermo), 7 km', 'stazione-autobus , 10 km ', 'spiaggia san leone ,  45 km', 'nel nostro agriturismo , km 0', '1', 0, 81),
