(83, 4, 0, 'Bed and Breakfast ERMINIA', 'via marche, 19', '73054', 'Presicce', 3657, 1174, 80, '+393476636935', '', 'http://www.www.beberminia.it', 'The B & B Salento ERMINIA is pleased to welcome you to Prescot, in the province of Lecce, Salento location close to the beautiful beaches of the Ionian Sea and the picturesque Adriatic cliff.\n\n \n\nThe Salento Bed and Breakfast is located in a residential area and within easy reach in a short time the most charming towns of the Salento coast, such as Santa Maria di Leuca, Gallipoli and the famous Maldives of Salento.\n\n \n\nThe B & B offers ERMINIA welcome, hospitality and quality services in a new building, with five bedrooms, all tastefully furnished and equipped with every comfort, a spacious and bright breakfast room, where you start the best day, a garden, solarium, private parking and many other services that allow you to spend an unforgettable holiday in Salento.', 'Il B&B Salento ERMINIA è lieto di darvi il benvenuto a Presicce, in provincia di Lecce, località del Salento a ridosso delle splendide spiagge del mar Ionio e della suggestiva scogliera adriatica.\n\n \n\nIl Bed and Breakfast Salento è ubicato in zona residenziale e permette di raggiungere facilmente e in poco tempo le più affascinanti località della costa salentina, come Santa Maria di Leuca, Gallipoli e le famose Maldive del Salento.\n\n \nIl B&B ERMINIA garantisce accoglienza, ospitalità e servizi di qualità all''interno di una struttura di nuova costruzione, dotata di cinque camere, tutte finemente arredate e dotate dei migliori comfort, di un''ampia e luminosa sala colazioni, in cui iniziare al meglio la giornata, nonché di giardino, solarium, parcheggio privato e altri numerosi servizi che vi permetteranno di trascorrere un''indimenticabile vacanza nel Salento.\n\n﻿', '', 'Das B & B Salento ERMINIA freut sich Sie Prescot willkommen, in der Provinz Lecce, Salento Lage in der Nähe zu den schönen Stränden des Ionischen Meeres und der malerischen Adria Klippe.\n\n \n\nDer Salento Bed and Breakfast befindet sich in einem Wohngebiet und in der Nähe in einer kurzen Zeit befindet sich die schönsten Städte des Salento Küste, wie Santa Maria di Leuca, Gallipoli und dem berühmten Maldives des Salento.\n\n \n\nDas B & B bietet ERMINIA warme Gastfreundschaft und Qualität der Dienstleistungen in einem neuen Gebäude, mit fünf Schlafzimmern, alle geschmackvoll eingerichtet und mit allem Komfort, einem geräumigen und hellen Frühstücksraum ausgestattet, wo Sie die besten starten Tag, ein Garten, ein Solarium, einen privaten Parkplatz und viele andere Dienstleistungen, die Sie für einen unvergesslichen Urlaub in Salento verbringen können.\n\n', '', 'Presicce is one of the most beautiful cities of Italy ... - Words of "Bell''Italia", the most prestigious Italian magazine industry, also known abroad - ... with its oil mills, the elegant Old Town and secret gardens, is one of the most charming villages of Salento.\n\nPlaces to go:\n\nCrushers Ipogei\n\nThe town of Preston is in Salento, the one with the highest number of trappeti a cave, from the end of 1600 there were as many as 23 oil mills.\nThe oldest, located in the Pozzomauro, servivono to reorganize the surviving populations survived the invasions of the Saracens and then the potential for trade in agricultural products in a particular oil realized other trappeti along the ancient route linking Lecce in Santa Maria of Leuca\n\nCathedral Church of Saint Andrew the Apostle\n\nThe Mother Church stands on the same site of the ancient church destroyed by an earthquake in 1743, rebuilt between 1776 and 1781 and named after the patron Saint Andrew the Apostle.\nHas a grand Baroque facade and inside we find nine altars in front, right in the center of Piazza Colonna Villani was built the St. Andrew consists of a tall stem with capital on which is placed the statue of the saint.\n\nCarmelite church and monastery\n\nThe Carmelite church was consecrated in 1605 and always arouses a particular interest in visitors.\nNoteworthy is the altar carved in local stone columns with rich carvings and statues in the center of the image of Our Lady of Mount Carmel. The monastery was built later auna donation of a citizen of Preston, Martin Alfarano, the Carmelites of Lecce, suppressed in 1809, was subsequently transferred to the municipal administration and now houses the police headquarters, the city library and is designed to seat socio-cultural activities.\n\nChurch of Santa Maria degli Angeli and convent\n\nThe construction of the church of Santa Maria degli Angeli took place in 1596 is linked to the tradition in two events: the presence of an image of the Virgin that invite a farmer to express the reconstruction of the building and the healing of a blind man.\nIn 1603, with the establishment of the Reformed Fathers is built anew the monastery which was later abolished in 1866 to fall in a state of neglect.\n\nOur Lady of Loreto Church and Crypt of San Mauro\n\nThe church of Our Lady of Loreto, better known by the term dialect of Our Lady of the Rite or you luRitu, is a small rural church located on the height of the Serra Pozzomauro, has a modest altar with the painting of a Madonna and Child the angels.\n\nPalazzo Ducale\n\nThe Ducal Palace of Preston is currently home to the Museum of Rural Life, was adorned with hanging gardens and a chapel in 1630 by the will of Princess Maria Moles quote.\n\n\nTrivia: The people of Preston are nicknamed "Mascarani" following the killing of Prince Charles Bartilotti, was shot by a masked man as he looked through a window of the old castle to greet the festive citizens.', 'Presicce è tra le più belle città d’Italia... - parole di "Bell’Italia", la più autorevole rivista italiana di settore, conosciuta anche all’estero - ...con i suoi frantoi ipogei, l’elegante centro storico e i giardini segreti, è tra i più affascinanti borghi del Salento.\n\nLuoghi da visitare:\n\nFrantoi Ipogei\n\nIl comune di Presicce è, in tutto il Salento, quello con il maggior numero di trappeti a grotta, a partire dalla fine del 1600 contava ben 23 frantoi ipogei.\nI più antichi, situati nella zona di Pozzomauro, servivono a riorganizzare le popolazioni superstiti scampate alle invasioni dei Saraceni e successivamente per potenziale il commercio di prodotti agricoli in maniera particolare dell’olio realizzarono altri trappeti lungo l’antico percorso che collegava Lecce a Santa Maria di Leuca\n\nChiesa Madre di Sant''Andrea Apostolo \n\nLa chiesa madre sorge sullo stesso luogo dell''antica parrocchiale distrutta dal terremoto del 1743, ricostruita tra il 1776 e il 1781 e intitolata al patrono Sant’Andrea Apostolo.\nPresenta una maestosa facciata in stile barocco e al suo interno troviamo ben nove altari, di fronte, proprio al centro di Piazza Villani fu edificata la Colonna di Sant''Andrea costituita da un alto fusto con capitello su cui è posizionata la statua del santo.\n\nChiesa del Carmine e convento\n\nLa chiesa del Carmine venne consacrata nel 1605 e suscita sempre un particolare interesse nei visitatori.\nPregevole è l’altare scolpito in pietra leccese con colonne ricche di intagli e statue con al centro l’immagine della Madonna del Carmelo. Il convento sorse in seguito auna donazione di un cittadino di Presicce, Martino Alfarano, ai Carmelitani di Lecce, soppresso nel 1809, fu ceduto successivamente all''amministrazione comunale e oggi ospita il comando di polizia municipale, la biblioteca comunale ed è destinato a sede di attività socio-culturali.\n\nChiesa di Santa Maria degli Angeli e convento \n\nL''edificazione della chiesa di Santa Maria degli Angeli avvenuta nel 1596 è legata secondo la tradizione a due eventi: alla presenza di un''immagine della Vergine che invita un contadino a farsi portavoce della ricostruzione dell''edificio e alla guarigione di un cieco.\nNel 1603, con l''insediamento dei Padri Riformati si edifica ex novo il convento che venne poi soppresso nel 1866 fino a cadere in stato di profondo abbandono.\n\nChiesa Madonna di Loreto e Cripta di San Mauro \n\nLa chiesa della Madonna di Loreto, meglio conosciuta con l''espressione dialettale di Madonna del Rito o te luRitu, è una piccola chiesetta rurale situata sull''altura della Serra di Pozzomauro, presenta un modesto altare con l''affresco di una Madonna col Bambino fra gli angeli.\n\nPalazzo Ducale \n\nIl Palazzo Ducale di Presicce è attualmente sede del Museo della Civiltà Contadina; è stato adornato da giardini pensili e dotato di una cappella nel 1630 per volontà della Principessa Maria Cito Moles.\n\n\nCuriosità: Gli abitanti di Presicce sono soprannominati "Mascarani" in seguito all’uccisione del principe Carlo Bartilotti, venne sparato da un uomo mascherato mentre si affacciava da una finestra dell''antico Castello per salutare i festosi cittadini.', '', 'Presicce ist eine der schönsten Städte Italiens ... - Words of "Bell''Italia", der renommiertesten italienischen Zeitschrift Industrie, auch im Ausland bekannt - ... mit seinen Ölmühlen, die elegante Altstadt und geheime Gärten, ist eine der schönsten Dörfer des Salento.\n\nOrte zu gehen:\n\nBrecher ipogei\n\nDie Stadt Preston ist in Salento, die mit der höchsten Zahl von trappeti eine Höhle, aus der Ende 1600 gab es nicht weniger als 23 Ölmühlen.\nDer älteste, befindet sich in der Pozzomauro, um servivono reorganisieren die überlebenden Populationen überlebt die Invasionen der Sarazenen und dann das Potenzial für den Handel mit landwirtschaftlichen Erzeugnissen in einem bestimmten Öl realisiert anderen trappeti entlang der alten Route zwischen Lecce in Santa Maria von Leuca\n\nCathedral Church of Saint Andrew der Apostel\n\nDie Mutter Kirche steht an der gleichen Stelle der alten Kirche durch ein Erdbeben im Jahr 1743, zwischen 1776 und 1781 umgebaut und benannt nach dem Schutzpatron Saint Andrew der Apostel zerstört.\nHat eine große barocke Fassade und im Inneren finden wir neun Altäre vorne, rechts in der Mitte der Piazza Colonna Villani gebaut wurde die St. Andrew besteht aus einem hohen Stamm mit Kapital, auf das die Statue des Heiligen gelegt wird.\n\nKarmeliter Kirche und Kloster\n\nDie Karmeliter-Kirche wurde im Jahre 1605 eingeweiht und immer weckt ein besonderes Interesse bei den Besuchern.\nBemerkenswert ist der Altar in lokalen Steinsäulen mit reichen Schnitzereien und Statuen in der Mitte des Bildes of Our Lady of Mount Carmel geschnitzt. Das Kloster später auna Spende eines Bürgers Preston, Martin Alfarano, die Karmeliten von Lecce, im Jahre 1809 unterdrückt wurde erbaut, wurde im Anschluss an die Stadtverwaltung übergeben und beherbergt heute das Polizeipräsidium, die Stadtbibliothek und das mit Sitzplätzen sozio-kulturelle Aktivitäten.\n\nKirche Santa Maria degli Angeli und Kloster\n\nDer Bau der Kirche Santa Maria degli Angeli fand im Jahre 1596 wird die Tradition in beiden Ereignisse miteinander verknüpft: die Anwesenheit von einem Bild der Jungfrau, dass ein Bauer laden, um den Wiederaufbau des Gebäudes und die Heilung eines Blinden auszudrücken.\nIm Jahre 1603, mit der Gründung der reformierten Väter neu das Kloster, das später im Jahr 1866 abgeschafft wurde, in einem Zustand der Verwahrlosung fallen gebaut.\n\nOur Lady of Loreto Kirche und Krypta von San Mauro\n\nDie Kirche Unserer Lieben Frau von Loreto, besser bekannt unter dem Begriff Dialekt Our Lady of the Rite oder luRitu bekannt, ist eine kleine ländliche Kirche auf der Höhe der Serra Pozzomauro gelegen, hat einen bescheidenen Altar mit dem Gemälde der Madonna mit Kind die Engel.\n\nPalazzo Ducale\n\nDer Dogenpalast von Preston ist derzeit Heimat der Museum of Rural Life, wurde mit hängenden Gärten und eine Kapelle im Jahre 1630 nach dem Willen der Prinzessin Maria Moles Zitat geschmückt.\n\n\nTrivia: Die Leute von Preston sind Spitznamen "Mascarani" nach der Tötung von Prince Charles Bartilotti, wurde von einem maskierten Mann erschossen, als er durch ein Fenster des alten Schlosses, um die festliche Bürger begrüßen aussah.', '', 0, 0, 0, 0, 'Via Marche, 19, 73013 Galatina LE, Italia', 40.1729, 18.1641, 17, 'breakfast from 8.30 to 10.30;\n     Check-out 10.30;\n     Check-in from 14.00 to 18.00 (pleases the notice of the arrival alleged).', '\n    colazione dalle 8.30 alle 10.30;\n    check-out ore 10.30;\n    check-in dalle ore 14.00 alle ore 18.00 (è gradito il preavviso dell’orario di arrivo presunto).\n', '', 'Frühstück von 8,30 bis 10,30;\n     Check-out 10,30;\n     Check-in von 14,00 bis 18,00 (gefällt die Bekanntmachung der Ankunft behauptet).', '', 'brindisi 120 km', '', '', '500 mt', '100 mt', '5/6 km', '150 mt', '1', 0, 83),
(84, 1, 0, 'Agriturismo La Conca', 'Località Paradiso 16', '52037', 'Sansepolcro', 3677, 1168, 80, '+39360479201', '0575 733301', 'http://www.www.laconca.it', 'In Tuscany, Hill farm, 300 acres of parkland, 4 ancient stone farmhouses with swimming pool, organic farm.\nStays in rooms, apartments or for groups of friends, a ''whole house exclusively.\nHorse riding, horse riding, archery, ''arc, hiking in the park, refuge, house on'' tree location for the ''observations of fallow deer and mouflon sheep living in the park\nPanorama extremely large and absolute silence.\nFor lovers of nature, a timeless place that you will not forget', 'Agriturismo di collina, 300 ettari di parco, 4 anrichi casali in pietra con piscina, Bio fattoria.\nSoggiorni in camere, appartamenti o, per gruppi di amici, un'' intero casale in esclusiva.\nEquitazione, maneggio, tiro con l'' arco, trekking nel parco, il rifugio, la casa sull'' albero, postazione per l'' osservazioni di daini caprioli e mufloni che vivono nel parco\nPanorama ampissimo e silenzio assoluto.\nPer veri amanti della natura, un luogo senza tempo che non dimenticherete', '', '', '', 'All ''Agriturismo La Conca holiday is natural, we are in Tuscany and opportunities because the holiday is complete there.\nArt everywhere:\nSansepolcro with the Museum of Piero Della Francesca, The Museum of Aboca Herbs, The Museum of Stained Glass Antica, The Cattdrale who has made a thousand years and preserves important works, among which stands out the Holy Face\nThen Anghiari, Monterchi, Caprese Michelangelo, the mountain of La Verna, Camaldoli, Citerna, Cortona, Arezzo, Città di Castello, Perugia, Siena, Florence, San Marino.\nIn addition, quality shopping.\nA Città di Castello  spa Fontecchio', 'All'' Agriturismo La Conca la vacanza è naturalistica, siamo comunque in Toscana e le occasioni perchè la vacanza sia completa non mancano.\nArte dovunque:\nSansepolcro con il Museo di Piero Della Francesca, Il Museo di Aboca Erbe, Il museo della Vetrata Antica, La Cattdrale che ha compiuto mille anni e conserva opere importanti fra le quali spicca Il Volto Santo\nPoi Anghiari,, Monterchi, Caprese Michelangelo, il Monte della Verna, Camaldoli, Citerna, Cortona, Arezzo, Città di Castello, Perugia, Siena, Firenze, San Marino.\nInoltre lo shopping di qualità.\nA Città di Castello le Antiche terme di Fontecchio', '', '', '', 0, 0, 0, 0, 'E78, 06016 San Giustino PG, Italia', 43.5586, 12.2531, 9, 'You can pay with all major credit cards', 'E'' possibile pagare con tutte le carte di credito', '', '', '', 'Perugia 70 km', '', '', 'Sansepolcro', 'Sansepolcro', 'Rimini km 90', '3 km', '1', 0, 84),
(85, 5, 0, 'agriturismo corte addis abeba', 'via Borgo Tirolo, 1/a', '46049', 'Volta Mantovana ', 3630, 1165, 80, '037683558', '037683558', 'http://www.corteadisabeba@virgilio.it', '', 'Situato ai piedi delle colline Moreniche offre appartamenti indipendenti per 6/10 persone, arredati con gusto e dotati di ogni comodità.\nDispone di un ampio giardino con alberi da frutto e animali da cortile e anatre, all''insegna del relax e della tranquillità. \nE'' possibile degustare un misto di carne allo spiedo, stracotti, brasati e carni miste alla griglia, con carne di manzo e di pollo allevato direttamente in azienda con ricco buffet di verdure. Sono inoltre serviti primi piatti tipici della zona con pasta fresca tra cui capunsei (è stato vinto il primo premio del concorso capunsel d''oro nell''anno 2010), tortelli di zucca, caramelline, agnoli in brodo e bigoli al torchio. ', '', '', '', '', 'E'' possibile fare escursioni in bicicletta lungo il fiume Mincio.\nPossibilità di visitare città storiche limitrofe tra cui Mantova e Verona. Siamo vicini al lago di Garda e a diversi parchi acquatici e parchi natura.', '', '', '', 0, 0, 0, 0, 'Via Borgo Tirolo, 1D, 46049 Cereta MN, Italia', 45.2976, 10.6538, 17, '', '', '', '', '', 'Catullo di Verona', 'Orio al Serio di Bergamo', 'Malpensa ', 'Peschiera del Garda ', 'Cereta di Volta Mantovana ', 'Lidi Ferraresi o lago di garda ', 'il nostro direttamente in corte', '1', 0, 85),
(86, 5, 0, 'Agriturismo Molleone', 'Strada Molleone 15', '61043', 'Cagli ', 3640, 1162, 80, '+39337621828', '', 'http://www.www.molleone.com', '', 'Un armonioso connubio tra antico e moderno e soluzioni architettoniche insolite, fanno di questo di casale con torre colombaia del 1474, un luogo speciale per le vostre vacanze nelle Marche. Antico casale del Quattrocento situato nelle affascinanti colline della campagna cagliese, tra Urbino e Gubbio. Finito di restaurare nel 2008 con particolare attenzione per i dettagli e soluzioni di design. Al suo interno gli ospiti troveranno cinque camere da letto tutte con salottino e frigo bar, un ampio salone, una modernissima cucina e uno studio che si affaccia sul portico dove c''è il vecchio forno a legna. All''esterno del casale tante piante di lavanda, rosmarino ed erbe aromatiche, il boschetto di querce e ginepri con il romantico pozzo e la piscina dalla quale poter ammirare il potente Castello dei Della Porta di Frontone, incastonato nel verde del monte Catria. Fonteavellana, monastero del Mille è a due passi: la pace dei monaci si sente da qui. \n\nComposto da tre appartamenti monolocali e un bilocale, tutti dotati di angolo cottura, bagno privato con doccia, giardino e entrata indipendente. \n\n', '', '', '', '', 'Le città di Cagli, Urbino, Fano e Gubbio.\n', '', '', '', 0, 0, 0, 0, 'Via Cornillo, 6, 06040 Meggiano PG, Italia', 42.8333, 12.8333, 7, '', 'Come prenotare: \nPotete contattarci all''indirizzo agrimolleone@libero.it oppure ai numeri 0721.1830478 o 337.621828. La prenotazione verrà confermata solo dopo aver ricevuto la copia del pagamento della caparra (30% sul totale). La conferma della Vostra prenotazione avverrà tramite e-mail.\n\nCosti aggiuntivi: \nPulizia finali appartamenti(solo per prenotazioni settimanali) € 40,00;\nPulizie finali casale € 100,00.\n\nCosti facoltativi:\nLavatrice € 10,00;\nPulizie giornaliere € 15,00 all''ora;\nBaby sitter € 15,00 all''ora;\nCorsi di cucina con degustazione finale, prezzi da definire;\nCorsi e degustazioni guidate di vini e oli, prezzi da definire;\nAltri corsi a richiesta, prezzi da definire. \n', '', '', '', 'Perugia, 66 km', 'Ancona - Falconara, 91 kma', 'Bologna, 213 km', 'Fano, 50 km', 'Cagli, 8 km', 'Fano, 50 km', 'Le Fontane, 2 km', '1', 0, 86);
