(87, 1, 4, 'Hotel Antica Masseria', 'ss 172 Turi Putignano', '70014', 'Conversano', 3653, 1174, 80, '+390804913499', '', 'http://www.www.antica-masseria.it', 'Immersed in the tranquility of the wonderful natural environment of the murgese countryside surrounded by hundreds of years old olives trees, is the new resort Antica Masseria.\nThe resort offers to its guests the possibility to spend a regenerating vacation with nature and complete relaxation. Surrounding the enchanting central garden characterized by ancient olives tree and beautiful bushes of pomegranates and oleander, are 18 suites side by sides, 6 mono family, 6 mono family with an additional 3rd bed and 6 bi family composed by 2 communicating double rooms and little living room. In total we have 54 beds.\nEach room has the possibility to add another bed. Every suite has the  independent entrance and a private outdoor space characterized by wrought iron table and chair which allows to appreciate and enjoy the tranquility that makes this Hotel unique.\nThe suites are furnished with taste and every comfort : independent air conditioning, frigobar, combination safety box, sky and pay per view tv color, internet and lan, telephone, large private bathroom with hydromassage shower, hair dryer, make up mirror.\nThree of the suites are made for the disables with bathrooms, hydromassage shower. Also there is a reserved private parking completely free connected to the suites. The Hotel has a 24 hours reception hall with wi fi connection and little living room with pay per view and sky tv color, it is equipped with a bar, a spacious room breakfast and an elegant outdoor space furnished with umbrellas, wrought iron tables and chairs where you can relax and socialized. In a structure like this it’s impossible to exclude your four legged friends, in fact if they are small size, they are welcome in every areas of the Hotel.\nThe nearly completed 300 yards elliptic swimming pool with beach effect surrounded by sand, the pool entrance is an a decline, swimming against the waves and angle hydromassage immersed in nature completed with elegance surrounded by solarium enjoying to our guests very relating moments.\nAt guest’s complete disposition there is a rich international breakfast buffet composed by typical cheeses and cuts, delicious cakes made from our baker, just cut of the oven croissant, eggs, hot bread and fresh seasoned fruit.\nThe courtesy and discretion of the reception, attention to the smallest request, the feeling of being in a family where nothing is left out.\nFor everyone want to advantage of restaurant services, is available the regional and nation kitchen in the “Granaio” room. Guests have the possibility to dine in an adjoining restaurant Antica Masseria a 20 year experience team will have you taste the Apulian dishes. This dishes are prepared in a modern way without losing they’re flavor or smells and colors.\nThe “Granaio” serves genuine home-made meals prepared from our farmland and the surrounding territory. \n', 'Immerso nella tranquillità del meraviglioso contesto naturalistico della campagna murgese, circondato da ulivi secolari, sorge la nuova struttura alberghiera Hotel Relais Antica Masseria****.\n\nIl Relais offre ai suoi ospiti la possibilità di trascorrere una vacanza all’insegna della natura e del relax. Un incantevole giardino centrale di ulivi secolari e cespugli di melograno e di oleandro fanno da cornice alle 18 suite.\nOgni suite si caratterizza per un ingresso indipendente e uno spazio esterno per godere della tranquillità del contesto naturalistico che rende unico il Relais. Le accoglienti suite, arredate con gusto, sono dotate di tutti i comfort: climatizzazione singola, frigobar, cassaforte a combinazione, TV color con programmazione Sky e Pay-TV, internet con accesso LAN, telefono, un ampio e confortevole bagno dotato di cabina doccia idromassaggio, asciugacapelli e specchio trucco. Tre delle suite sono completamente realizzate per disabili ed attrezzate con relativi bagni e cabina doccia idromassaggio. Inoltre è presente un parcheggio riservato e completamente gratuito annesso alle suite.\n\nL’Hotel dispone di un’accogliente hall aperta H24 con connessione Wi-Fi ed angolo living-sala TV con programmazione Sky e Pay-TV alla quale sono annessi un fornito bar, una spaziosa sala colazione ed una elegante terrazza esterna arredata con ombrelloni, tavolini e sedie in ferro battuto, di cui gli ospiti potranno disporre per ritagliarsi momenti di relax e convivialità. \n\nUna ricca colazione a buffet in stile internazionale, deliziose torte realizzate dal pasticcere, croissant appena sfornati, pane caldo, frutta fresca di stagione e una selezione di prodotti tipici della terra renderanno ancor più dolce il soggiorno. \nInoltre, per tutti coloro che volessero usufruire del servizio ristorazione, è a disposizione l’attiguo ristorante Antica Masseria – Il Granaio che condurrà per mano gli ospiti alla scoperta dei sapori e degli odori delle primizie del territorio. Un servizio disponibile e attento per soddisfare le esigenze dei propri clienti. \n\nFiore all’occhiello della struttura la piscina e il solarium circostante per regalare momenti unici di benessere per il proprio corpo e la propria mente. \nImmersa nel verde della masseria pugliese, è stata progettata secondo l’effetto spiaggia con forma ellittica e dimensioni di 350 m2. Un angolo per vivere e godere della tranquillità della campagna. \nLa location strategica, a metà strada fra le più importanti e suggestive mete della Puglia, lo rendono ideale per immergersi nel territorio della Murgia e della Valle d’Itria.  \nL’Hotel Relais Antica Masseria****  è la scelta per rendere ogni occasione unica ed indimenticabile. \n', '', '', '', 'The Land and its points of interest\nThe Relais is situated in a prime location for visiting centers of art and culture such as Alberobello, famous for its trulli, which are UNESCO World Heritage Site since 1996; Locorotondo, Martina Franca, Cisternino and the ''white city'' Ostuni that give a breathtaking view of the historic city and valley Itria. Putignano but especially Castellana Grotte offer a guided tour through chasms and caves by the mythological or fantastic names. For lovers of the sea, there are Monopoli and Polignano a Mare,  the magnificent nature reserve of Torre Guaceto and the lush vegetation of the Murgia and Selva di Fasano. Closely there is Matera, famous for its ancient districts,  called Sassi\n', 'Il Territorio e i suoi punti d’interesse\nIl Relais si colloca in una posizione privilegiata per visitare centri d’arte e cultura quali Alberobello, famosa per i suoi caratteristici trulli, che dal 1996 sono patrimonio dell’umanità dell’UNESCO; Locorotondo, Martina Franca, Cisternino e la ‘città bianca’ Ostuni che regalano uno scorcio urbano storico incantevole e una veduta dell’intera Valle d’Itria da togliere il fiato. Putignano ma soprattutto Castellana Grotte che offre un itinerario guidato attraverso voragini e caverne dai nomi mitologici o fantastici. Per gli amanti del mare le azzurre acque di Monopoli e Polignano a Mare; ma anche la magnifica riserva naturale di Torre Guaceto, nonché la splendida vegetazione della Murgia e della Selva di Fasano. Nelle immediate vicinanze è situata Matera, rinomata per gli antichi rioni, comunemente chiamati Sassi .\n', '', '', '', 0, 0, 0, 0, 'Strada Statale 172, 70017 Putignano BA, Italia', 40.8819, 17.0777, 13, '', 'Anticipo per la prenotazione del 30% del totale e saldo a fine soggiorno', '', '', '', 'Bari Palese, 50 km', 'Brindisi, 70 km', '', 'Putignano, 5 km', '', 'Monopoli, 20 km', 'Dimora Mazzaro, 20 mt', '1', 0, 87),
(88, 7, 0, 'Borgo Rossi', 'Via Sabbionare 2', '38010', 'Cunevo', 3689, 1166, 80, '+390461652327', '+3904611632023', 'http://www.borgorossi.com', 'Elegant independent house, on two levels, first floor large living room with sofas, 40" Digital TV, 2 dining tables, large modern kitchen fully equipped, large bathroom with shower, wooden stairway takes you  to the second floor, there are 3 double bedrooms, one with an additional single bed, large bathroom with shower and tub. Terrace with mountain view.', 'Elegante e confortevole appartamento a Cunevo per le vostre vacanze in montagna.\nDisposto su due livelli, primo livello ampio soggiorno, salotto con TV al plasma 40" e cucina moderna dotata di ogni accessorio, ampio bagno finestrato con doccia spa, secondo livello 3 camere matrimoniali con 6 posti letto più 1 aggiuntivo, ampio bagno finestrato con doccia spa e vasca. Luce, gas, acqua, riscaldamento, biancheria da letto e bagno compreso.\nVisita il ns. sito e prova il tour virtuale della casa. www.borgorossi.com', '', '', '', 'The house is located in Cunevo,  a quiet and  small village in Valle di Non, surrounded by the endless fields of the famous Melinda apple trees, the Dolomiti of Brenta mountains, and the Adamello of Brenta  Natural Park. Our Valley is rich of touristic, cultural and sport attractions.\n(Lakes, canyons, castles, museum, village feasts with traditional local food, trekking, mountain bike)', 'Cunevo è un piccolo paese delle Valle di Non, situato nel Parco Naturale Adamello del Brenta, circondato dalle dolomiti del Brenta, dai monti Anauni, e da interminabili campi di mele "Melinda". al centro di numerose attrattive turistiche, culturali, sportive e gastronomiche. (escursioni in montagna a piedi o con mountain bike, canyon, castelli, musei, santuari, chiesette,eremi, laghi, feste paesane con piatti tipici)', '', '', '', 0, 0, 0, 0, 'Via Sabbionare, 10-12, 38010 Cunevo TN, Italia', 46.2859, 11.0342, 15, 'Electricity, gas, water, bed and bath linen, courtesy set, final cleaning are included.\nPayment at your arrival with credit card/bancomat, cash.', 'Compreso nel prezzo elettrico, gas, acqua, biancheria  da letto e bagno, set di cortesia, pulizia finale.\nPagamento alla consegna delle chiavi con carta di credito/bancomat, contanti.', '', '', '', 'Verona 110 km.', 'Venezia', '', 'Trento 35 km.', '100 mt.', '', '20 mt.', '1', 0, 88),
(89, 5, 0, 'Agriturismo IL BOSCONE', 'Strada di Poppiano 35', '50021', 'Barberino Val d''Elsa', 3679, 1168, 80, '+390558078009', '', 'http://www.ilboscone.com', '', 'Agriturismo nel chianti, inserito in uno spettacolare scenario naturale. Vicino alle città d''arte più belle e visitate della toscana come Firenze, Siena e San Gimignano.\nCon appartamenti da 2 a 8 posti letto e camere, offre agli la possibilità di trascorrere vacanze fantastiche, divertenti e riposanti. Non vi occorre altro, in agriturismo trovate tutto:\npiscina,ristorante,maneggio,parco giochi per bambini,parco avventura per i grandi,lago per la pesca,tiro con l''arco e tane serate a tema e gare e tornei che l''agriturismo organizza ogni settimana.\nIdeale per famiglie con bambini,comitive,giovani e anziani.\nLa calda atmosfera familiare vi conquisterà.', '', '', '', '', 'Pur essendo isolato e tranquillo , l''agriturismo si trova a 5 km. dalla superstrada Firenze-Siena ed in pochi minuti si raggiungono tutte le città più impotanti. Non solo, nei dintorni ci sono molti centri e paesi medievali che difendono le antiche tradizioni, da visitare e scoprire, con sagre e feste paesane tradizionali che si svolgono in tutto l''anno.\na Certaldo,Monteriggioni,Volterra,Barberino Val d''Elsa,Poggibonsi e tanti altri.', '', '', '', 0, 0, 0, 0, 'Strada di Poppiano, 25, 50021 Barberino Val D''elsa FI, Italia', 43.5041, 11.1262, 17, '', '30% alla conferma della prenotazione con bonifico bancario\nsaldo all''arrivo.\n- La caparra viene restituita solo per cancellazioni  entro 30 gg. dalla prenotazione\n- per qualsiasi altro tipo di cancellazione non viene restituita la caparra.', '', '', '', 'Firenze a 35km', 'Pisa  a 95 km', 'Bologna a 110 km.', 'Poggibonsi a 5 km.', 'Poggibonsi a 5 km.', 'Cecina a 85 km.', 'in azienda ', '1', 0, 89),
(90, 5, 4, 'Locanda Antiche Macine', 'Via Sogliano, 1540', '47822', 'Santarcangelo di Romagna', 3610, 1173, 80, '+390541627161', '+390541686562', 'http://www.www.antichemacine.it', '', 'Facile da raggiungere e strategicamente situata a pochi chilometri dagli eventi legati alla Riviera Romagnola a sufficiente distanza per godere di profumi dimenticati e silenzioso raccoglimento, la Locanda Antiche Macine è una dolce e raffinata oasi di esclusivo relax. Dotata di confortevoli suites, arredate con gusto e classe, la Locanda Antiche Macine abbina l''offerta di un rilassante soggiorno nell''eleganza e nella natura a una cucina dalle radici tipiche, antiche e solide della Romagna. Una autentica cultura gastronomica per una qualità da chateau-relais a costi di locanda.', '', '', '', '', 'All''agriturismo Montalbano potrete trovare molteplici opportunità di svago a tu per tu con la natura, l''ecologia e la tradizione. \nOltre all''ospitalità del nostro stupendo casale, potrete dilettarvi in numerose opportunità offerte per rendere indimenticabile la vostra vacanza. \nInoltre nella locanda "Antiche Macine" vi verranno offerti gustosi piatti preparati secondo le tradizioni dell'' antica cucina tipica romagnola. \nA pochi chilometri dalla Riviera Romagnola, un vero e proprio paradiso; 10 camere e oltre duecento ettari da sogno vi aspettano per farvi immergere nella magica atmosfera che li avvolge. \nPrati, boschi e dolci colline a 360 gradi soltanto per voi.', '', '', '', 0, 0, 0, 0, 'Via Sogliano, 1540, 47822 Montalbano RN, Italia', 44.0543, 12.3752, 17, '', '', '', '', '', 'Rimini-Fellini Airport, 30KM', 'Forlì Airport, 45KM', 'Bologna Airport, 110KM', 'Savignano sul Rubicone, 4 KM', 'Savignano sul Rubicone, 4 KM', 'Bellaria Igea Marina', 'Santarcangelo di R, Locanda Antiche Macine', '1', 0, 90),
