(93, 5, 0, 'Agriturismo biologico Vigliano', 'Località solatio di sotto', '53018', 'San Rocco a Pilli', 3687, 1168, 80, '+390577347982', '', 'http://www.info@guasconidivillamena.it', 'The organic estate Vigliano is your organic farm in Siena, in the heart of Sienese hills, close to S. Rocco a Pilli village, Sovicille, just 8 km far from Siena. Two houses, villas: Podere Cartaio, and Poggio al Sole located on two hills, surrounding with vineyards, cereals and legumes fields, from which one has a fine Siena view.Podere Cartaio, in Agriturismo Vigliano, is a farm-house/Villa, 280 sqm, two-storied. Farm-house/Villa  for 2-4-6 or 8 pax . Podere Cartaio, in Agriturismo Vigliano, is a farm-house/Villa, 280 sqm, two-storied.Farm-house/Villa  for 2-4-6 or 8 pax  In July/August only weekly stay group of 8 persons The whole villa  In other period min. stay 2-3 days   2-4-6 or 8 persons Federica and Guglielmo Guasconi will welcome you upon your arrival. On the ground floor: one twin bedroom, one shower bathroom and  large kitchen. On the first floor, one double-room, shower bathroom and two twin bedrooms with its shower bathrooms and 2 other kitchens.Ground floor: large living-dining room with TVSAT, fireplace; living room with access to the covered veranda and to the garden. Laundry- ironingroom with dishwasher and washing machine.\nFirst floor: one sitting-room with fireplace and TV.Outside: covered veranda with tables, sofas, barbecue, wood-burning oven, table-tennisGarden with lighted pool (6x12)Shady roof , deck-chairs and sunloungers.\nAmenities: Pool, internet connection, organic produce for sale credit cards accepted, independent heating, car park organic breakfast and dinner on demand in middle seasonPets welcome    \nPoggio al Sole is a farm-house/Villa, 300 sqm, two-storied in Agriturismo Vigliano. Independent portion of the owner house, with large garden provided with lighted pool (7x14), open from the first week-end of May to the last w-e of September and a green pine-wood. Maria Luisa Guasconi lives also in Poggio al Sole and she is an helpful but descreet presence during your stay.Deck-chairs, sun loungers and shady roof are available during the stay.Accomodation for 6-8 pax+1 babyweekly stay in July/AugustMinimun stay 2/3 nights in low/middles season.Ground floorA roomy living-dining room with TV SAT.  A kitchen, with access to the covered veranda, equipped with dishwasher, oven and micro-wave. A laundry-ironing room with washing machine.The covered veranda, adjoining to the kitchen, with large table, chairs, barbecue and tennis table.First floor Four twin bedrooms, two shower bathrooms and one tub bathroom. \nAmenities:\nPool, independent heating, internet connection,organic produce for sale, credit cards accepted, car park\nPets not welcome      just stay selfcatering\n', 'Agriturismo Biologico Vigliano: il vs. agriturismo nelle colline senesi\nA soli 8 km da Siena, al centro dell''azienda biologica dei marchesi Guasconi di Villamena, nelle verdi colline senesi. L''agriturismo, a conduzione familiare, dispone di 2 casali, dimore tipiche toscane, con 2 piscine indipendenti private, ampi spazi verdi, zone solarium, verande coperte, spazi interni-esterni attrezzati. (Barbecue, TV SAT, ping pong, lettini prendisole, forno a legna). (tot 16 pax adulti+3 baby).\nIl casale-dimora tipica Podere Cartaio è diviso in 3 appartamenti indipendenti per 2-4-6 o 8 persone con 4 camere , 4 bagni, 3 cucine attrezzate, ampi saloni e ,all''esterno, grande giardino con piscina e verande coperte; può anche essere affittato da un unico gruppo di 8 persone. Il casale-villa Poggio al Sole dispone di 4 camere, 3 bagni e di una grande sala da pranzo ed ampi saloni al piano terra. Giardino con grande piscina e pineta.\nBioagriturismo Vigliano. Produzione e vendita prodotti aziendali bio. Pasti con la prevalenza dei ns. prodotti. BIOAGRICOLAZIONI SU RICHIESTA A PODERE CARTAIO E BIOAGRIMENU, MENU A KM 0.  Nel casale Poggio al Sole solo soggiorno self catering con uso esclusivo della bella piscinapanoramicaConvenzioni con centri benessere, a soli 10 min e con maneggi, lago pesca sportiva e outlet della Toscana. Agriturismo aperto tutto l''anno. Servizio prima colazione e degustazione prodotti tipici su richiesta. Servizi L''agriturismo Vigliano si trova all''interno dell''azienda biologica di 110 ettari L''azienda produce e vende: pasta da lavorazione artigianale e da farine macinate a pietra,  confetture extra di frutta bio, legumi, conserve, salse di pomodoro, cereali perlati: farro, orzo, orzo macinato, tostato a legna olio e.v. oliva bio Servizio prima colazione e mezza pensione su richiesta, escursioni a cavallo, guidate, escursioni trekking in azienda .Agriturismo vigliano è aperto tutto l''annoSi accettano carte di credito e gli animali, sono i benvenuti a Podere Cartaio.Biancheria camera/bagno/cucina fornita\n', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Castruccio, 67, 53018 Sovicille SI, Italia', 43.2515, 11.2912, 17, '', 'Acconto 30% a conferma prenotazione\nsaldo all''arrivo in agriturismo ', '', '', '', 'firenze peretola 70 km', 'bologna 120 km', '', 'siena 10 km', '1km', 'grosseto 40km', '1,5km', '1', 0, 93),
(94, 1, 0, 'B&B Masseria dei 12 granai', 'Strada comunale di Pozzelle', '73027', 'Minervino di Lecce', 3657, 1174, 80, '+393357814857', '', 'http://www.12granai.it', '', 'Nel cuore del Salento, sotto Otranto, nella pace della campagna, a pochi munuti dal mare, antica masseria del ''700, completamente ristrutturata. In posizione ideale per visitare le bellezze del Salento ', '', '', '', '', 'Terme S. Cesarea, Galatina, Castro, Dolmen, Frantoio ipogeo, Otranto, Giardini botanici, gite in barca, gastronomia, vino', '', '', '', 0, 0, 0, 0, 'Via Giovanni Verga, 35, 73027 Minervino di Lecce LE, Italia', 40.083, 18.4277, 8, '', 'Acconto 30% alla prenotazione, soggiorno minimo 3 notti', '', '', '', 'Brindisi 70 km', 'Bari 180 km', '', 'Maglie, Lecce, 10 km', '', 'Otranto, Alimini, ', 'Il basco, 500 mt', '1', 0, 94),
(95, 5, 0, 'il borgo sul lago', 'loc.gigliolo,snc,lago angitola', '89843', 'maierato', 3595, 1158, 80, '00390963253663', '0963253663', 'http://www.www.ilborgosullago.it', '', 'L''Agriturismo "Il Borgo sul Lago" immerso nelle verdi colline, vi offre un''oasi di pace in un luogo in cui la bellezza della natura è intatta, a 30 mt. dal lago Angitola riserva naturale del WWF.\n\nAdagiata tra il mare e le colline della campagna calabrese, permette di raggiungere in poco tempo le principali località di vacanza sulla costa, come Pizzo (gioiosa cittadina arroccata sul mare), il Porto di Vibo Marina con il suo noleggio d’imbarcazioni e gommoni e la bellissima località di Capo Vaticano, per continuare con la famosa Tropea (cittadina rinomata per la produzione delle cipolle rosse ), Serra S. Bruno e la grande Certosa Bruniana dove i monaci francescani vivono in clausura dedicandosi alla produzione artigianale di prodotti alimentari. La spiaggia privata sul litorale adiacente alle Isole Eolie è a disposizione con supplemento per i clienti e con servizio di navetta. In prossimità, campi da tennis.\nL''incredibile fascino dei colori degli uliveti e agrumeti fanno da cornice al relax della vacanza, e potrete non solo godere della bellezza del paesaggio e della quiete della campagna, da noi potrete anche riscoprire il piacere dell''antica cucina calabrese.', '', '', '', '', 'La Tenuta si presenta suddivisa in tre resorts :4 appartamenti di nuova costruzione accoglienti e dotati di aria condizionata, bagno con doccia, 8 camere doppie in pianura e poco distante dal corpo centrale della Tenuta, 5 bungalows in collina più esclusivi ed appartati.\n\nIl ristorante che propone un menu alla carta, ha spazio all''aperto con ampio giardino, pergole e gazebi.\n\nE'' possibile organizzare cene a lume di candela, meeting di lavoro, ricevimenti per cerimonie di laurea, battesimi, cresime e matrimoni.\n\n', '', '', '', 0, 0, 0, 0, 'Strada Statale 110, 89843 Pizzo VV, Italia', 38.7394, 16.236, 17, '', '', '', '', '', 'lamezia terme 20 km', '', '', 'vibo valentia-pizzo 10 km', '', '5 km', '', '1', 0, 95),
(96, 4, 4, 'N4U Guest House Florence', 'Via del Proconsolo, 5', '50122', 'Firenze', 3679, 1168, 80, '+390550515147', '+390550515147', 'http://www.www.n4uguesthouse.it', 'N4U Guesthouse, is Not an Hotel, is a Charming Bed and Breakfast located in Historical Center of Florence in a XIV Century Palace, II floor, between Dome and Uffizi Gallery. All the Rooms have external views by the Historical Center by Via del Proconsolo. \n\nFree WiFi, Free Coffee and Tea Set Facility, Free Minibar with Mineral Water, Breakfast Served in Your Room, Service Free.\n\n', 'N4U Guest House Non è un Hotel è un Bed and Breakfast di Charme situato in pieno Centro Storico a  Firenze in un Palazzo del XIV Secolo  tra il Duomo e la Galleria degli Uffizi. Tutte le camere hanno grandi finestre e affaccio esterno sulla centralissima Via del Proconsolo. \n\nFree Wi Fi,  Free  Set per la preparazione di  Caffè, Tè e Tisane ,  Free Minibar con Acqua Minerale,  Colazione servita in Camera con Servizio Free. \n', '', '', '', 'Florence is famous all over the world for its unique beauties. To visit the principal beauties in Florence you need at least 3 days.\n\nFor many years Florence has been the cradle of culture and art. Many of the most famous artists of the Renaissance were born there and thanks to them thousands of tourists choose Florence for their holidays.\nFlorence signifies abundance or wealth; during the middle-age, thanks to the Medici family, become an important economic, cultural and artistic city.\nThe artistic patrimony of Florence is among the most important of the world.\nN4U Guest House, Charming Bed and Breakfast is in Via del Proconsolo 5, is just few steps away from all the Most important Museums and Architectural Signs in Florence.\n\nFamous Museums such as,  Uffizi Gallery, Palazzo Pitti , Museum of the Bargello, Archaeological Museum, Museum of Modern Art, Museum of Opera del Duomo.\nGreat libraries (Laurenziana Library, Riccardiana Library, Marucelliana Library, Central National Library).The famous Academies (Academy of the Bran, Academy of Cimento, Colombaria Academy).\nLarge Parks and Gardens (Park of the Cascine, Garden of Boboli, Garden of the Iris).\n\nThe monuments in Florence constitute an artistic complex among the most important of the world: the Baptistry (with the gold doors by the Ghiberti and Andrea Pisano), the Fortezza da Basso, the Giotto Bell Tower, the Innocenti Hospital and the famous Piazza della Signoria.\n\nImportant churches like the Dome (or Santa Maria del Fiore) with the immense cupola by the Brunelleschi and the bell tower by Giotto, The Pietà by Michelangelo, the Santa Croce church, in which we found the resting place of Machiavelli, Michelangelo, Galileo Galilei, Alfieri, Foscolo and Rossini, the San Lorenzo church, the Santa Maria Novella church and the wonderful Santa Maria degli Angeli.\n\nFlorence is rich of great work and wonderful palaces like the Palazzo Vecchio, the loggia by Orcagna, the Spedale degli Innocenti of Brunelleschi, the PalazziMedici, the Pitti Palace and the Uffizi (by the Vasari with the famous Uffizi Gallery), the Ponte Vecchio with the double row of small old shops, from the 1500 exclusive rights of the Orafi.', 'Chi decidesse di visitare Firenze soggiornando in un Bed and Breakfast nel Centro Storico di Firenze come N4U Guest House e non vuole perdere i principali monumenti e le testimonianze di un passato glorioso che la vedeva regina nel panorama culturale europeo e potenza economica culturale ed artistica, ha bisogno almeno di tre giorni.\n\nVisitando il Centro di Firenze o i quartieri più antichi ci si rende conto di quanto il fascino di Firenze colpisca chiunque la visiti  facendone una delle città più belle del mondo intero: Palazzi aristocratici come  Palazzo Vecchio in Piazza della Signoria , logge, fontane, il meraviglioso Ponte Vecchio , risalente al quattordicesimo secolo, la Galleria degli Uffizi confermano il  primato economico, politico, artistico e culturale della città in tutta Europa tra il quattordicesimo e il diciassettesimo secolo. In Via degli Alfani, all’angolo con piazza  Brunelleschi a 100 metri da N4U Guest House Florence è possibile visitare la Splendida Santa Maria degli Angeli.\n\nLa scoperta  di Firenze  può cominciare dalla Basilica di Santa Maria Novella, a pochi passi dal Nostro Bed and Breakfast - N4U Guest House Florence , edificata a partire dal 1246. La splendida facciata a tarsie marmoree policrome fu completata dall’architetto fiorentino Leon Battista Alberti tra il 1456 e il 1470. All’interno sono custoditi grandi capolavori  tra cui la Trinità dipinta da Masaccio. Immancabile una Visita a Palazzo Pitti, dove vissero i Medici sino alla fine della dinastia.\n\nA poca distanza da Santa Maria Novella, percorrendo Via del Giglio e facilmente raggiungibile da N4U Guest House Florence si giunge alla chiesa più antica della città, la Basilica di San Lorenzo, rifatta nell’XI secolo e rimaneggiata fortemente per volere della famiglia Medici che la scelsero come chiesa di famiglia. L’interno, realizzato su progetto di Brunelleschi, è un vero e proprio capolavoro del primo rinascimento fiorentino.', '', '', '', 0, 0, 0, 0, 'Via del Corso, 1, 50122 Firenze, Italia', 43.7715, 11.2579, 17, 'Terms and Condition 	\n\nPayments:\nCredit Card information is required in order to guarantee your reservation. Your credit card will be not charged until your arrival or departure or if the cancellation deadline has passed.\nPayment will be settled during the stay at N4U Guest House  in cash or by Credit Card , Visa , Mastercard, JBC. In any case, We could always request a prior authorization for the full amount of the booking  made also to assess the current availability of the credit card used. Special offers are not refundable rate and the amount will charge by credit card on booking. From 1st of July the City of Florence will introduce the Tourism Tax for 2,00 per overnight staying and it is Not included in any Rate.\n\nCancellation Policy and No show:\nIn case of cancellation made with more than 7 days before arrival: no penalty.\nIn case of cancellation made with less than 7 days before arrival or no show: penalty of total amount. Some dates may have an cancellation policy with more than 25 days.\nSome specials offers have a Not Refundable cancellation policy also in case of No show or date''s change and the amount charge on booking.\nIn any case, without any exception, if You decide , during your stay ,  for   earlier departure  we will be forced to pay down all the  amount of reservation.\n\nLocation:\nN4U Guest House is not an Hotel\nN4U Guest House is a beautiful House on the II° floor in  a XIV Century  Palace and  such as many buildings in the Historic Center does not have the lift.\n\nRooms:\nIf you choose to stay in a particular room, N4U will do everything possible to assigned it to you. However, for logistical purposes, this may not be possible. In this case, N4U has the right to assign a different room of the same standard (Double , Triple, Quadruple) without notice also during your stay.\nSome rooms have en-suite bathroom, others  off suite, in this case we offer bathrobes and slippers for your comfort.\n\nServices:\n\nBreakfast\nYour Breakfast  will be served in your room, no extra service cost at 8.30 a.m. and in any case within 8.00 a.m. to 9.00 a.m.\n\nKeys\nGuests are given the keys to the entrance door of the Guesthouse and to their room. These keys must be returned at the time of checkout. We will charge you for any keys which are not returned.\n\nHouse Keeping:\nRooms will be cleaned and tidied every morning at 8am and at 10am if they are made available. Otherwise, they will be cleaned on the following day.\n\nBathrooms\nEach bathroom is equipped with soap for your hands and face and shampoo & bubble bath.\nBed linen, towels and bath mats will be supplied at the time of your arrival.\nEach guest will promptly receive a change of sheets and towels.\nDuring your stay, sheets and towels will be changed every four days. You can request to have all the household linen changed at an additional cost of 5 euros.\n\nParking\n3 Car parking are available for a fee, at 50 meters from the N4U Guesthouse.All the details are at section" Where We Are "\n\nCheck in\nN4U guest House is not a hotel, every person is given a personal welcome.\nCheck-in is available from 2.00 pm to 6.00 pm. However, you can check-in outside these hours from  6.00 p.m. untill 9.00 p.m. with an add cost of 30,00 euro, from 9.00 p.m. untill 11.00 p.m. with an add cost of 60,00 euro and later than 11.00 p.m. with an add cost of 95,00 euro if you inform us in advance of your arrival time by email at info@n4uguesthouse.com\n\nCheck out\nCheck out is until 10.00 a.m. According to room''s availability  you can make a Late Check-Out , no later than 17.00 pm , for an additional fee of 49.00 euros.\n\nPrivacy statement\nN4U guesthouse is very serious about the confidentially and privacy of your personal details.\nThe personal information provided will only be used for processing the booking and for arranging your stay at N4U guesthouse.\nYou expressly authorise N4U guesthouse to process your data by booking or requesting information.\nThe lobby and some common areas of the N4U guesthouse may be under video-surveillance for your and our safety. It will only be used exclusively for this purpose.\n', 'Termini e Condizioni di Soggiorno\n\nMetodi di Pagamento:\nN4U Guest House non effettua alcun addebito sulla tua carta di credito per le tue prenotazioni. Ti verrà richiesto di inserire i dati di carta di credito che ci saranno inviati solo a garanzia della prenotazione. Il conto dovrà essere saldato direttamente al vostro arrivo, in contanti o con carta di credito Visa , Mastercard o JBC. In ogni caso  sarà sempre possibile chiedere una autorizzazione preventiva per  l'' intero importo della prenotazione effettuata anche al fine di valutare la effettiva disponibilità della Carta di Credito utilizzata.  Le offerte speciali sono soggette ad una tariffa non rimborsabile con addebito della carta di credito alla prenotazione. L'' imposta di Soggiorno stabilita dal 1 Luglio 2011 dal Consiglio Comunale di Firenze è pari a euro 2,00 a pernottamento e Non è inclusa in Nessuna Tariffa .\n\nCancellazione prenotazioni e no show:\nN4U Guest House è una bellissima struttura di poche camere.\nE’ per questa ragione che chi decidesse di cancellare la propria prenotazione deve farlo a più di 7 giorni dalla data della stessa.\nPer cancellazione effettuata a più di 7 giorni prima dell''arrivo: nessuna penale.\nPer cancellazione effettuata a meno di 7 giorni prima dell''arrivo oppure in caso di mancato arrivo, penale dell'' intero importo della prenotazione. Alcune date specifiche potrebbero avere termini di cancellazione a più di 25 giorni.\nLe offerte speciali hanno una politica di cancellazione Non Rimborsabile anche in caso di disdetta, modifica e No show.\nSe per qualsiasi motivo decideste di anticipare la Vostra partenza durante il Vostro soggiorno saremmo comunque obbligati ad addebitarvi l’ intero importo della prenotazione , senza nessuna eccezione.\n\nLocation:\nN4U Guest House non è un Hotel.\nN4U Guest House è una bellissima casa posizionata al piano II di un Palazzo del XIV Secolo nel pieno Centro Storico della Città di Firenze , come molti Palazzi del Centro Storico non è presente l’ ascensore.\n\nCamere:\nSe avete scelto una specifica camera, faremo il possibile per assegnarvela.\nIn ogni caso per esigenze logistiche N4U si riserva il diritto di assegnarvi una camera diversa di identico standard( Doppia, Tripla, Quadrupla) anche senza preavviso e di effettuare cambi anche durante il Vostro soggiorno per motivi di pianificazione e organizzazione interna. Alcune delle nostre camera sono dotate di bagno EnSuite altre sono dotate di bagno privato OffSuite, in questo caso Vi saranno offerti accappatoi e ciabattine da bagno per il Vostro comfort.\n\nServizi:\n\nColazione\nLa Vostra colazione viene servita in camera, senza costi aggiuntivi di servizio, alle ore 8.30 a.m. e in ogni caso dalle ore 8.00 a.m.  alle ore 9.00 a.m.\n\nChiavi:\nI clienti vengono dotati delle chiavi di ingresso sia alla Guest House che alla loro camera. Dette chiavi devono essere riconsegnate necessariamente al Vostro check out. Se questo non dovesse avvenire saremo obbligati ad addebitarvi un costo.\n\nHouse Keeping:\nLe camere verranno riordinate tutte le mattine dalle 8.00 alle ore 10.00 se da Voi rese disponibili.\nIn caso contrario verranno riordinate il giorno successivo.\n\nBagni:\nOgni bagno è dotato di sapone per le mani e viso e Doccia-Shampoo.\nLenzuola e asciugamani e scendibagno vi verranno forniti al vostro arrivo.\nIl cambio delle lenzuola e degli asciugamani  avverrà puntualmente ad ogni cliente.\nDurante il vostro soggiorno verranno cambiate le lenzuola e gli asciugamani dopo il 3° giorno di permanenza. In ogni caso chi volesse può cambiare tutta la biancheria in dotazione con un costo aggiuntivo di euro 5,00\n\nParcheggio:\nA 50 metri da N4U Guest House sono disponibili alcuni parcheggi custoditi a pagamento.Tutti gli indirizzi alla sezione "Dove Siamo"\n\nCheck in:\nN4U Guest House non è un hotel, ogni persona è accolta  personalmente.\nIl check in è possibile solo dalle 14.00 alle 18.00. In ogni modo è possibile ricevervi in orari diversi ovvero dalle ore 18.00 alle ore 21.00  con un costo aggiuntivo di euro 30,00 oppure dalle ore 21.00 alle ore 23.00 con un costo aggiuntivo di  euro 60,00 oppure dopo le ore 23.00 con un costo aggiuntivo di euro 95,00 purchè ci informiate  con anticipo sul vostro orario di arrivo all’ e mail info@n4uguesthouse.com\n\nCheck out:\nIl chek out si effettua non oltre le ore 10.00. Secondo disponibilità della camera sarà possibile effettuare un Late Check Out non oltre le ore 17.00 ad un costo aggiuntivo di 49,00 euro.\n\nInformativa sulla Privacy:\nN4U Guest House considera molto seriamente la riservatezza dei vostri dati personali.\nLe informazioni personali concesse verranno utilizzate solo ai fini dell’ elaborazione della prenotazione e ai fini della vostra sistemazione presso N4U Guest House.\nPrenotando e o richiedendo informazioni per il vostro soggiorno autorizzate espressamente N4U Guest House al trattamento dei vostri dati.\nL’entrata d’ingresso e alcune parti comuni di N4U Guest House potrebbero essere video-sorvegliate per la Vostra e la Nostra sicurezza. In questo caso potrebbero essere utilizzate solo ed esclusivamente a questo fine.\n', '', '', '', '15km', '', '', '900mt', '100mt', '', '50mt', '1', 0, 96),
