(98, 2, 4, 'Black 5 Florence Suite', 'Via Giuseppe Verdi 5 ', '50122', 'Firenze', 3679, 1168, 80, '+390550515147', '+390550515147', 'http://www.www.black5florencesuite.it', 'Black 5 Florence Suite is located in the Santa Croce area of Florence’s historical centre. It offers, Free Internet Connection Lan, Free Minibar with Mineral Water, Air-Conditioned rooms, hairdryer and private bathroom. Continental Buffet Breakfast. \n\nRooms are decorated in different styles and colours to provide a cosy atmosphere and different experiences. \nThe Black 5 Florence Suite is less than a 5-minutes walk from the Uffizi Gallery and the Ponte Vecchio. Wellness Center is at 500 mt walking distance from Black 5 Florence Suite and is available if you book it in advance.\n', 'Black 5 Florence Suite si trova in zona Santa Croce, in pieno Centro Storico di Firenze e offre camere con Free Internet Lan, Free Minibar con Acqua Minerale , Aria Condizionata, Asciugacapelli e Bagni Privati. Colazione Continentale a Buffet. \n\nLe sistemazioni sono decorate in stili e colori differenti, per offrire ambienti accoglienti e sensazioni diverse. \nIl Black 5 Florence Suite dista meno di 5 minuti a piedi dalla Galleria degli Uffizi e dal Ponte Vecchio. Il Centro Benessere dista 500 mt a piedi da Black 5 Florence Suite ed è sempre prenotabile in anticipo.\n\n', '', '', '', 'Florence is famous all over the world for its unique beauties. To visit the principal beauties in Florence you need at least 3 days.\n\nFor many years Florence has been the cradle of culture and art. Many of the most famous artists of the Renaissance were born there and thanks to them thousands of tourists choose Florence for their holidays.\nFlorence signifies abundance or wealth; during the middle-age, thanks to the Medici family, become an important economic, cultural and artistic city.\nThe artistic patrimony of Florence is among the most important of the world.\nBlack 5 Florence Suite, Charming Bed and Breakfast is in Via Verdi 5 , is 5 just a few steps from all the Most important Museums and Architectural Signs in Florence.\n\nFamous Museums such as,  Uffizi Gallery, Palazzo Pitti , Museum of the Bargello, Archaeological Museum, Museum of Modern Art, Museum of Opera del Duomo.\nGreat libraries (Laurenziana Library, Riccardiana Library, Marucelliana Library, Central National Library).\nThe famous Academies (Academy of the Bran, Academy of Cimento, Colombaria Academy).\nLarge Parks and Gardens (Park of the Cascine, Garden of Boboli, Garden of the Iris).\n\nThe monuments in Florence constitute an artistic complex among the most important of the world: the Baptistry (with the gold doors by the Ghiberti and Andrea Pisano), the Fortezza da Basso, the Giotto Bell Tower, the Innocenti Hospital and the famous Piazza della Signoria.\n\nImportant churches like the Dome (or Santa Maria del Fiore) with the immense cupola by the Brunelleschi and the bell tower by Giotto, The Pietà by Michelangelo, the Santa Croce church, in which we found the resting place of Machiavelli, Michelangelo, Galileo Galilei, Alfieri, Foscolo and Rossini, the San Lorenzo church, the Santa Maria Novella church and the wonderful Santa Maria degli Angeli.\n\nFlorence is rich of great work and wonderful palaces like the Palazzo Vecchio, the loggia by Orcagna, the Spedale degli Innocenti of Brunelleschi, the PalazziMedici, the Pitti Palace and the Uffizi (by the Vasari with the famous Uffizi Gallery), the Ponte Vecchio with the double row of small old shops, from the 1500 exclusive rights of the Orafi.', 'Chi decidesse di visitare Firenze soggiornando in un Bed and Breakfast nel Centro Storico di Firenze come Black 5 e non vuole perdere quelli che sono i principali monumenti e le testimonianze di un passato glorioso che la vedeva regina nel panorama culturale europeo e potenza economica culturale ed artistica, ha bisogno almeno di tre giorni.\n\nVisitando il Centro di Firenze o i quartieri più antichi ci si rende conto di quanto il fascino di Firenze colpisca chiunque la visiti  facendone una delle città più belle del mondo intero: Palazzi aristocratici come  Palazzo Vecchio in Piazza della Signoria , logge, fontane, il meraviglioso Ponte Vecchio , risalente al quattordicesimo secolo, la Galleria degli Uffizi  confermano il  primato economico, politico, artistico e culturale della città in tutta Europa tra il quattordicesimo e il diciassettesimo secolo. In Via degli Alfani, all’angolo con piazza  Brunelleschi a 100 metri da Black 5 Residenza d'' Epoca Firenze è possibile visitare la Splendida Santa Maria degli Angeli .\n\nLa scoperta  di Firenze  può cominciare dalla Basilica di Santa Maria Novella, a pochi passi dal Nostro Bed and Breakfast - Black 5, Firenze ,  edificata a partire dal 1246. La splendida facciata a tarsie marmoree policrome fu completata dall’architetto fiorentino Leon Battista Alberti tra il 1456 e il 1470. All’interno sono custoditi grandi capolavori  tra cui la Trinità dipinta da Masaccio. Immancabile una Visita a Palazzo Pitti ,dove vissero i Medici sino alla fine della dinastia.\n\nA poca distanza da Santa Maria Novella, percorrendo Via del Giglio e facilmente raggiungibile da Black 5 Residenza d'' Epoca Firenze si giunge alla chiesa più antica della città, la Basilica di San Lorenzo, rifatta nell’XI secolo e rimaneggiata fortemente per volere della famiglia Medici che la scelsero come chiesa di famiglia. L’interno, realizzato su progetto di Brunelleschi, è un vero e proprio capolavoro del primo rinascimento fiorentino.', '', '', '', 0, 0, 0, 0, 'Via Giuseppe Verdi, 5, 50122 Firenze, Italia', 43.7702, 11.2615, 17, 'Payments:\nCredit Card information is required in order to guarantee your reservation. Your credit card will be not charged until your arrival or departure or if the cancellation deadline has passed.\n\nPayment will be settled during the stay at Black 5 Florence Suite in cash or by Credit Card , Visa , Mastercard, JBC. In any case, We could always request a prior authorization for the full amount of the booking  made also to assess the current availability of the credit card used. Special offers are not refundable rate and the amount will charge by credit card on booking. From 1st of July the City of Florence will introduce the Tourism Tax for 4,00 per overnight staying and it is Not included in any Rate.\n\nCancellation Policy and No show: \nIn case of cancellation made with more than 7 days before arrival: no penalty.\nIn case of cancellation made with less than 7 days before arrival or no show: penalty of total amount. Some dates may have an cancellation policy with more than 25 days.\nSome specials offers have a Not Refundable cancellation policy also in case of No show or date''s change and the amount charge on booking.\nIn any case, without any exception, if You decide , during your stay ,  for   earlier departure  we will be forced to pay down all the  amount of reservation.\n\nLocation:\nBlack 5 Florence Suite is not an Hotel\nBlack 5 Florence Suite is a beautiful Bed and Breakfast located on the second floor of a building in the Historic Center of the City of Florence. The elevator is present from the mezzanine.\n\nRooms:\nIf you choose to stay in a particular room, Black 5 Florence Suite will do everything possible to assigned it to you. However, for logistical purposes, this may not be possible. In this case, Black 5 TownHouse has the right to assign a different room of the same standard (Double , Triple, Quadruple) without notice also during your stay. All our room have a private bathroom with tub or shower, hairdryer, Lan cable Internet, Air conditioning, minibar, TV, Safe, Telephone, anti-allergic mattresses, double pillows and fine bed kits of pure Egyptian cotton.\n\nServices:\n\nBreakfast\nYour Continental Buffet Breakfast will be served in the breakfast room from 8.15 am to 9:15 a.m.\n\nKeys\nGuests are given the keys to the Main entrance , to the home, to the room, and lift''s key. These keys must be returned at the time of checkout. We will charge you € 6.00 for each key which is not returned.\n\nHouse Keeping:\nRooms will be cleaned and tidied every morning at 8am and at 10am if they are made available. Otherwise, they will be cleaned on the following day.\n\nBathrooms\nEach bathroom is equipped with soap for your hands and face, shampoo &  bubble bath.\nBed linen, towels and bath mats will be supplied at the time of your arrival.\nEach guest will promptly receive a change of sheets and towels.\nDuring your stay, sheets and towels will be changed every three days. You can request to have all the household linen changed at an additional cost of 15,00 Euros.\n\nParking\n3 Car parking are available for a fee, at 50 meters from the Black 5 TownHouse. All the details are at section "Location".\n\nCheck in\nBlack 5 Florence Suite is not a Hotel, every person is given a personal welcome.\nCheck-in is available only  from 2.00 pm to 6.00 pm. However, you can check-in outside these hours from  6.00 p.m. until 9.00 p.m. with an add cost of 30,00 euro, from 9.00 p.m. until 11.00 p.m. with an add cost of 60,00 euro and later than 11.00 p.m. with an add cost of 95,00 euro if you inform us in advance of your arrival time by email at info@black5florencesuite.com.\n\nCheck out:\nCheck out is until 10.00 a.m. According to room''s availability you can make a Late Check-Out , no later than 17.00 pm , for an additional fee of 49.00 Euros.\n\nPrivacy statement\nBlack 5 Florence Suite is very serious about the confidentially and privacy of your personal details.\nThe personal information provided will only be used for processing the booking and for arranging your stay at Black 5 TownHouse.\nYou expressly authorise Black 5 TownHouse to process your data by booking or requesting information.\nThe lobby and some common areas of the Black 5 Florence Suite may be under video-surveillance for your and our safety. It will only be used exclusively for this purpose.', 'Metodi di Pagamento: