a specifica camera, faremo il possibile per assegnarvela.\nIn ogni caso per esigenze logistiche Black 5 si riserva il diritto di assegnarvi una camera diversa di identico standard (Doppia, Tripla, Quadrupla) anche senza preavviso e di effettuare cambi anche durante il Vostro soggiorno per motivi di pianificazione e organizzazione interna. Tutte le Nostre Camera sono dotate di Bagno Interno con Vasca o Doccia, Asciugacapelli, Lan Internet con cavo, Aria Condizionata a Climatizzazione regolabile, Minibar, Tv , Cassaforte, Telefono, Materassi Antiallergici , Doppi Cuscini e finissimi Corredi da letto di puro Cotone Egiziano.\n\nServizi:\n\nColazione\nLa Vostra prima Colazione Continentale a Buffet viene servita in Sala Colazioni dalle ore 8.15 a.m.alle ore 9.15 a.m.\n\nChiavi:\nI clienti vengono dotati delle chiavi dell'' Ingresso principale, dell'' Ingresso alla Residenza e alla Camera e dell'' ascensore. Dette chiavi devono essere riconsegnate necessariamente al Vostro check out. Se questo non dovesse avvenire saremo obbligati ad addebitarvi un costo di € 6 per ogni chiave mancante.\n\nHouse Keeping:\nLe camere verranno riordinate tutte le mattine dalle 8.00 alle ore 10.00 se da Voi rese disponibili.\nIn caso contrario verranno riordinate il giorno successivo.\n\nBagni:\nOgni bagno è dotato di sapone per le mani e viso, Doccia- Shampoo.\nLenzuola e Asciugamani e Scendibagno vi verranno forniti in Camera al vostro arrivo.\nIl cambio delle lenzuola e degli asciugamani  avverrà puntualmente ad ogni cliente.\nDurante il vostro soggiorno verranno cambiate le lenzuola e gli asciugamani dopo il 3° giorno di permanenza. In ogni caso chi volesse può cambiare tutta la biancheria in dotazione con un costo aggiuntivo di euro 15,00\n\nParcheggio:\nA 50 metri da Black 5 sono disponibili alcuni parcheggi custoditi a pagamento.Tutti gli indirizzi alla sezione "Dove Siamo"\n\nCheck in:\nBlack 5 Florence Suite non è un Hotel, ogni persona è accolta  personalmente.\nIl check in è possibile solo dalle 14.00 alle 18.00. In ogni modo è possibile ricevervi in orari diversi ovvero dalle ore 18.00 alle ore 21.00  con un costo aggiuntivo di euro 30,00 oppure dalle ore 21.00 alle ore 23.00 con un costo aggiuntivo di  euro 60,00 oppure dopo le ore 23.00 con un costo aggiuntivo di euro 95,00  purchè ci informiate  con anticipo sul vostro orario di arrivo all’ e mail  info@black5florencesuite.com\n\nCheck out:\nIl chek out si effettua non oltre le ore 10.00. Secondo disponibilità della camera sarà possibile effettuare un Late Check Out non oltre le ore 17.00 ad un costo aggiuntivo di 49,00 euro.\n\nInformativa sulla Privacy:\nBlack 5 Florence Suite  considera molto seriamente la riservatezza dei vostri dati personali.\nLe informazioni personali concesse verranno utilizzate solo ai fini dell’ elaborazione della prenotazione e ai fini della vostra sistemazione presso Black 5.\nPrenotando e o richiedendo informazioni per il vostro soggiorno autorizzate espressamente Black 5  al trattamento dei vostri dati.\nL’entrata d’ingresso e alcune parti comuni di Black 5 Florence Suite potrebbero essere video-sorvegliate per la Vostra e la Nostra sicurezza. In questo caso potrebbero essere utilizzate solo ed esclusivamente a questo fine.', '', '', '', '15km', '', '', '900mt', '100mt', '', '50mt', '1', 0, 98),
