(100, 1, 3, 'La Piccola Locanda', 'Via Risorgimento 106', '97015', 'Modica', 3674, 1170, 80, '0932906527', '0932946777', 'http://www.www.lapiccolalocandamodica.com', 'We are in an Art Nouveau villa of the first 900 fully renovated with a creative fusion of minimalist design while respecting the traditional architectural elements. The result is characterized by the simplicity of the lines that highlight the structure of the building. The house is surrounded by a Mediterranean garden of 1500 square meters by the unmistakable scents that emanate from almonds, walnuts, olive, mulberry, apricot trees, oranges, pears, tangerines, pomegranates, etc ... The rooms are made by our architect to welcome you in a comfortable design with an eclectic combination of materials such as steel, stone and wood. All rooms with nice garden view with air conditioning, bathroom, telephone, internet access, satellite TV, hairdryer, bathroom amenities, mini-bar and safe. Parking inside the hotel free of charge. Rich continental breakfast with local products.', 'Siamo in una villa in stile liberty dei primi del ''900 interamente ristrutturata con una fusione creativa di design minimalista nel rispetto degli elementi architettonici tradizionali. Il risultato si caratterizza per l’essenzialità delle linee che mettono in evidenza la struttura dell’immobile. La villetta è circondata da un giardino mediterraneo di 1500 mq dai profumi inconfondibili che si sprigionano da mandorli, noci, ulivi, gelsi, albicocchi, alberi di arance, pere, mandarini, melograno, etc... Le camere sono realizzate dal nostro architetto per accogliervi in un design confortevole e con una eclettica combinazione di materiali quali acciaio, pietra e legno. Tutte le camere con gradevole vista sul giardino sono climatizzate, con bagno, telefono, accesso internet, tv satellitare, fono , linea cortesia, frigo-bar e cassetta di sicurezza. Parcheggio interno alla struttura gratuito. Ricca colazione di tipo continentale con prodotti tipici.', '', 'Wir sind in einem Jugendstil-Villa aus der ersten 900 komplett mit einer kreativen Mischung aus minimalistischem Design renoviert und dabei die traditionellen architektonischen Elementen. Das Ergebnis wird durch die Einfachheit der Linien, die die Struktur des Gebäudes zu markieren ist. Das Haus ist von einem mediterranen Garten von 1500 Quadratmetern durch die unverwechselbaren Düfte umgeben, gehen von Mandeln, Walnüsse, Olivenöl, Maulbeere, Aprikosen, Orangen, Birnen, Mandarinen, Granatäpfel, etc ... Die Zimmer sind mit unserem Architekten gemacht, um Sie in einem komfortablen Design begrüßen mit einer eklektischen Kombination von Materialien wie Stahl, Stein und Holz. Alle Zimmer mit Blick auf den Garten mit Klimaanlage, Bad, Telefon, Internetzugang, Sat-TV, Haartrockner, Dusche, Mini-Bar und Safe. Parken im Hotel kostenlos. Reichhaltiges kontinentales Frühstück mit lokalen Produkten', '', 'La Piccola Locanda is located in the center of the commercial district of Modica-Sicily-Italy, within walking distance to cafes, shops and pizzerias. A short distance away buses that can take the historical center of Modica. The structure has the advantage of being located a few meters from SS115 ideal starting point to reach all the cities of the Val di Noto (Noto, Modica, Ragusa Ibla, Modica, etc. ..), with the coastal nature reserves (Vendicari, the Irminio, etc. ..) and the archaeological sites (Cava d''Ispica, Kamarina, Pantalica)', 'La Piccola Locanda si trova al centro del quartiere commerciale di Modica- Sicilia-Italia, a pochi passi da caffetterie, negozi e pizzerie. A breve distanza dalla struttura passano autobus che portano al centro storico di Modica. La struttura ha il grande vantaggio di essere ubicata a pochi metri dalla SS115 punto di partenza ideale per raggiungere tutte le città del Val di Noto ( Noto, Ispica, Ragusa Ibla, Scicli, etc..), la fascia costiera con le riserve naturali (Vendicari, la foce dell’Irminio, etc..) e le zone archeologiche ( Cava d’Ispica, Kamarina, Pantalica)', '', 'La Piccola Locanda befindet sich im Zentrum des Geschäftsviertels von Modica-Sizilien-Italien, in fußläufiger Entfernung zu Cafés, Geschäfte und Pizzerien. Nicht weit davon entfernt Busse, die das historische Zentrum von Modica nehmen kann. Die Struktur hat den Vorteil, dass nur wenige Meter vom SS115 idealer Ausgangspunkt, um alle Städte des Val di Noto (Noto, Modica, Ragusa Ibla, Modica, etc. ..) zu erreichen, mit der Küste Naturschutzgebiete (Vendicari, die Irminio, etc. ..) und die archäologischen Stätten (Cava d''Ispica, Kamarina, Pantalica)', '', 0, 0, 0, 0, 'Via Risorgimento, 106, 97100 Ragusa RG, Italia', 36.9177, 14.7308, 17, '', '', '', '', '', 'Catania, 120km', 'Palermo 348 km', '', 'Modica, 4km', 'Modica, 100 mt', 'Modica, 10 km', 'Modica, 100 mt', '1', 0, 100),
(101, 1, 0, 'agriturismo la pesca', 'via la pesca', '03030', 'broccostella', 3615, 1169, 80, '+393334129913', '0776891427', 'http://www.www.agriturismolapesca.com', '', 'L''agriturismo si trova sulla sponda del fiume Fibreno, immerso nella natura, posto ideale per riposare e godere della buona cucina fatta con prodotti tipici.', '', '', '', '', 'nei dintorni è possibile visitare i numerosi paesini ed abbazie, fare passeggiate in montagna.\n', '', '', '', 0, 0, 0, 0, 'Strada Statale 627, 03030 Broccostella FR, Italia', 41.698, 13.6692, 17, '', '', '', '', '', 'roma ciampino', 'roma fiumicino', 'napoli', 'frosinone', 'sora', 'terracina', '', '1', 0, 101),
(102, 5, 0, 'Borgo Santa Giulia', 'Via Brescia 3a', '25040', 'Corte Franca', 3625, 1165, 80, '+390309828348', '-', 'http://www.www.borgosantagiulia.it', '', 'A Timoline di Corte Franca, nel cuore della Franciacorta, in uno splendido scenario settecentesco riportato all''antico splendore,\n\nBorgo Santa Giulia è la cornice ideale per un soggiorno di charme. Ristorante, agriturismo, relais, azienda vitivinicola, locale con musica dal vivo, adagiati tra colline e vigneti, in un contesto di grande bellezza dove riscoprire il piacere delle piccole cose, in un''atmosfera riservata ed elegante. ', '', '', '', '', 'A Timoline di Corte Franca, nel cuore della Franciacorta, in uno splendido scenario settecentesco riportato all''antico splendore,\n\nBorgo Santa Giulia è la cornice ideale per un soggiorno di charme. Ristorante, agriturismo, relais, azienda vitivinicola, locale con musica dal vivo, adagiati tra colline e vigneti, in un contesto di grande bellezza dove riscoprire il piacere delle piccole cose, in un''atmosfera riservata ed elegante. ', '', '', '', 0, 0, 0, 0, 'Via Brescia, 3B, 25020 Flero BS, Italia', 45.4889, 10.1763, 17, '', 'A Timoline di Corte Franca, nel cuore della Franciacorta, in uno splendido scenario settecentesco riportato all''antico splendore,\n\nBorgo Santa Giulia è la cornice ideale per un soggiorno di charme. Ristorante, agriturismo, relais, azienda vitivinicola, locale con musica dal vivo, adagiati tra colline e vigneti, in un contesto di grande bellezza dove riscoprire il piacere delle piccole cose, in un''atmosfera riservata ed elegante. ', '', '', '', 'Aeroporto Brescia - Montichiari', 'Aeroporto  Bergamo - Orio al Serio', '.aeroporto', 'Borgonato - Adro', '.Autobus', '.Lago D''Iseo', 'Ristorante Santa Giulia', '1', 0, 102),
(103, 5, 3, 'Fattoria di Corsignano', 'Strada Provinciale 102', '53019', 'Vagliagli', 3687, 1168, 80, '0577322545', '0577322407', 'http://www.www.tenutacorsignano.it', 'Fattoria di Corsignano is a charming Country Estate with only 10 apartments and 4 guest rooms  set in a stunning 54 acres Tuscan Estate, in the Chianti Classico landscape, only 5 miles far from Siena.\nCombining all the comforts to the warm hospitality of a country house offering guests a unique and relaxing experience.   \nIn this pleasant setting, the lovely apartments and charming suites have been restored preserving the pure Tuscan country House style.\nAll accommodations overlook Siena or the Chianti vineyards, provided with an independent entrance, a private terrace, garden or patio to relax.\n', 'Fattoria di Corsignano è una suggestiva Residenza di Campagna con soli 10 appartamenti e 4 camere in una Tenuta di 22 ettari, immersa nelle vigne del Chianti Classico a soli 8 Km. da Siena.\nTutto il comfort unito al calore e all’ospitalità padronale di antica tradizione Toscana. \nGli appartamenti e le camere sono uniche, realizzate salvaguardando lo stile della casa di campagna. \nHanno una splendida vista su Siena o sulla vallata, con ingresso indipendente, un terrazzo privato, un giardino o un portico per rilassarsi. \n', '', '', '', 'Tuscan-style Breakfast with home -made cakes, bruschetta and cold cuts is served underneath a gorgeous pergola by the pool. \nA gourmet Tuscan dinner and a sophisticated wine selection are available on guests kind request.\n\nThe Hosts, passionate wine makers and sommeliers / wine masters invite their guests to taste the estate wines and its Extra Virgin olive oil. A wonderful experience!\n\nOn request spa treatments and massages can be organized by our personal masseur’s expert hands in the privacy of the apartment or in the nature, in the woods or underneath the trees.\n\nFor those who love Tuscan cuisine we propose our cooking classes paired to a tasting of all our wines.  (a minimum of 6 participants is requested).\n\nThe large, tempting pool, the garden and the terrace nearby the pool allow moments of unforgettable relax.\n\n A walk through the woods shows all the typical plants of the Tuscan wood: juniper, oak, live oak….\n\nBikes can be rented and routes requested at the reception.\n\nPets if well behaved are welcomed and pampered. \n\nLovely homesteads, castles, monasteries and abbeys are in the neighborhood. \nDaily excursions to Siena, Florence, Pisa, Lucca, Perugia as well as to the ancient villages of San Gimignano, Volterra, Pienza, Montalcino, Montepulciano are easily possible.\n\nFattoria di Corsignano is an “Eco-compatible” Winery Estate. The total energy is provided by solar panels. All the farming is submitted to an Agricultural Quality System Control.\n\nThe estate has an extension of 54 acres: woods, vineyards and olive graves.\nNearly 24 acres are devoted to the wine production, and 5 acres to the olive oil’s one. \nThe vineyards are located 1260 ft. above the sea level, they have a good south south-west sun exposure, and a terrific microclimate for wine-making.\n\nWe offer a typical product in respect of the tradition of the Chianti Classico wine.\nFor the Chianti Classico wine production, we use only local vines like Sangiovese, Canaiolo, Colorino…\nFrom the vineyards of Fattoria di Corsignano, in the Chianti Classico Black Rooster area, almost 40.000 bottles are yearly produced.\n', 'Le prime colazioni, dolci e salate, sono servite sotto un affascinante pergolato di glicine accanto alla piscina. \nA disposizione degli ospiti la possibilità di gustare raffinate cene di sapore toscano, accompagnate dai nostri vini e curate dai padroni di casa, prima imprenditori e ora appassionati viticultori e sommelier.\nDurante la settimana viene organizzata una  serata di degustazione di vini e olio.\nTrattamenti, massaggi e percorsi benessere vengono praticati dalle mani esperte del nostro massaggiatore nella riservatezza del vostro appartamento oppure nella natura, nel bosco, sui prati o sotto gli alberi.\nPer gli amanti della cucina toscana proponiamo i corsi di cucina con abbinamento ai nostri vini. \nL’ampia piscina, il giardino e la terrazza a bordo piscina permettono momenti di indimenticabile relax. \nUn percorso nel bosco mostra segnalate le tipiche piante toscane: ginepro, quercia, corbezzolo e leccio. \nLe bici possono essere noleggiate e i percorsi richiesti alla reception.\nGli animali domestici, purché ben educati, sono benvenuti e coccolati.\nIn giornata sono facilmente raggiungibili località come Firenze, Pisa, Lucca, Perugia, gli antichi borghi di San Gimignano, Volterra, Pienza, Montalcino, Montepulciano e gli splendidi castelli, monasteri e abbazie dei dintorni. \nE’ un’azienda di vini Ecocompatibile. L’intero fabbisogno energetico è prodotto da pannelli solari. Tutte le coltivazioni sono in regime di Agroqualità.\nLa Fattoria ha un’estensione di 22 ettari: boschi, vigneti e oliveti. Dieci ettari sono dedicati alla produzione del vino, due ettari a quella dell’olio. Situati a circa 450 mt. s.l.m., i vigneti godono di un’ottima esposizione a sud, sud-ovest e di un microclima eccezionalmente favorevole. \nSi offre un Chianti Classico nel rispetto della tradizione e della tipicità. Per la produzione dei vini vengono utilizzati solo vitigni autoctoni di Sangiovese e Canaiolo. Malvasia Nera.\nDai vigneti della Fattoria di Corsignano, situati nella zona del Chianti Classico Gallo Nero, vengono prodotte mediamente 40.000 bottiglie all’anno.\n', '', '', '', 0, 0, 0, 0, 'Strada Provinciale 102 di Vagliagli, 53019 Siena SI, Italia', 43.3625, 11.3245, 17, '', '', '', '', '', 'Firenze, 75 km', '', '', 'Siena, 8 km', '100 mt', '', '', '1', 0, 103),
(104, 1, 4, 'Hotel 33 Baroni', 'via Giuseppe Mazzini 23', '73014', 'Gallipoli', 3657, 1174, 80, '+39833263227', '+39833267124', 'http://www.www.hotel33baroni.it', 'The 33 Baroni Hotel in Gallipoli is a brand new hotel, finely renovated in 2010 and located in a quiet place in the heart of the city: at just 100 meters far from bathing rocks and just 1,5 km from bathing facilities. \nWith all the last news about thermal isolation, soundproofing and building automation technologies, it’s a six floors palace, one for meeting rooms of different dimensions, four floors with rooms and common areas and the last one with the panoramic terrace. It has common areas and services for any kind of event, for business or leisure, it has reserved parking and provides you with any information on “what to do and when”, to satisfy all your wishes 24h a day.', 'L’hotel 33 baroni è un nuovissimo Hotel 4 stelle al centro di Gallipoli, a soli 300 metri dal Centro Storico e a 1,5km dal primo lido attrezzato. Ristrutturato integralmente nel 2010 adottando  le ultime novità sull’insonorizzazione, isolamento termico e tecnologie di building automation per la ricettività, è ricostruito nel rispetto del contesto urbanistico originario del primo Novecento. Distribuito su 6 piani, di cui uno con sale riunioni tecnologiche, 4 piani con  varie tipologie di camere e spazi comuni e l’ultimo, la terrazza panoramica.\nApprezzerete camere, suite, spazi comuni, sale riunioni tecnologiche, parcheggio riservato e tanto altro per ogni evento,  sia per leisure che per business. ', '', 'Das Hotel 33 Baroni **** in Gallipoli ist ein mitten in der Stadt Neugebautes Hotel: nur 300 Meter von der Altstadt und dem Meer und 1,5km vom ersten Strand. Das Hotel ist ein alter Palast, der in 2010 mit den letzten Neuheiten auf der Schalldämmung, der Wärmeisolierung und den aufnahmefähigen Technologien renoviert wurde. Es hat sechs Stockwerke, auf einem sind verschiedene Sitzungssäle, auf vier sind Hotelzimmer und auf  dem letzten ist die Panoramaterrasse. \nEs bietet für jedes Ereignis Dienste an, nicht nur für Leisure, sondern auch für Ihr Business Aufenthalt. Parkplätze die Sie reservieren können und alle Auskünfte die Sie gebrauchen, finden Sie bei uns 24h auf 24h, damit wir Ihre Wünsche befriedigen können.', '', '', '', '', '', '', 0, 0, 0, 0, 'Via Giuseppe Mazzini, 73014 Gallipoli LE, Italia', 40.0554, 17.9871, 17, 'Deposit of 30% of the total stay, or nonrefundable prepayment.\nCancellation policy:\n•	In periods A and B no charges for cancellations up to 48 hours prior to arrival; within 48 hours, one night retention charge, included no show and early check-out .\n•	In period C no charges for cancellations up to 7 days prior to arrival; within 7 days, it will be charged 50% of the full booking amount, included no show and early check-out.\n•	In period D no charges for cancellations up to 14 days prior to arrival; within 14 days, it will be charged 100% of the full booking amount, included no-show and early check-out.', 'Caparra del 30% dell''intero soggiorno oppure saldo anticipato non rimborsabile.\nPolitiche di cancellazione:\n•	periodi A e B: Nessun addebito per cancellazioni fino a 48 ore prima dell''arrivo; al di sotto delle 48 ore, addebito di 1 notte, compreso il no show e partenze anticipate.\n•	nel periodo C: Nessun addebito per cancellazioni fino a 7 giorni prima dell''arrivo; al di sotto dei sette giorni, addebito del 50% del soggiorno prenotato, compreso il no-show e partenze anticipate.\n•	nel periodo D: Nessun addebito per cancellazioni fino a 14 giorni prima dell''arrivo; al di sotto dei 14 giorni addebito del 100% del soggiorno prenotato, compreso il no-show e partenze anticipate.', '', '', '', 'Brindisi - Papola Casale', 'Bari - Palese', '', 'Lecce', '', '', '', '1', 0, 104),
