(106, 7, 5, 'il quadrifoglio', 'via agostino oldoini 45', '19122', 'la spezia', 3622, 1167, 80, '+393462126797', '0187702815', 'http://www.www.affittacamereilquadrifoglio.it', 'new rooms and sanitized tastefully furnished 300 m from the station, close to the 5 terre ... departures by boats from the pier along the coast ... tours organized by the tourist board office with a few steps from struttura.Prezzi low throughout the year .. in room wi-fi free air conditioning private bathroom hairdryer tv .... great offers year-round low for new opening', 'quattro spledide camere arredate con gusto con bagno all''interno dotato di tutti i confort frigo bar aria condizionata rete wi-fi gratis fhon tv schermo piatto 32 pollici a due passi dal centro...distante 300 m dalla stazione principale. ...nei pressi delle 5 terre con partenze dal molo lungo le coste....itinerari ed escursioni organizzati da ente del turismo a due minuti a piedi dall ufficio!! prezzi incredibili tutto l''anno per nuova apertura', '', '', '', '', 'Please confirm room with a deposit of 50 € on paper or via PostaPay iban be requested after the lady giusi phone number +393462126797 thanks', '', '', '', 0, 0, 0, 0, 'Via Giobatta Casoni, 40, 19122 La Spezia SP, Italia', 44.1136, 9.81069, 17, '', 'si prega cortesemente per la conferma della camera un acconto di 50€ su carta postapay o iban da richiedere alla signora giusi tramite email o telefono cellulare con numero +393462126797', '', '', '', '100km', 'pisa', 'genova', '300m', '100m', '10minuti', '20m', '1', 0, 106),
(107, 7, 0, 'B&Be Appartamenti Antica Corte Milanese', 'via Repubblica 86', '20026', 'Novate Milanese', 3631, 1165, 80, '+393387067796', '+390293650248', 'http://www.www.anticacortemilanese.it', 'ANTICA CORTE MILANESE  B&B and apartments\n  \nB&B and Flats Antica Corte Milanese are just outside Milan, near the new Milan Fair, easily attainable by car in just 5 minutes (4 kilometers) or with public transport; and only 3 stops down the Fieramilanocity (Congress Hall) with S line.  In fact it is located just a stones throw away from the S line station (FNM), which connects you to the center of Milan in 15 minutes and to Malpensa Airport in 40 minutes.  Agreements with restaurants in a walking distance and with a taxi driver. A supermarket is 20 meters from the house.\n\nGuests are welcome to leave their vehicles in an ample parking lot adjacent to the rooms and apartments in a well protected courtyard.  \nThe early 19th century Villa  has been divided with comfort and privacy in mind.\nGuests find the rooms furnished and equipped with necessities. there''s the wi-fi internet connection, laundry room and bicycles that guests can use, all free of charge.\nThere''s also a self-service area for breakfast and to have a snack.\nThese accommodations are ideal also for big groups, since there is a choice between B & B set- up rooms and services of exclusive use, or  independent apartments with self-contained kitchens depending on guest''s specific requirements.  \nThe Villa is centrally located on the main street of a small quaint Italian town, full of greenery, small shops and boutiques.\n\n', 'ANTICA CORTE MILANESE\nNOVATE MILANESE (MI) Zona Fiera Milano \nB&B e appartamenti.\nAntica Corte Milanese è una corte dal sapore antico, completamente ristrutturata, situata tra il centro di Milano e la nuova Fiera di Milano.\nQuest’ultima si raggiunge in soli 5 minuti di auto (4 chilometri) o con i mezzi pubblici in 30 minuti; Milano Centro Congressi/Fieramilanocity si raggiunge in 10 minuti. \n Antica Corte Milanese  si trova infatti a pochi passi dalla stazione della linea S (FNM) che collega al centro di Milano in 15 minuti e all’aeroporto della Malpensa in 40 minuti; A poche centinaia di metri la superstrada Rho-Monza e l’autostrada collegano direttamente a tutte le destinazioni, evitando di entrare nel traffico di Milano.\nCollegato con le principali vie di comunicazione, autostrade, ferrovie e arterie stradali, l’Antica Corte Milanese offre il vantaggio di essere raggiungibile senza entrare nel fitto traffico della metropoli. Novate Milanese è infatti direttamente collegato con le principali aree dedicate agli affari, a quelle ospedaliere e universitarie, ai centri della moda, del cinema e del design, e ad alcune mete turistiche di grande interesse, dal lago di Como alla Brianza.\nLa casa, in stile primi del Novecento, è particolarmente accogliente ed è strutturata in modo da garantire la privacy degli ospiti con la scelta tra una sistemazione in B&B con camere e servizi ad uso esclusivo o in appartamenti indipendenti.\nL''ubicazione è a Novate Milanese, cittadina tranquilla alle porte di Milano.\n Gli appartamenti, tutti con ingresso indipendente, sono di varie metrature, dai monolocali – loft ai quadrilocali, con affaccio su caratteristico cortile interno che funge da parcheggio sicuro. \nSono arredati e corredati di quanto necessario per brevi periodi di permanenza, con camere doppie o singole, bagno e cucina ad uso esclusivo.\nA disposizione degli ospiti:\n•	biancheria da camera, da bagno e da cucina\n•	zona self-service (macchine vending con bevande calde, fredde e snacks)\n•	zona lavanderia\n•	internet wireless\n•	parcheggio interno\n•	3 ristoranti convenzionati raggiungibili a piedi\n•	Piccolo supermercato a pochi passi\n•	a richiesta è disponibile un servizio taxi a tariffe agevolate.\n', '', 'ANTICACORTE MILANESE  \nNOVATE MILANESE (MI) Nuova Fiera zone, Milan                  Pension und Apartments\nDas alte Corte Milanese ist in der Nähe der neuen Messe von Mailand gelegen, welche mit dem Auto in 5 Minuten (4 Kilometer), oder mit den öffentlichen Verkehrsmitteln (nur 3 Haltestellen mit der S- Bahn) erreichbar ist.\nCorte Milanese ist nahe der Bahnstation gelegen, die sie zum Zentrum Mailands in 15 Minuten und zum Flughafen Malpensa in 40 Minuten bringt.\nNovate Milanese liegt am Schnellweg Rho- Monza und die nahe gelegene Autobahn bietet eine direkte Verbindung in alle Richtungen und ist ideal um den ganzen Verkehr Mailands zu umgehen. Vor Ort gibt es auf dem Hof eine Möglichkeit zum Parken.\nDas Haus ist im Stil des frühen 19. Jahrhunderts gebaut, sehr herzlich und einladend, garantiert aber auch Raum für Privatsphäre. Es gibt neben dem Übernachtungsangebot auch Apartments mit eigener Küche und Wohnbereich, die aber ausschließlich für eine längere Zeitperiode angeboten werden.\nCorte Milanese befindet sich mitten im Zentrum des Vororts Novate Milanese, biete Einkaufsmöglichkeiten in der nahen Fußgängerzone und viel Natur.\n \n', '', '', '', '', '', '', 0, 0, 0, 0, '', 0, 0, 0, '', '', '', '', '', '30 km', '50 km', '', '300 metri', '50 metri', '150 km', '50 metri', '1', 0, 107),
