(109, 5, 3, 'Agriturismo Maremma Mia', 'loc. Barbicate, 535', '58014', 'Saturnia', 3680, 1168, 80, '+393472974961', '+390564601513', 'http://www.maremmamia.it', '', 'L'' Agriturismo "Maremma Mia" vi apre le sue porte in un contesto tipico maremmano, in un ambiente casalingo e rurale dove sarete coccolati come a casa vostra!\nNel giardino troverete sicuramente un angolo rilassante dove potrete ammirare il vero paesaggio maremmano fatto di dolce e sconfinata natura...\nLa prima colazione, e le cene saranno allietati dalla cucina di Marcella che vi aspetta poi a tavola con ironica simpatia, per raccontarvi i piatti della tradizione casalinga maremmana fatta di sapori semplici e genuini grazie ai prodotti dell''orto, dei campi e degli allevamenti del podere...\nE alla sera, seduti a tavola, sarà bello chiacchierare e scoprire le storie dei popoli che hanno vissuto queste terre così dure e dolcissime insieme al tempo stesso, magari assaporando un buon bicchiere di Morellino di Scansano prodotto in proprio.\nSi avvisa la gentile clientela che dal 28 03 2013 verrà applicata  la tassa di soggiorno\nper maggiori informazioni conttatare la signora Marcella. ', '', '', '', '', 'L'' Agriturismo "Maremma Mia" vi apre le sue porte in un contesto tipico maremmano, in un ambiente casalingo e rurale dove sarete coccolati come a casa vostra!', '', '', '', 0, 0, 0, 0, 'Piazza Vittorio Veneto, 21B, 58014 Saturnia GR, Italia', 42.6632, 11.5043, 17, '', '', '', '', '', 'Roma km 180', 'Pisa km 250', 'Grosseto km 60', 'Albinia Km 45', 'Saturnia Km 7', 'Argentario Km 50', 'nella struttura', '1', 0, 109),
(110, 1, 3, 'Hotel Principe Residence - Vasto M. -', 'Viale Dalmazia, 124', '66054', 'Vasto Marina', 3585, 1164, 80, '+390873801457', '+390873801628', 'http://www.hotelprincipevasto.com', '', 'L''Hotel Principe Residence, situato in ottima posizione centrale, direttamente sul mare, dispone di nuove aree comuni: ingresso, hall , bar, zona wi-fi,  saletta attesa tutte climatizzate e un ampia sala proiezione. Sala ristorante climatizzata e nuova anche la cucina, dove vengono elaborati piatti tipici e nazionali con ampia scelta di portate.\nRicca colazione a buffet.\nL’albergo dispone di 56 camere, tutte con balcone, servizi , TV led, cassaforte e telefono diretto. Tutte completamente rinnovate, le camere si dividono in cat. “Classic”, “Lux” e nell''ala nuova sono a disposizione le camere di cat. Superior con qualche confort in più: isolamento acustico, aria condizionata , frigobar, doccia idromassaggio, bollitore per servizio coffe/thè, TV-led 32 pollici, alcune con servizio TV-SKY (su richiesta).\nArea Solarium con piscina per bimbi e per adulti e vasca idromassaggio Spa Jacuzzi.\nSpiaggia privata attrezzata di fronte all’Hotel e servizio mattutino di intrattenimento bimbi fascia di età 3/8 anni, campetto regolamentare polivalente di calcetto/tennis\nParcheggio gratuito con accesso riservato e garage a pagamento.\nwww.hotelprincipevasto.com \nGrazie \nFam. Celenza\n', '', '', '', '', 'Musei civici di Palazzo d''Avalos,\nCattedrale di San Giuseppe,\nChiesa di Santa Maria Maggiore,\nResti della Chiesa di San Pietro,\nRiserva Naturale Regionale Punta Aderci,\nPercorso ciclabile Torrente Lebba\nCasalbordino: Sant. Mad. dei Miracoli,\nSan Salvo: Parco arch. del Quadrilatero,\nSan Salvo: Giardino Botanico Mediterraneo\n', '', '', '', 0, 0, 0, 0, 'Via Dalmazia, 66054 Marina di Vasto CH, Italia', 42.0964, 14.7229, 17, '', 'Prenotazioni tramite acconto di caparra confirmatoria', '', '', '', 'Pescara', 'Bari', 'Roma', 'Vasto-San Salvo', '30 mt.', '60 mt', '1', '1', 0, 110),
(111, 4, 0, 'La Tana di Giano', 'Via Scapacchio'' 15', '35030', 'selvazzano dentro', 3694, 1157, 80, '390498056383', '', 'http://www.www.latanadigiano.it', '', 'il nostro B&B è situato in una zona tranquilla, nelle prossimità del fiume Bacchiglione.\nE'' anche comoda alla città di Padova.', '', '', '', '', 'Il Golf Club La Montecchia è vicinissimo.', '', '', '', 0, 0, 0, 0, 'Via San Francesco, 8, Padova PD, Italia', 45.4064, 11.8768, 17, '', 'Si accetta esclusivamente il pagamento in contanti.', '', '', '', 'Venezia', 'Treviso', 'Verona', 'Padova', 'Selvazzano Dentro', 'Sottomarina', 'El Medievolo', '1', 0, 111),
