(113, 5, 0, 'Il Pignocco Country House', 'Strada del Pignocco 3', '61122', 'Pesaro', 3640, 1162, 80, '0721430162', '0721458979', 'http://www.www.ilpignocco.it', '', 'Tra prati ed alberi secolari, un’antica dimora storica di campagna risalente al 1700 offre  camere ed appartamenti dal gusto rustico ed elegante, per una vacanza nella quiete della natura, nei pressi del mare e di località di interesse storico e culturale, alla scoperta dei sapori e delle tradizioni delle Marche. Il Pignocco vi sorprenderà per il panorama fantastico, per la sorprendente torretta belvedere, per l’accoglienza tutta al femminile e per la piscina circondata dagli antichi olivi e dalle quale, sul calar della sera, si assiste ad un tramonto indimenticabile.', '', '', '', '', 'La Casa Vacanza è un punto di partenza ideale per visitare borghi e castelli medievali, che attraversano le bellissime strade di campagna delle Marche: Gradara, Fano, Novilara e San Leo.\n\nE ancora, dalla Casa Vacanza, tra colline e montagne, in circa mezz’ora di automobile, la città di Urbino rappresenta la patria del Rinascimento Italiano nelle Marche. ', '', '', '', 0, 0, 0, 0, 'Strada del Pignocco, 61122 Pesaro PU, Italia', 43.8842, 12.8962, 17, '', 'Prenotazione tramite carta di credito o caparra.\n\nCancellazione possibile fino a 6 giorni prima della data di arrivo.', '', '', '', 'Rimini Aeroporto, 25 km', '', '', 'Stazione di Pesaro, 6 km', 'Autobus Santa veneranda, 1,5 km', 'Spiaggia, 6 km', 'Ristorante, 3 km', '1', 0, 113);
