(114, 4, 3, 'Al Mobile Antico', 'via Angelo Gatti 20', '14020', 'Camerano Casasco', 3645, 1156, 80, '0141992375', '', 'http://www.www.almobileantico.com', 'The “Al mobile Antico” B&B is located in a very old farmhouse (in the cellar one can still see two bricks dated 1664) in the Monferrato village of Camerano Casasco.\n\nThe apartment, restructured with skill and love by its owners, the Casetta family, has on the upper floor two very comfortable bedrooms with restored antique furniture and a large and luminous bathroom. The furniture is\nlargely antiques that have been restored with the utmost care by the owners.\n\nOn the lower floor one finds a living/dining -room with a large table for breakfasts and dinners, and a fully equipped kitchen.\n\nThe guests are guaranteed absolute peace and independence and also the use of the courtyard of approximately 200sqm with a variety of gardens in which to relax and enjoy the tranquility that the countryside offers.\n\nThe position of the B & B offers a very picturesque view, surrounded by the Alps and by green forests, vineyards and fields that are characteristic of the Monferrato area. A pleasant place to spend a relaxing holiday immersed in nature.\n\n\n\n', 'Il B&B “Al mobile Antico” è una porzione di un antico cascinale (nella cui cantina si trovano ben due mattoni datati 1664) situato nel concentrico del paese di Camerano Casasco.\n\nRistrutturato sapientemente e amorevolmente dai suoi proprietari è composto al piano superiore da due camere da letto molto confortevoli e arredate con mobili antichi che gli stessi proprietari hanno restaurato e da un bagno molto capiente e luminoso.\n\nAl pian terreno ci sono un soggiorno nel quale vengono servite le colazioni e una cucina a completa disposizione dei graditi ospiti.\n\nAgli stessi è garantita un’assoluta tranquillità e indipendenza e inoltre l’utilizzo dell’intero cortile di circa 200mq con diversi giardini nel quale rilassarsi e apprezzare la tranquillità che la campagna offre.\n\nMolto suggestivo è il panorama che la posizione del B&B può offrire, circondato dall’intero arco Alpino e immerso nel verde dei boschi, vigneti e campi che costituiscono il medio Monferrato. Un luogo piacevole dove trascorrere delle vacanze rilassanti immersi nella natura.', '', '', '', 'Camerano Casasco is a village located in the Monferrato region of Italy; it is a member of the Comunità Collinare della Val Rilate (the Rilate Valley hillside village community). This community, costituted on October 28 2000, has 13 member villages. \n\nSituated about 10 miles north-east of Asti, on the road linking Asti to Chivasso, the Val Rilate area comprises the hills extending from the Cortazzone valley to the West, to the Versa creek valley to the north-east, having at its center the Rilate creek valley, from which the hillside village community takes its name.\n\nThe community extends over a total surface area of some 20 000 acres and had a population at 31 December 2000 of 6.470 inhabitants, with an average density of .32 abitanti per acre.\n\n\n\nThe Riserva Naturale Regionale Valleandona (Regional Nature Park Valleandona) is located in a nearby valley.\n\nThis nature park has an area of occupa un''area di 734 acres, composed of a number of small hills and valleys formed in the Pliocene geological era. \n\nIt is divided into two separate main valleys, and is totally covered by wild woods of oak, birch, linden and acers.\n\nThe area is known internationally for the richness of fossil remains of the marine life that lived in the waters that covered all the Po valley in the Pliocene geological era (between 5 milioni and 1,8 millions of years ago). The fossil remains, pergectly preserved, are found in the sandy strata of the steep hills : hundreds of species of molluscs, brachiopods, corals, echinodermsm artropods and, sometimes, bones of marine mammals. The preservation of the fossil remains is the main purpose of the nature park.\n\n\n\n\n\n\n\nGeological-paleontological path: This path covers the most interesting parts of the nature park. It can only be walked together with a guide, which can be reserved free of charge.\n\nAsti Paleontological Museum: located in the "S. Pietro" Complex, built in the 12th century; comprises two floors: the paleontology rooms on the ground floor, with local fossil remains dating back to the Tertiary Era.\nThe upper floor rooms contain archeological objects from several different civilizations (Egyptian, Greek, Roman and medieval).\n\nThe Monferrato (in piedmontese Monfrà [m??''fra]) is a geographic region of Piedmont.\n\nIts territory, almost exclusively hilly, is mainly located within the provinces of Alessandria and Asti; it reaches southwards from the southern bank of the Po river up to the foothills of the Ligurian Appennines, to the borders of the Genoa and Savona provinces.\n\nThe Monferrato can be divided into two main parts:\n\nLow Monferrato: this is the larger part, characterized by its smooth hills that, apart from the Sacro Monte di Crea (1500 feet), do not reach a height greater than 1300 feet; territorially it is bound northwards and eastwards by the rivers Po and Tanaro. southwards by the Belbo river valley and westwards by the border between the Asti and Cuneo provinces, where the Langhe and Roero regions start. Its highest point is the Albugnano hill, at some 1800 feet.\n\nHigh Monferrato: reaches southwards from the Bormida valley up to the foothills of the Ligurian Appennines; is bound Westwards by the Bormida di Spigno valley and Eastwards by the westernmost part of the Scrivia valley.\n\n\n', 'Camerano Casasco è un paese del Monferrato, e fa parte della Comunità Collinare della Val Rilate. Questa comunità, costituita il 28 ottobre 2000, riunisce 13 Comuni della provincia astigiana. \n\nSituata ad una quindicina di chilometri a nord-est di Asti, capoluogo di provincia, sulla strada che la collega a Chivasso, l''area della Val Rilate occupa i sistemi collinari che si estendono dalla Valle di Cortazzone, ad ovest, alla Valle del torrente Versa, a nord-est, attraversati centralmente dal torrente e dalla Valle Rilate, da cui la Comunità Collinare prende nome. \n\nOccupa una superficie complessiva di 82,35 km² e al 31 dicembre 2000 registrava una popolazione complessiva di 6.470 abitanti, con una densità media di 79 abitanti per km².\n\n\n\nIn una valle vicina si trova la Riserva Naturale Regionale Valleandona.\n\nQuesta riserva naturale occupa un''area di 297 ettari, caratterizzata da incisioni vallive e rilievi collinari del Pliocene, nei pressi dell''Autostrada Asti-Torino. \n\nEssa si trova nel territorio del Comune di Asti, ed è costituita da due distinte valli e appare come un territorio collinare in cui si inseguono vallate selvagge coperte da boschi di farnia, carpino, tiglio e acero.\n\nE'' nota a livello internazionale per la ricchezza di reperti fossili di organismi marini che popolavano le acque che, nel pliocene (da 5 milioni ad 1,8 milioni di anni fa), ricoprivano l''intera Pianura Padana. \nI fossili, perfettamente conservati, affiorano negli strati sabbiosi delle ripide scarpate e sono costituiti da conchiglie di centinaia di specie di molluschi, brachiopodi, coralli, echinoidi, artropodi e rari resti ossei di mammiferi marini La salvaguardia dei reperti fossili è la principale finalità della Riserva.\n\n \n\n\n\n\n\n\nPercorso geologico-paleontologico: si snoda all''interno dell''area e si percorre accompagnati da guide.\nMuseo Paleontologico di Asti: ospitato nel "Complesso di S. Pietro" risalente al sec. XII; è posto su due piani: al piano terra si trova la sala dedicata alla paleontologia: con reperti fossili locali del Terziario); in alcune sale del piano superiore sono esposti molti reperti archeologici di varia provenienza (egizi, greci fino a materiale archeologico romano e barbarico).\n\nIl Monferrato (in piemontese Monfrà [m??''fra]) è una regione geografica del Piemonte.\nIl suo territorio, quasi esclusivamente di natura collinare, è compreso principalmente all''interno delle provincie di Alessandria e Asti e si estende verso sud a partire dalla destra idrografica del fiume Po sino a giungere ai piedi dell''Appennino ligure sul confine con la Provincia di Genova e la Provincia di Savona.\nIl monferrato può essere distinto in due porzioni principali:\n- Basso Monferrato: è la porzione più estesa e si caratterizza per le sue morbide colline che, ad esclusione del Sacro Monte di Crea (455 m.), non raggiungono mai altezze superiori ai 400 metri; territorialmente viene delimitata a nord e a est dal corso dei fiumi Po e Tanaro, a sud dalla valle del fiume Belbo e ad ovest approsimativamente dalla linea di confine tra le province di Asti e di Cuneo, punto esatto dove iniziano poi le Langhe e il Roero. Il punto più alto del territorio è la collina di Albugnano a 549 metri s.l.m.\n- Alto Monferrato: si estende verso sud a partire dalla valle della Bormida sino a lambire i piedi dell''Appennino Ligure; viene delimitato ad ovest dalla valle della Bormida di Spigno e ad est dalla porzione occidentale della media valle Scrivia.', '', '', '', 0, 0, 0, 0, 'Via Angelo Gatti, 20, 14020 Camerano AT, Italia', 44.9907, 8.0879, 17, '', 'Bonifico bancario o contanti', '', '', '', 'Torino, 55 km', '', '', 'Montechiaro d''Asti, 2 km', 'Camerano Casasco, 200 mt', '', 'Camerano casasco, 200 mt', '1', 0, 114),
