hroom, private entrance, terrace-, are furnish with simplicity and taste of the past. In the pleasant stay is possible to consume a rich breakfast prepared with care and taste excellent biological products. Ample parking, garden, forest with secular trees. We offer you relax, splendid nature on the italians Alps, service and structure perfect. Ideal starting point for trekking and mountain bike.', 'A 6 km da Cuneo, immerso Nei castagneti da Frutto, Ideale per Soggiorni di vacanza e / o di Lavoro.\nAll''imbocco delle valli Grana e Stura, offre possibilita di coniugare natura, sport e cultura.\nIn inverno Comodo alle Discesa per Stazioni sciistiche e fondo; Ideale Punto di Partenza per il trekking e cicloturismo sulle Alpi Marittime e Cozie.', '', 'Der Bauernhof, Feiertage ich den König dem Me geben,\n wird die in Grüns eingetaucht, cervaschesi Hügel in herrlichen einer Zona nahe dem IHM Eingang von Korn und geht es Öffnung sie sind und OT wenig Minuti entfernt vom Keil. Zum kleinen Kilometerthermal-und zur sciistiche Dämmerung Saluzzo, Stationen.\n\nDie Räume, unabhängig Bequem von und mit ausgerüstet tana Inneren semplicità Dienstleistungen werden und der Vergangenheit Geschmack versorgt.\n\nangenehmen Im Aufenthalt, reiches den Heilung sich mit Frühstück vorbereitete, möglich ist, um ein zu und zu verbrauchen prelibati Biologische schmecken Produkte.\n', '', 0, 0, 0, 0, 'Via Ubacco, 25, 12010 Cervasca CN, Italia', 44.3759, 7.46371, 12, 'contact  by mail for more info', 'Contatta la struttura per info', '', '', '', 'Cuneo,Levaldigi Airport, 27 Km', 'Torino,Caselle Airport ,136 Km', '', 'Cuneo,6 Km', 'Cervasca,1 km', 'ventimiglia,90 km', 'Cervasca,1km', '1', 0, 116),
(117, 1, 4, 'Villaggio Camping Bazia', 'Contrada Bazia ', '98054', 'Furnari', 3672, 1170, 80, '0941800130', '094181006', 'http://www.www.bazia.it', '', 'Bazia è una struttura turistica completa per trascorrere una vacanza in campeggio o appartamenti , ubicata direttamente sul mare sulla baia del Tindari con un’ampia spiaggia sabbiosa. La struttura si divide in tre parti campeggio, appartamenti e servizi:Il campeggio si estende su una vasta area alberata di eucalipti , dotato di circa 200 piazzole per tende,roulotte e camper. Ogni piazzola è delimitata da alberi e coperta da tende frangisole ,ciascuna con un lavabo autonomo e punto luce . All’interno del campeggio nella zona centrale è ubicato il gruppo di servizi igienici dotati di docce con acqua calda (utilizzo gratuito) e fredda , lavabi esterni per il lavaggio di indumenti , bagno idoneo per persone con disabilità e lavatrici a gettoni.\nAppartamenti: offre diversi tipi di sistemazione monolocali e bilocali in muratura senza aria condizionata , appartamenti bilocali o trilocali con aria condizionata di recente costruzione, tutti con servizi interni e angolo cottura, sistemato in veranda .', '', '', '', '', 'Molto interessante è a 5 km lo Stabilimento Termale di Terme Vigliatore dove si effettuano Cure Termali(fanghi. Aerosol, inalazioni, insufflazioni ecc.) convenzionate con il S.S.N. dietro regolare prenotazione per coniugare il benessere fisico con un soggiorno al mare presso la nostra struttura a prezzi particolari per chi effettua le cure', '', '', '', 0, 0, 0, 0, 'Piazza Papa Giovanni XXIII, 35, 98074 Naso ME, Italia', 38.1204, 14.7865, 17, '', ' \n', '', '', '', 'Reggio Calabria', 'Catania', 'Palermo', 'Novara, Montalbano, Furnari', 'Falcone', 'Sul loco', 'Sul loco', '1', 0, 117),
(118, 4, 0, 'IL Giardino Etrusco', 'via Mazzini 10', '58014', 'Saturnia', 3680, 1168, 80, '3477941074', '', 'http://www.www.termesaturnia.it', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Piazza Vittorio Veneto, 21B, 58014 Saturnia GR, Italia', 42.6632, 11.5043, 17, NULL, NULL, NULL, NULL, NULL, 'Grosseto', 'Fiumicino', 'Firenze', 'Orbetello', 'Saturnia', 'Albinia', 'IL Cantuccio di Anastasia', '1', 0, 118),
(119, 1, 5, 'Agriturismo due papaveri', 'Via Spinzola 42', '41026', 'Pavullo Nel Frignano, Fr. Benedello', 3605, 1173, 80, '+39053622618', '', 'http://www.www.duepapaveri.com', '', 'Agriturismo due papaveri e situata in una splendida posizione nella colline modenesi con una vista mozzafiato. Un eco resort con rispetto per la natura. Abbiamo 4 suite con camini e grandi finestre panoramiche sulla vallata. Ristorante a km 0 e una piscina di 20m esterna sempre con vista. Cerchi il totale relax immersi nella natura, buon cibo e vino e il silenzio vieni da noi. Poi portare anche il tuo cane con te.', '', '', '', '', 'Poi fare yoga o corsi di cucina da noi, trekking a piedi o safari gastronomici nel entro terra con guida privata. Pettinare le nostre capre da cashmer in stagione. Aiutarci a raccogliere la lavanda. Maranello con la Ferrari e vicino. Bologna o Modena città d''arte si raggiungono in poco tempo. Pavullo Nel Fringnano dista 6 km si puo visitare il Castello di Montecuccoli. Abbiamo campi da golf a 15 km, e Cimone 2000m e a mezzo ora di auto. Ma si puo stare anche semplicemente in pace in uno dei nostri daybed a fare il dolce niente magari con un buon bicchiere di vino in mano. A voi la scelta!', '', '', '', 0, 0, 0, 0, 'Via Spinzola, 34, 41026 Pavullo nel Frignano MO, Italia', 44.3678, 10.8625, 17, '', 'Chiediamo il 30% del pagamento per confermare la prenotazione e il saldo 4 settimane prima del arrivo.\nPer cancellazioni fino a 4 settimane non ci sono penali, entro 4 settimane si paga il 30 %, 2 settimane il 50 % e una settimana il intero.\nPagamento con bonifico bancario.', '', '', '', 'Bologna Marconi 60 km', 'Milano Malpensa 250 km', 'Pisa 200 Km', 'Modena ', '7 km Pavullo nel Frignano', 'Ravenna 150 km', 'Nel Agriturismo ', '1', 0, 119),
(120, 7, 0, 'Residenza Borgo 27', 'via Borgo n. 27', '37023', 'Grezzana', 3698, 1157, 80, '+390458650949', '+390458657004', 'http://www.www.borgo27.it', '', 'La dimora nasce alla fine dell''800 come residenza estiva della famiglia Bertani, un piccolo gioiello incastonato ai piedi della Lessinia, in una straordinaria posizione panoramica.\n\nOra come allora, si respira un’atmosfera di altri tempi in tutti gli ambienti, nelle Suite, nei saloni e nel giardino con vista sulla Valpantena.\n\nRinnovata di recente, ha sempre mantenuto la sua eleganza semplice e raffinata, lo stile misurato, gli arredi originali.\n\nLe 12 suite realizzate, tutte completamente diverse tra loro, si presentano con mobili e suppellettili dell''epoca e permettono ancora oggi un gradevole viaggio attraverso la storia. \n', '', '', '', '', 'Durante il vostro soggiorno potete visitare:\n\nVilla Arvedi\nVilla Mosconi Bertani\nIl Parco Naturale Regionale della Lessinia\nLe cascate di Molina\n\n', '', '', '', 0, 0, 0, 0, 'Via Borgo, 26-28, 30020 Noventa di Piave VE, Italia', 45.6612, 12.5284, 17, '', 'Sono valide tutte le Carte di Credito, bancomat, bonifici bancari, assegni, contanti', '', '', '', 'Valerio Catullo Villafranca Verona, 30 km', '', '', 'Stazione Verona Porta Nuova, 14 km', 'Fermata autobus 100 mt', '', 'Ristorante più vicino 1 km', '1', 0, 120),
(121, 7, 0, 'Esagono Monello', 'Via Procida, Cortile Rametta 6', '96017', 'Avola', 3675, 1170, 80, '+393287338792', '', 'http://www.esagonomonello.it', '“L’Esagono” is a nice and cosy family-run Room & Breakfast where you will find a warm and genuine welcome.\n \n “L’Esagono” is a two floors palace, built at the beginning of 1800, recently redecorated following the original style and with the ancient facade.\nThe name “L’Esagono” (The Hexagon) comes from the ancient hexagonal layout of the town, with a big square in the center and four lateral squares. \n\nSituated in the centre of the hexagon, close to the central square and beside the main street, the building is airy and noiseless, because it overlooks one of the many typical “cortili” (courtyards) of the city. \nAll the rooms have big windows and a balcony, and air conditioning.\nThe building has 4 double rooms, a walking on kitchen, a big living room, 4 bathrooms and 4 balconies.\nIt is possible to rent rooms separately or to rent the whole building.\nAll the rooms have air conditioning, Internet connection (on request), telephone. Each bathroom has a shower unit and hot water.\n\nGROUND FLOOR On the round floor there are a big kitchen, a wide living room, a small bathroom and a big double bedroom (room n.1) with a bathroom inside.\n\nFIRST FLOOR On the first floor there 3 bedrooms and an additional bathroom: room n.2: very big double bedroom with balcony and bathroom room n.3: large double bedroom with balcony (with shared bathroom) room n.4: normal double bedroom with balcony (with shared bathroom)\n', 'L’Esagono Monello è una struttura sita in una palazzina dei primi dell’800 composta da un salone doppio, cucina ampia (20mq), bagno di servizio e 4 stanze da letto molto ampie e comode, due con bagno in camera e due con bagno in condivisione.\nUna stanza da letto è al piano terra, le altre tre stanze sono al primo piano e hanno tutte un balcone. Ogni vano della casa ha un condizionatore.\n \nStanza n.1 – doppia con bagno privato\n1 letto matrimoniale, doccia, servizi, aria condizionata\nStanza n.2 – quadrupla con bagno privato\n1 letto matrimoniale, 2 letti singoli (possibilità di aggiungere 1 letto singolo), doccia, servizi, aria condizionata, balconcino sui tetti della cittadina.\nStanza n.3 – doppia\n1 letto matrimoniale (possibilità di aggiungere 1 letto singolo), bagno esterno (ampio, con doccia e servizi) in condivisione con la stanza n.4, aria condizionata, balconcino sui tetti della cittadina.\nStanza n.4 – doppia\n1 letto matrimoniale (possibilità di aggiungere 1 letto singolo), bagno esterno (ampio, con doccia e servizi) in condivisione con la stanza n.3, aria condizionata, balconcino sui tetti della cittadina.\n \nLa casa, che è stata ristrutturata completamente, ma lasciando la facciata dell''800, è proprio nel centro storico di Avola, in Sicilia, il paese delle mandorle e del nero d''Avola.\nÈ al riparo dai rumori perché, come le case signorili di un tempo, dà su un cortile interno, dove si puó parcheggiare gratis, proprio accanto al Corso principale.\n', '', '', '', 'The nearest beaches are 800 mt far from the house, both walking and biking distance.\nFew km far away there are marvellous touristic sites: \nVendicari''s Natural Reserve;\nNoto, delicious baroque town with a the famous ancient cathedral, the magnificent theater, and the characteristic historical center routes;\nMarzamemi, with the nice fisherman village, still the same after centuries;\nSyracuse and its ancient Greek Teather and Arethusa Font.\nSicily, and this area in particularly, is a beautiful land, rich of natural, artistic and historical attractions.\n\n', 'Il mare è a circa 800mt, ci si può andare anche a piedi o meglio ancora in bici.\nA qualche chilometro di distanza, località turistiche letteralmente mozzafiato, dalla riserva naturale di Vendicari; alla Noto barocca con il teatro comunale, il centro storico abbarbicato e la famosa cattedrale crollata nel 1990 ed ora ristrutturata; al porticciolo dei pescatori di Marzamemi; al Teatro Greco e alla fonte Aretusa di Siracusa. È un territorio ricco di bellezze naturali e architettoniche, di cultura e di arte.', '', '', '', 0, 0, 0, 0, 'Cortile Toscano, 2, 96012 Avola Province of Syracuse, Italy', 36.9083, 15.1325, 16, 'Pet are not allowed.\nSmoking is allowed only on balconies.\n\n- DIRECTIONS -\nHOW TO GET HERE:\n\nBY TRAIN:\n“L’Esagono” is 400mt far from Avola’s train station.\nThere is a direct connection from/to Syracuse.\n\nBY BUS\nThe bus companies are two: Interbus, AST, they connect many towns around Sicily.\nThe nearest bus stop is 400mt far away from “L’Esagono”.\n\nBY CAR\nLook for “Via Procida, Avola, Siracusa” in Googlemaps:\nhttp://maps.google.it/\n\nWHERE WE ARE\nL’Esagono\nVia Procida, cortile Rametta n. 6\n96017 Avola (Siracusa)\nMobile: +39 328 7338792\nMobile: +39 328 8960926\n\n', 'Animali non ammessi.\nE'' consentito fumare solo sui balconcini.\n\n\nCOME RAGGIUNGERCI:\nIN TRENO:\n“L’Esagono” si trova a 400mt di distanza dalla Stazione di Avola. C''è un collegamento diretto con la Stazione di Siracusa.\n\nIN PULLMAN (linea di trasporti pubblica)\nSi può arrivare ad Avola con due diverse compagnie di trasporto pubblico:  Interbus e AST, che collegano Avola a quasi tutte le cittadine della regione.\nSi consiglia di controllare gli orari sui rispettivi siti web delle compagnie o presso un''agenzia di viaggi.\nLa fermata più vicina si trova a meno di 200 mt di distanza da "L''Esagono".\n\nIN AUTOMOBILE\nCercare “Via Procida, Avola, Siracusa” su Googlemaps:\nhttp://maps.google.it/\n\nDOVE SIAMO\nL’Esagono\nVia Procida, cortile Rametta n. 6\n96017 Avola (Siracusa)\nMobile: +39 328 7338792\nMobile: +39 328 8960926\n\n', '', '', '', 'Aeroporto di Catania - Fontanarossa - Vincenzo Bellini (LICC)', 'Aeroporto di Trapani - Birgi - Vincenzo Florio (LICT)', 'Aeroporto di Palermo - Falcone e Borsellino (Punta Raisi) (LICJ)', 'Avola, Siracura', 'Avola', 'Avola', 'La Taverna del Pescatore, Avola', '1', 0, 121),
(122, 5, 0, 'Agriturismo Ciato', 'strada Pilastro 8', '43124', 'Panocchia', 3606, 1173, 80, '+390521630082', '', 'http://www.ciato.it', 'Between farms most beautiful and evocative of Parma from the point of view of geographic location (we are at the beginning of sweet foothills) Ciato, is surrounded by fields of tomatoes, onions, alfalfa and a large vegetable garden where they find the right home herbs.\n\nWhat in fact distinguishes this company is the passion and the tenacity with which the holders have "taken over" the natural and cultural riches of the valley, and the ability to transmit this passion to the guests, helping them rediscover all the realities of land along an ideal route "from farm to fork."', 'Fra le aziende agricole più belle e più suggestive del parmense dal punto di vista della posizione geografica (siamo all''inizio della dolcissima pedemontana) Ciato, è circondata da campi di pomodoro, cipolla, erba medica ed un ampio orto in cui trovano giusta dimora le officinali.\n\nQuello che infatti contraddistingue questa azienda è la passione e la tenacia con cui i titolari si sono "impadroniti" delle ricchezze ambientali e culturali della vallata; e la capacità di trasmettere questa passione agli ospiti, facendo riscoprire tutte le realtà del territorio lungo un itinerario ideale "dalla terra alla tavola".\n\n', '', 'Zwischen Bauernhöfen schönsten und eindrucksvollsten von Parma aus der Sicht der geographischen Lage (wir sind am Anfang süß Ausläufern) Ciato, ist umgeben von Feldern mit Tomaten, Zwiebeln, Luzerne und einem großen Gemüsegarten umgeben, wo sie das richtige Zuhause finden Kräuter.\n\nWas in der Tat unterscheidet das Unternehmen ist die Leidenschaft und die Hartnäckigkeit, mit der die Inhaber der natürlichen und kulturellen Reichtümer des Tales, und die Fähigkeit, diese Leidenschaft, um die Gäste zu übertragen haben "übernommen" und hilft ihnen lerne alle Realitäten des Landes entlang einer idealen Route "from farm to fork".', '', 'Find it all on our website under the heading neuw', 'Trovi tutto sul nostro sito alla voce neuw', '', 'Finden Sie es auf unserer Webseite unter der Rubrik neuw', '', 0, 0, 0, 0, 'Strada Pedemontana, 27-31, 43124 Parma PR, Italia', 44.6749, 10.3045, 15, '', '', '', '', '', 'Parma', 'Bologna', 'Milano', 'Parma', '12', 'cinque terre', 'in loco', '1', 0, 122),
(123, 5, 0, 'Cuore Verde', 'via Chiona 2', '06038', 'Spello', 3690, 1163, 80, '+390742301326', '+390742652346', 'http://www.www.cuoreverdeumbria.it', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Via Circonvallazione, 06038 Spello PG, Italia', 42.998, 12.6934, 16, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 0, 123),
(124, 7, 3, 'Case Borgo vacanze ', 'via Roma 1 Letojanni ', '98037', 'Letojanni ', 3672, 1170, 80, '+39942652151', '+39942652151', 'http://www.caseborgovacanze.it', 'The four apartements ((Hibiscus,Bouganville ,Mimosa  e Zagara )are located in Letojanni the old fisherman''s close to Taormina only 6km .\nThe apartements is at only 40 meters from the beach .\nApartement Bouganville  is located in first level it is  completly furnished :1 double room whit  air conditioning ,1 bathroom whit shower, hair dreyer ,and a living room sea view with  kitchen whit  two  sofa beds and air conditioning tv sat,swashing maschine ,\nand beautifull balcony  whit table and chairs .\nApartement Hibiscus is located in first level it is  completly furnished :1 double room whit  air conditioning ,1 bathroom \nwhit shower, hair dreyer ,and a living room with  kitchen whit  two  sofa beds and air conditioning tv sat,swashing maschine ,and beautifull \nbalcony  whit table and chairs .\n\nApartement Mimosa  is located in second level it is  completly furnished :1 double room whit  air conditioning ,1 bathroom \nwhit shower, hair dreyer ,and a living room with  kitchen whit  two  sofa beds and air conditioning tv sat,swashing maschine ,and beautifull \nbalcony  whit table and chairs .\nApartement Zagara  is located in  second  level it is  \ncompletly furnished :1 double room whit  air conditioning ,1 \nbathroom whit shower, hair dreyer ,and a living room sea view with  kitchen \nwhit  two  sofa beds and air conditioning tv sat,swashing maschine ,\nand beautifull balcony  whit table and chairs .\n', 'Gli appartamenti (Hibiscus,Bouganville ,Mimosa  e Zagara ) sono ubicati nello stesso immobile nel centro di Letojanni a soli 40metri dalla spiaggia , Letojanni è un villaggio di pescatori a soli 5km da Taormina .\nHibiscus 1°piano 50mq,è un appartamento molto  luminoso costituito da soggiorno climatizzato con due divani letto per due\npersone, tv  satellitare, cucina a parete con piano cottura a quattro fuochi , frigorifero e piccolo congelatore, attrezzata di stoviglie, piatti e  pentole, lavatrice, camera \nmatrimoniale climatizzata, bagno con doccia. Balcone con tavolo e sedie \nBouganville 1° piano 55mq ,è un  appartamento molto  luminoso costituito da ampio ingresso soggiorno climatizzato ,con due divani letto per due persone, tv satellitare, cucina a parete con piano  cottura a quattro fuochi,frigorifero e piccolo congelatore, attrezzata di stoviglie, piatti e\npentole, lavatrice, camera matrimoniale climatizzata, bagno dotato di  antibagno e doccia . Due balconi, uno piccolo con\nvista nella via più antica del paese , l''altro balcone dotato di sedie e tavolo .\n\nMimosa 2 °piano 50mq,è un appartamento molto  luminoso costituito da soggiorno climatizzato con due divani letto per due\npersone, tv  satellitare, cucina a parete con piano cottura a quattro fuochi ,  frigorifero e piccolo congelatore, attrezzata di stoviglie, piatti e  pentole, lavatrice, camera \nmatrimoniale climatizzata, bagno dotato di antibagno e doccia ,balcone dotato di sedie e tavolo .\nZagara 2° piano 55mq ,è un  appartamento molto  luminoso vista mare dalla\ncucina soggiorno costituito da ampio ingresso soggiorno climatizzato ,con due divani letto per due persone, tv satellitare, cucina a parete con piano  cottura a quattro fuochi,frigorifero e piccolo congelatore, attrezzata di stoviglie, piatti e\npentole, lavatrice, camera matrimoniale climatizzata, bagno dotato di  antibagno e doccia . Due balconi, uno piccolo con\nvista nella via più antica del paese , l''altro balcone dotato di sedie e tavolo .\n', '', '', '', 'The apartement Zagara is good located is all close :grocery store ,bar ,restaurant ,gelateria ,coffy bar ,pizzeria ,pubblic transfer . \nThe apartement  is good located for relax , beach ,sea ,centre for shop ,is close to  Taormina and is near at motorway  (at 3km)\nIn this area  you have morer site of interesting :Taormina Etna ,Golf ,Giardini Naxos, falls Alcantara ,Catania ,Agrigento , Siracusa ,Modica ,Ragusa ,Palermo\n', 'Oltre al mare e al sole ,la zona è fornita di bar ,gelaterie ,pizzeria ,ristoranti ,pub ,si puo'' raggiungere facilmente Taormina ,Giardini Naxos ,Etna le Gole d''Alcantara ,Acireale ,Catania ,Siracusa ,\nModica ecc.', '', '', '', 0, 0, 0, 0, 'Via Roma, 1, 98037 Letojanni ME, Italia', 37.883, 15.3099, 17, ' If the client cancels or shortens his/her stay after the deposit has been paid, there will be no reimbursement. \nPayment Upon booking Note: Payment of 30% of the total amount is required to confirm your reservation and must be forwarded as confirmation deposit. . \n', 'ALLA PRENOTAZIONE La caparra viene effettuata con acconto tramite carta di credito del 30% sul costo del soggiorno\nSi prega sempre di specificare nella Causale del versamento la data di arrivo e di partenza\nNota per i clienti: nel caso il cliente disdica o abbrevi il soggiorno non ha diritto ad alcun rimborso.\n\n\n', '', '', '', 'Catania 55Km ', 'Palermo 220', 'Reggio Calabria 60km ', 'Taormina-Giardini Naxos 5km ', '0,30 metri Letojanni ', '0,30 metri ', '0,60 metri ', '1', 0, 124),
(125, 5, 0, 'Casa di Campagna La Scortica', 'via marco federici 25', '19020', 'Beverino', 3622, 1167, 80, '3496641086', '', 'http://www.www.lascortica.com', 'Behind the famous 5 Terre is the result of 20 years this small paradise, family-run for Antonella and her son James. As welcome as we advise you to better organize your days, waiting until the evening when you get home with delicious dinners prepared exclusively with local products.\nA sweet awakening in the morning with a hearty breakfast of bread, focaccia, cakes and homemade jams and then back to "march".\nOutside plenty of space for relaxing, furnished with deckchairs, tables for picnics and large playground for the little ones.\nThe locations like 5 Terre, Portovenere, Lerici, Tellaro, are all easily accessible, just 20 minutes by car.\nTo those who want to recharge a bit of good energy, this is the ideal place.', 'Alle spalle delle famose 5 Terre nasce da ben 20 anni questo piccolo paradiso, gestito in famiglia da Antonella e il figlio Giacomo.  Dato il benvenuto vi consigliamo come poter organizzare al meglio le vostre giornate, fino ad aspettarvi la sera al vostro rientro con gustose cene preparate esclusivamente con prodotti locali tipici.\nAl mattino un dolce risveglio con la ricca colazione a base di pane, focaccia, torte e marmellate di produzione propria e poi di nuovo in "marcia".\nAll''esterno tanto spazio per il relax, arredato con sdraio prendisole, tavoli per pic-nic, e grande parco giochi per i più piccoli.\nLe località come 5 Terre, Portovenere, Lerici, Tellaro, sono tutte facilmente raggiungibili, a soli 20 minuti di auto.\nA chi vuol ricaricare un po di buona energia, questo è il posto ideale.', '', '', '', 'The places to visit are endless veramene, famous 5 Terre, with its terraced vineyards overlooking the sea, following Portovenere other place of great charm with its views of the sea, Lerici with its beautiful beach for children, Tellaro with the famous "legend of the octopus", which we''ll tell you, and trespass in Tuscany with the marble quarries of Carrara and visited the lard to taste.\nSome excursions can be made by sea, boats leave from the promenade of La Spezia, or with small boats.', 'I luoghi da visitare sono veramene infiniti, le famose 5 Terre, con i suoi vigneti terrazzati a picco del mare, in seguito Portovenere altro posto di notevole incanto con i suoi scorci sul mare, Lerici con la sua bella spiaggia per i più piccoli, Tellaro con la famosa "leggenda del polpo" che vi racconteremo, e sconfiniamo in Toscana con le Cave di marmo di Carrara visitabili e il lardo di Colonnata da degustare.\nAlcune escursioni si possono fare via mare, partono i battelli dal lungomare di La Spezia, oppure con piccole imbarcazioni.', '', '', '', 0, 0, 0, 0, 'Via Marco Federici, 31-33, 19122 La Spezia SP, Italia', 44.113, 9.81111, 17, 'On booking we require a deposit of 40% on this stay by bank transfer, partially refundable 50% cancellation 7 days prior to arrival.\nUpon check-in the balance in cash, we do not have credit card service.\nThe dinners are a part of the reservation and are welded on the evening before departure.', 'Alla prenotazione si richiede una caparra del 40% sul soggiorno con bonifico bancario, restituibile in parte 50 % con cancellazione 7 gg prima dell''arrivo.\nAl check-in il saldo in contanti, non abbiamo servizio di carta di credito.\nLe cene sono a parte sulla prenotazione e si saldano la sera prima della partenza.', '', '', '', 'Pisa', 'Genova', 'Firenze', 'La Spezia', '700mt', '15 km', 'è nella struttura e a soli 12 km sempre nostro ristorante " ristorantino di Bayon" specialità pesc', '1', 0, 125),
(126, 5, 0, 'Agriturismo Casa Rosa', 'Via Tesino 243/B', '63073', 'Offida', 3637, 1162, 80, '+393208113982', '+390736880875', 'http://www.agriturismocasarosa.it/', '', 'C''é un agriturismo a Offida, uno dei "Borghi più belli d''Italia", pensato per chi cerca la tranquillità e ama farsi coccolare dalla Natura. L''Agriturismo Casa Rosa, adagiato tra le colline, a 15 minuti dall''Adriatico, a mezz''ora dai Monti della Laga e dai Monti Sibillini.\n\nGestito dalla famiglia Angelini, l''Agriturismo Casa Rosa é una antica casa colonica che deve il suo nome al colore che ha sempre contraddistinto il casolare. Immerso in un bosco di querce, gode di un bellissimo panorama sulle colline del Piceno e soprattutto di un silenzio invidiabile che fa apprezzare al meglio i suoni dimenticati della natura: il fruscio delle foglie, il verso degli uccelli, il belare delle caprette...\n\nLa struttura offre 6 stanze, di cui una interamente attrezzata per disabili, dotate di bagno autonomo, asciugacapelli, tv, frigobar e convettori termici indipendenti. La colazione, abbondante e del tutto genuina, si serve al piano terra in un''ampia sala comune.\n\nLa proprietà dispone anche di alcuni appartamenti di varie metrature, poco distanti dall''agriturismo, che si possono affittare tutto l''anno.\n\nGli ospiti potranno assistere alla raccolta dell''uva e delle olive e partecipare a mini-attività didattiche, quali la preparazione e la cura dell''orto, la preparazione delle conserve e delle ricette tipiche locali, ed acquistare i prodotti dell''azienda agricola come l''olio extravergine, frutta, pomodori, melanzane, patate ecc...\n\nL''Agriturismo Casa Rosa vi aspetta a Offida per regalarvi un pezzo di Natura, con una sorpresa-omaggio dell''azienda agricola per tutti i clienti! ', '', '', '', '', 'L''agriturismo spunta tra le colline che circondano Offida. Il centro storico del paese dista 2 Km. Il paese è rinomato per la preziosità dei palazzi del centro, la tradizione del merletto a tombolo e il carnevale storico. Le spiagge di San Benedetto del Tronto e Grottammare sono 15 Km, Ascoli a 20 Km. A 30-40 Km dalla Casa Rosa si trovano suggestive località montane (Comunanza, Amandola), punto di partenza per la visita del Parco dei Monti Sibillini.\nNei dintorni della Casa Rosa ci sono numerosi borghi medievali che meritano di essere visitati, Ripatransone, Cossignano, Acquaviva Picena, solo per citarne alcuni nel raggio di 10-15 Km di distanza.\nGli aeroporti più vicini sono quelli di Ancona e Pescara, entrambe a circa 100 Km di distanza.', '', '', '', 0, 0, 0, 0, 'Via Tesino, 4, 63074 San Benedetto del Tronto AP, Italia', 42.9051, 13.8871, 17, '', 'Il prezzo comprende: pernottamento e prima colazione, ampio e comodo parcheggio (non custodito), uso dei prodotti del nostro orto, possibilità di ospitare animali, purché di piccola taglia e segnalati all’atto della prenotazione.\né consentito l''uso del porticato, del gazebo, e degli spazi circostanti l’agriturismo.\nLa camera al piano terra è dotata di bagno e doccia attrezzati per soggetti con difficoltà motorie.\nIl prezzo del letto aggiunto è di 15 euro/notte.\nI prezzi possono subire delle variazioni durante l''anno grazie a frequenti offerte. \nAlla conferma della prenotazione si richiede un anticipo pari al 50% del prezzo dell''intero soggiorno, a mezzo bonifico bancario. Il saldo avverrà in contanti o tramite assegno al termine del soggiorno.', '', '', '', 'Pescara, circa 100 Km', 'Ancona, circa 100 Km', 'Roma Fiumicino, 300 Km', 'San Benedetto del Tronto, 15 Km', 'Offida, 1 Km', 'Grottammare, 15 Km', 'Ristorante Caroline, 1 Km', '1', 0, 126),
(127, 5, 2, 'Conca Marina s.a.s di Cuccu Paolo & C.', 'Loc. Conca Marina Km.2,5 s.s.133 Tempio-Palau', '07029', 'Tempio Pausania', 3667, 1172, 80, '+393384117667', '', 'http://www.www.concamarina.it', 'Conca Marina is close to close to Tempio and close to the most characteristic of Gallura. The property is located within a park of about three acres of woodland. It ''a reserved place, ideal for nature lovers and its surrounding silence. All 7 rooms have their own entrance and are equipped with private bathrooms, heating and / or air conditioning and TV. The barbecue is outside with granite tables for pleasant evenings. The area also has convenient parking and a tennis court private.', 'Conca Marina è a ridosso vicino di Tempio Pausania  e vicino ai centri più caratteristici della Gallura. La struttura si trova all''interno di un parco di circa tre ettari di bosco . E'' un luogo riservato, ideale per immergersi nella natura e nel suo silenzio circostante. Tutte le 7 camere hanno ingresso indipendente e sono dotate di servizi privati, riscaldamento e/o aria condizionata e TV. Il barbecue è all''esterno con tavoli in granito per piacevoli serate. L’area dispone inoltre di comodi parcheggi e di un campo privato da tennis. ', '', 'Conca Marina in der Nähe von Tempio schließen und in der Nähe der charakteristischsten Gallura. Das Anwesen liegt in einem Park von etwa drei Hektar Wald gelegen. Es ist ein reservierter Platz, ideal für Naturliebhaber und seine Umgebung Stille. Alle 7 Zimmer haben einen eigenen Eingang und sind mit eigenem Bad, Heizung und / oder Klimaanlage und TV ausgestattet. Der Grill ist außen mit Granit-Tische für gemütliche Abende. Das Gebiet hat auch günstige Parkplätze und einen privaten Tennisplatz.', '', '', 'Nei dintorni sono tanti gli svaghi da poter soddisfare: equitazione, escursioni a piedi, in quad e in fuoristrada, trekking, percorsi guidati in mountain bike e le inarrivabili tratte con le vecchie locomotive del Trenino Verde.', '', '', '', 0, 0, 0, 0, 'Circonvallazione San Giuseppe, 07029 Tempio Pausania OT, Italia', 40.9228, 9.09385, 15, '', '', '', '', '', 'Olbia Costa Smeralda 45 Km.', '', '', '', '', 'Isola Rossa 30 Km.', '', '1', 0, 127),
(128, 5, 0, 'casalicchio', 'contrada casalichio', '92022', 'Cammarata', 3668, 1170, 80, '0922908144', '0922908144', 'http://www.www.casalicchio.info', '', 'L''AZIENDA PRENDE IL NOME'''' CASALICCHIO''''DALL''ONONIMO FEUDO APPARTENENTE ALLA FAMIGLIA DEGLI ATTUALI PROPIETARI 1816.\nDALL''AGRITURISMO è POSSIBILE VISITARE FACILMENTE LUOGHI DI GRANDE INTERESSE CULTURALE:VALLE DEI TEMPLI,IL CASTELLO DI CHIARAMONTANO A MUSSOMELI,LA RISERVA NATURALE DI MONTE CAMMARATA,GLI ARCHI DI PANE A SAN BIAGIO PLATANI ED ALTRO.\nIL CASALICCHIO OFFRE CAMERE SPAZIOSE E BEN ARREDATE DOTATE DI CLIMATIZZATORI ,TV SATELLITARE,SERVIZI CON DOCCIA O VASCA IDROMASSAGGIO,INOLTRE SI POSSONO PRENOTARE APPARTAMENTINI COMPLETI DI ANGOLO COTTURA E SERVIZI .\n-IL RISTORANTE PROPONE PIATTI TIPICI DELLA CUCINA TIPICA SICILIANA.\nNELLA STRUTTURA POTETE TROVARE CAMPO DA TENNIS,PISCINA CON IDROMASSAGGIO,SALA LETTURA,BILIARDO,PARCO GIOCHI,TREKKING,ESCURSIONI ORGANIZZATE,PARCHEGGIO CUSTODITO SONO A DISPOSIZIONE DEI CLIENTI.\nWWW.CASALICCHIO.INFO\n', '', '', '', '', 'DAS UNTERNEHMEN nimmt den Namen'''''''' Casalicchio DALL''ONONIMO aus der Familie Fehde derzeitigen Eigentümern 1816.\nVon der Farm können Sie leicht Orte von kulturellem Interesse: Tal der Tempel, die Burg von A Mussomeli Chiaramonte, NATURSCHUTZGEBIET MONTE CAMMARATA, die Bögen der BREAD in San Biagio Platani AND MORE.\nDIE Casalicchio bietet geräumige und gut eingerichtete Zimmer mit Klimaanlage, Sat-TV, Bad oder Whirlpool, können Sie auch BUCHEN FLATS komplette Küche und SERVICES.\n-Das Restaurant bietet die typische sizilianische Küche.\nDie Struktur kann FIND TENNISPLATZ, SCHWIMMBAD, Lesesaal, Schwimmbad, Spielplatz, TREKKING, TOURS, Parkplatz steht den Kunden ist.\nWWW.CASALICCHIO.INFO\n', '', '', '', 0, 0, 0, 0, 'Via Luigi Pirandello, 92100 Agrigento AG, Italia', 37.3111, 13.5765, 17, '', 'THE COMPANY TAKES THE NAME'''''''' CASALICCHIO DALL''ONONIMO BELONGING TO THE FAMILY FEUD OF CURRENT OWNERS 1816.\nFrom the farm you can easily visit places of cultural interest: Valley of the Temples, THE CASTLE OF A MUSSOMELI Chiaramonte, NATURE RESERVE OF MONTE CAMMARATA, THE ARCHES OF BREAD IN SAN BIAGIO PLATANI AND MORE.\nTHE CASALICCHIO OFFERS SPACIOUS AND WELL FURNISHED ROOMS EQUIPPED WITH AIR CONDITIONER, SATELLITE TV, BATHROOM OR JACUZZI, YOU CAN ALSO BOOK FLATS COMPLETE KITCHEN AND SERVICES.\n-THE RESTAURANT OFFERS THE TYPICAL SICILIAN CUISINE.\nTHE STRUCTURE CAN FIND TENNIS COURT, SWIMMING POOL, READING ROOM, POOL, PLAYGROUND, TREKKING, TOURS, PARKING IS AVAILABLE TO CUSTOMERS.\nWWW.CASALICCHIO.INFO\n', '', '', '', 'palermo -puntarais, falcone borsellino , km 95 km', 'Catania , fontana rossa , 130 km ', '', 'Cammarata- (agrigento -palermo), 7 km', 'castronovo di sicilia -cammarata-(motel san pitro autogrill)', 'agrigento', 'casalicchio', '1', 0, 128),
(129, 5, 0, 'AGRITURISMO ACQUAFREDDA', 'Via Policeta', '84030', 'San Rufo', 3600, 1155, 80, '+390975395532', '+390975395288', 'http://www.agriturismoacquafredda.it', 'The Farm Acquafredda is inserted in the beautiful unspoiled scenery of the National Park of Cilento and Vallo di Diano. Have special accommodations made by the renovation of a typical stone farmhouse and has a warm family welcome and comfortable hospitality. But in addition to the tranquility of the place and the unique characteristics of the structure, placing a major responsibility of the kitchen which offers even as the main pivot of: strictly traditional, genuine and full of flavor forgotten. Is it truly the ideal place to spend a relaxing holiday, quiet and close contact with nature. What are you waiting, come and visit us! Phone 0975395532 Mobile 3386875364', 'L''Agriturismo Acquafredda è inserito nel splendido scenario incontaminato del Parco Nazionale del Cilento e Vallo di Diano. Dispone di particolari alloggi ricavati dalla ristrutturazione di un tipico casale in pietra e si avvale di una calda accoglienza familiare e una confortevole ospitalità. Ma oltre alla suggestività del posto e alle caratteristiche singolari della struttura, una collocazione di primo piano spetta alla cucina che si offre addirittura come il perno principale dell''attività: prettamente tradizionale, genuina e ricca di sapori dimenticati. Rappresenta davvero il luogo ideale dove trascorrere una vacanza all''insegna del relax, della tranquillità e del contatto stretto con la natura. Che aspetti, vieni a trovarci! Tel 0975395532 Cell. 3386875364', '', 'Die Farm Acquafredda in die schöne, unberührte Landschaft des Nationalpark Cilento und Vallo di Diano eingefügt. Hat eine Vielzahl an Unterkünften, von der Renovierung eines typischen Steinhaus erstellt und verwendet eine warme familiäre Atmosphäre und komfortable Gastlichkeit. Aber neben der Ruhe des Ortes und den einzigartigen Eigenschaften der Struktur, einen Platz im Vorfeld der Küche, die auch als wichtigster Pivot der Tätigkeit bietet: rein traditionellen, echten und voller vergessenen Aromen. Ist es wirklich der ideale Ort für einen erholsamen Urlaub, ruhig und engen Kontakt mit der Natur zu verbringen. Worauf wartest du noch, kommen Sie und besuchen Sie uns! Tel 0975395532 Handy 3386875364', '', '', 'San Rufo, in provincia di Salerno sorge tra i monti Spina dell''Ausino e Cucuzzo delle Puglie.Ancora oggi il paese costituisce via di passaggio fra il Vallo di Diano e la Valle del Calore Salernitano, dove sorgeva l''antica Paestum. Le notizie sulle origini San Rufo non sono certe e buona parte degli storici le fa risalire al XIII secolo, quando Gubello Pellegrino edificò una chiesa in onore di S. Rufo III vescovo di Capua. Come altri piccoli paesi di questa zona, il territorio vede la prevalenza di vegetazione arborea. Oltre al caratteristico centro storico, a San Rufo possiamo ammirare:La Chiesa Parrocchiale, di antica fondazione, conserva al suo interno numerose opere di artisti locali;Alcuni ruderi dell''antico castello che possono essere ammirati nella parte antica del paese', '', '', '', 0, 0, 0, 0, 'Contrada Acqua Fredda, 53, Parco Nazionale del Cilento, Vallo di Diano e Alburni, 84030 San Rufo SA, Italia', 40.4162, 15.4618, 17, '', '', '', '', '', 'Salerno 100 Km', 'Napoli 200', '', 'Battipaglia 70 Km', '2 Km', '40 Km', 'interno', '1', 0, 129);
