(130, 5, 2, 'LE TRE STELLE', 'via fonte di campaino 17/b', '53037', 'san benedetto', 3687, 1168, 80, '+393477043536', '', 'http://www.www.letrestelle.com', '', 'Camere con bagno e tv.Servizio Ristorante con possibilitàdi fare colazione e cena a base di prodotti tipici.Piccoli animali da cortile degustazione e vendita vino ed olio.Parcheggio gratuito e piscina.internet wi-fi gratuito', '', '', '', '', 'certlaldo 2 km/San gimignano 8km/Volterra 25 km/Siena35 km/firenze 40 km facilmente raggiungibile con treno dalla stazione di Certaldo', '', '', '', 0, 0, 0, 0, 'Via Fonte Campaino, 17B, 53037 Badia A Elmi SI, Italia', 43.5339, 11.0341, 17, '', '30% acconto totale vacanze con bonificio/vaglia postale o paypal\nresto alla vs partenza in contanti carta di credito e bancomat', '', '', '', 'Firenze Peretola,40km', 'Pisa Galilei   ,80km', '', 'Certaldo 2km', 'Certaldo 2km', 'Vada 80 km', 'in azienda', '1', 0, 130),
