(134, 5, 3, 'Agriturismo Monti Sibillini Camperato', 'Via Campiana,1', '06047', 'Preci-Corone', 3690, 1163, 80, '+390743939033', '+390743939033', 'http://www.agriturismocamperato.it', 'In the immediate vicinity of Norcia, Castelluccio di Norcia, Visso, Nera Valley, Valcastroriana, Cascia, Spoleto ...\n\n\nThe Farm\n\nA cozy rustic-looking structure offers the possibility to spend quiet hours in rooms equipped with all comforts and furnished with period furniture.\nThe Company\n\nThe company Agriculture - Livestock - Organic "Monti Sibillini Camperato" consists of a typical rural building re-cently renovated, while retaining its original architectural features, and accessory farm. The property is about 18 acres, and is divided among the woods, from which truffles and walnuts, and UAA (Utilised Agricultural Area) designed with grains, forage and sunflower alternated. >>>\n\n\nPrices\n\nAll prices are per night with breakfast included: >>>\n\n• Price per person: from a minimum of € 25.00 to a maximum of 40.00 €\n• Single room: from a minimum of € 29.00 to a maximum of 39.00 €', 'Nelle immediate vicinanze di Norcia, Castelluccio di Norcia, Visso, Valnerina, Valcastroriana, Cascia e Spoleto...\n\n\nL''Agriturismo\n\nUn''accogliente struttura dall''aspetto rustico offre la possibilità di trascorrere ore serene in camere dotate di tutti i confort e arredate con mobili in stile.\nL''Azienda\n\nL''azienda Agraria - zootecnica - biologica "Monti Sibillini Camperato" è costituita da un tipico edificio rurale recente-mente ristrutturato, mantenendo comunque le caratteristiche architettoniche originarie, e da accessorio agricolo. La proprietà è di circa 18 ettari, ed è ripartita tra boschi, da cui provengono tartufi e noci, e SAU (Superficie Agricola Utilizzata) destinata a cereali, foraggere avvicendate e girasole.>>>\n\n\nI Prezzi\n\nTutti i prezzi si intendono al giorno con prima colazione inclusa:>>>\n\n•Prezzo a Persona: da un minimo di 25,00 € a un massimo di 40,00 €\n•Camera Singola: da un minimo di 29,00 € a un massimo di 39,00 €\n', '', '', '', '  In a small town on the outskirts of the National Park of Monti Sibillini, a good starting point to explore the many riches of the land, the farm Monti Sibillini Camperato is ideal for relaxing and lounging, perhaps exploring the spaces where there is the normal activity the farm, or strolling in the garden, or exploring the immediate surroundings by hiring a bike for nice excursions, or to stroll along the nearby forest trails. There are countless excursions departing from the farm, the trails meander through the Monti Sibillini National Park, tours for everyone. You can bike, on foot, with mules organize walks of life from 1 hour to a full day. Besides exploring the nearby sights, are just fantastic walks places like Preci, Norcia, Visso, Castelluccio di Norcia, Casali dell''Acquaro, Monte Patino.', ' In una piccola località alle porte del Parco Nazionale dei Monti Sibillini, un valido punto di partenza alla scoperta delle mille ricchezze del territorio, l''agriturismo Monti Sibillini Camperato è ideale per rilassarsi e oziare, magari esplorando gli spazi in cui si svolge la normale attività della fattoria, o passeggiando nel verde del giardino, o esplorando gli immediati dintorni noleggiando bici per simpatiche escursioni, o ancora per passeggiare lungo i sentieri del vicino bosco. Innumerevoli sono le escursioni con partenza dall''agriturismo, i sentieri si snodano all''interno del Parco Nazionale dei Monti Sibillini, escursioni per tutti. Si può in bici, a piedi, con muli organizzare passeggiate di durata da 1 ora ad un giorno intero. Oltre esplorare le adiacenti bellezze, si raggiungono con fantastiche passeggiate luoghi come Preci, Norcia, Visso, Castelluccio di Norcia, Casali dell''Acquaro, Monte Patino.\n', '', '', '', 0, 0, 0, 0, 'Via Campiana, 1, 06047 Corone PG, Italia', 42.8808, 13.0068, 17, 'For info and reservations call us at 0743939033 or 3206424898\nTo confirm your reservation you must pay 30% of the total, the balance is paid upon arrival', 'Per info e prenotazioni telefonare allo 0743939033 o al 3206424898\nPer confermare la prenotazione occorre versare il 30% dell''importo del soggiorno, il saldo si paga all''arrivo.\n\ncontattateci per E.mail info@agriturismocamperato.it', '', '', '', 'perugia S.Egidio 80km', '', '', 'Spoleto 40km', 'Norcia 18km', 'Civitanovamarche 90km', 'Preci 3km', '1', 0, 134),
(135, 1, 3, 'HOTEL TALAO SAS', 'C.SO MEDITERRANEO, 66', '87029', 'SCALEA', 3592, 1158, 80, '+3998520444', '+3998520927', 'http://www.www.hoteltalao.it', '', 'L''Hotel Talao si trova nel centro di Scalea, affacciato sul mare della Calabria, nella splendida cornice del Golfo di Policastro. ', '', '', '', '', 'L''Hotel Talao è la soluzione ideale per una vacanza al mare all''insegna del relax e del divertimento o come punto di partenza in ogni stagione per escursioni lungo la Riviera dei Cedri, tour per conoscere paesi con antiche tradizioni o alla scoperta del Parco Nazionale del Pollino praticando numerosi sport come rafting, trekking e mountain bike.', '', '', '', 0, 0, 0, 0, 'Corso Mediterraneo, 32, 87029 Scalea CS, Italia', 39.8158, 15.7878, 17, '', '', '', '', '', 'Lamezia Terme 120 km', 'Napoli 300 km', '', 'Scalea-Santa Domenica Talao - 1km', 'davanti all''Hotel ', 'direttamente sul mare', 'in Hotel', '1', 0, 135),
